var book = {
	"name": "၁ ကီရံၫ့",
	"numChapters": 16,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> ၦလၧအကိၭဝဲၩဝ့ၫလၧယ့ၫရှူၬဎရံၬ အဆၧအၪ့မၧၫ့ ဖိၪဘဲၫယွၩအၥၭအၥိၭ,ယၧၩ, စပီလူၫဒဲထၧၫ့ဖုဝဲစစီၭ",
			"2": "<sup>2</sup> စၥနံၫ (ပစံၭ)- ၦဆံၫ့ဎံၪလၧယ့ၫရှူၬဎရံၬ အဖၧၩ့,လၧ ဆၧကိၭဝဲၩဝ့ၫ လၧၦဆံၫ့ဎံၪ ယွၩအဆၧအီၪကီၪ့လၧ ကီရံၫ့အဖၧၩ့, ဒဲကယဲၦလၧအကိၭထၪ့ ပကဆါယ့ၫ ရှူၬဎရံၬအမံၩ့, အဝ့ၫၥံၪအကဆါဒဲပကဆါဆ့, ၦထီး",
			"3": "<sup>3</sup> အလူၬလၧကယဲအလးလစီၪ့လါလါနီၪ,- မွဲနၥံၪဘၪ ဆၧအခိးအတၩ, ဒဲဆၧဘၪလိၬအိၭလိၬ လၧပဖါ ယွၩ,ဒဲကဆါယ့ၫရှူၬ ဎရံၬနီၪဆံၭ.",
			"4": "<sup>4</sup> ယစံၭထၪ့အၪ့အူၭယယွၩ လၧနၥံၪအကၠီၩ့လထံၪ ဎးလဘီၩ့ဎး, လၧယွၩအခိးအတၩအကၠီၩ့လၧဆၧ",
			"5": "<sup>5</sup> ဖ့ၪလၫ့နၥံၪလၧယ့ၫရှူၬဎရံၬအဖၧၩ့တၭ,- ဒဲလၧအဝ့ၫ နီၪအကၠီၩ့နၥံၪန့ဘၪဆၧထူၭဆၧလၧၫ့လၧဆၧထီးအ",
			"6": "<sup>6</sup> လူၬအဖၧၩ့, ဒဲဆၧၥ့ၪယၫထီးအလူၬအဖၧၩ့,- ဘဲၫဆၧ ထိးအၥၭ ဘၪဆဲၫ့လၧဎရံၬနီၪ အီၪဂုးအီၪခၧၫ့ယူၭလၧ",
			"7": "<sup>7</sup> နၥံၪအဖၧၩ့အၥိၭနီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, နၥံၪ ယိလါပကဆါယ့ၫရှူၬဎရံၬအဆၧအီၪဖျီၪ အဖၧၩ့ၥၭ တၭ,ဆၧဖ့ၪလၫ့လမံၩ့မံၩ့လၧနၥံၪလန့ဘၪနီၪ အီၪလၩ့",
			"8": "<sup>8</sup> ထးနးမံၩ့အ့ၬ.- တၭအဝ့ၫဒၪမိဒုၭအီၪဂုးအီၪခၧၫ့နၥံၪ ထီးအထုၬ,ဘဲၫၥိၭလၧပကဆါယ့ၫရှူၬဎရံၬအမုနံၩ နီၪ,ဆၧအီၪက့ၪဆၧမၪ လၧနၥံၪအလီၩ့အလးထီးအီၪ",
			"9": "<sup>9</sup> လဂ့ၩလီၫ.- ယွၩလၧအကိၭ နၥံၪလၧဆၧဖံၭၥိၭလိၬန ၥံၪအၥၭလၧအဖိၪခွၫပကဆါယ့ၫရှူၬဎရံၬအဂးနီၪ, မွဲအလူတီၩလီၫ.",
			"10": "<sup>10</sup> ဖုၥံၪဝဲၥံၪဧ့, ဘဲၫၥိၭနၥံၪချဲၩ့ဆၧမိမီၪ့ဎီၩ့လိၬအၥၭ ဒဲဆၧလၩ့မုလၩ့ဖၭထီးအီၪလၧနၥံၪအကျၩ လဂ့ၩ နီၪ,နၥံၪမိအီၪ လၧနၥံၪကိၪ့ထၪ့ဖၭလၩ့ ဆၧလမံၩ့ဎး, နၥံၪအၥၭအီၪလဖျိၪ့ဎး လၩ့ထံးလၩ့ဆ့ၭတၭ, ယအၪ့ ကံၩ့အၪ့ယၫနၥံၪ လၧပကဆါယ့ၫရှူၬဎရံၬ အမံၩ့အ ကၠီၩ့လီၫ.",
			"11": "<sup>11</sup> အဂဲးဘဲၫယီၩယထၧၫ့ဖုဝဲၥံၪဧ့, ၦလၧအဘၪဆဲၫ့လၧ နးချိအံၫလဖၪလီၩဘၪယၧၩ လၧဆၧအဲၪ့လိၬဆိၭချဲၩ့",
			"12": "<sup>12</sup> အီၪလၧနၥံၪအကျၩလီၫ.- ယစံၭဆၧယီၩ,လၧနၥံၪစံၭ နၥံၪဝ့ၫလဂၩဘၪလဂၩဆုၬဆုၬ, ယဝ့ၫဒၪယီၩယမွဲၦ ဘၪဆဲၫ့လၧစပီလူၫ, ယဝ့ၫဒၪယီၩယမွဲၦဘၪဆဲၫ့လၧ စအၫပီလၧၭတၭ, ယဝ့ၫဒၪယီၩယမွဲၦဘၪဆဲၫ့လၧ စစံဖၭ,ယဝ့ၫဒၪယီၩယမွဲၦဘၪဆဲၫ့လၧဎရံၬလီၫ.",
			"13": "<sup>13</sup> မွဲဎရံၬအၪ့နၩ့ဖၭအၥၭဧၪး မွဲစပီလူၫထိးၥံၫအၥၭ လၧထုၪ့စူၪယၫအလီၩ့လၧနၥံၪအကၠီၩ့ဆ့ဧၪ, မွဲနၥံၪဒိၭ ဘၭတံၫဇၫ့နၥံၪအၥၭ လၧစပီလူၫအမံၩ့အဖၧၩ့ဆ့ဧၪ.",
			"14": "<sup>14</sup> ယစံၭထၪ့အၪ့အူၭယွၩအခိးအတၩ လၧယလဘၭတံၫ ဇၫ့ဘၪနၥံၪနးဂၩ, အ့ၪလမွဲဘၪ စအကြံစပၧၭဒဲ",
			"15": "<sup>15</sup> စဂ့အၧၭနီၪ,- ဘၪလဘၪၦလဂၩဂၩ မိစံၭဘၪခိၬလၧ",
			"16": "<sup>16</sup> ယဘၭတံၫဇၫ့ ဆၧလၧယမံၩ့ဒၪယဝ့ၫလီၫ.- ယဘၭ တံၫဇၫ့စတ့ဖနၭအဂံၪ့ဖိၪဆ့လီၫ. လၧနီၪအမ့ၬယၫ လၧယဘၭတံၫဇၫ့ ဂူၫဂၩလဂၩဂၩနီၪ, ယၥ့ၪယၫအ့ၬ.",
			"17": "<sup>17</sup> အဂဲးဘဲၫယီၩ ဘဲၫၥိၭယမိဘၭတံၫဇၫ့ဆၧနီၪ,ဎရံၬ အၪ့မၧၫ့လၩ့ယၧၩလမွဲဘၪ, မွဲလၧယမိလီၩလၩ့လၬ လၩ့ဆၧၥၭထိၬ အပရၧၫ့အဂးလီၫ. လၧဆၧချဲၩ့လၧ အဘၪဆဲၫ့လၧဆၧကိၪ့ၥ့ၪလမွဲဘၪ, ဘၪလဘၪဎရံၬ အထုၪ့စူၪယၫယီၩ မိကဲၪထၪ့ဘၪခိၬဆၧပျီၩပျီၩလီၫ.",
			"18": "<sup>18</sup> အဂဲးဘဲၫယီၩ ထုၪ့စူၪယၫအဆၧချဲၩ့နီၪ, မွဲဆၧပျီၩပျီၩ လၧၦလၧအဘၪ ဆၧဂၭဂီၩ့ဂၭစၪလဖၪအမ့ၬယၫ လါနၫ့ဘိၩ, လၧၦထီၩ့ယူၭ လၧဆၧထိးတဲၩ့တၩ့ထဲၩ့ လဖၪအဂး, ပဝ့ၫဒၪယီၩမွဲယွၩအစီၩ့အမၩ့လီၫ.",
			"19": "<sup>19</sup> အဂဲးဘဲၫယီၩဆၧကွ့ၭအၥၭ, ၦလၧအကိၪ့ဆၧၥ့ၪနီၪ, ယမိမၩဂၭဂီၩ့အဆၧကိၪ့ၥ့ၪ, ဒဲၦလၧအထီးလၩ့အၥၭလဖၪနီၪ, ယမိမၩကဲၪထၪ့အဆၧထီးလၩ့အၥၭလၧ ဆၧပျီၩပျီၩလီၫ.",
			"20": "<sup>20</sup> ၦလၧအကိၪ့ ဆၧၥ့ၪအီၪ ခီၫခီၫလဲၪ. ၦကွ့ၭလံၬ အီၪခီၫခီၫလဲၪ. ၦယီၩလကၠၪဖိၪ လၧအတၩ့ဆၧၫ့ဆၧ ချဲၩ့ၥ့ၪနီၪ, အီၪခီၫခီၫလဲၪ. ဂၪ့ခိၪအဆၧကိၪ့ၥ့ၪနီၪ",
			"21": "<sup>21</sup> ယွၩအီၪက့ၪဝ့ၫဘဲၫဆၧအဂီၩ့အၥိၭနီၪမွဲအ့ၬဧၪ.- အဂဲး ဘဲၫယီၩ ၦဂၪ့ခိၪဖိၪၥ့ၪယၫယွၩ လၧအဆၧကိၪ့ၥ့ၪဒၪ ဝ့ၫအကၠီၩ့လၥ့ၪဘၪတၭ, လၧယွၩကိၪ့ဆၧၥ့ၪအဖၧၩ့နီၪ, ဘၪယွၩအၥၭလၧအမိထိးထဲၩ့တၩ့ထဲၩ့ ၦလၧအ နဲၩဝ့ၫလဖၪ လၧဆၧလီၩလၩ့ အဆၧပျီၩပျီၩလီၫ.",
			"22": "<sup>22</sup> ၦယုဒၫဖိၪၥံၪအၪ့ကံၩ့ ဆၧလၩ့လၭတၭ, ၦဂြံစၭ",
			"23": "<sup>23</sup> ဖိၪၥံၪအၪ့ဎၬ ဆၧကိၪ့ၥ့ၪ,- အ့ၪမွဲပဝ့ၫဒၪယီၩ, ပလီၩ လၩ့လၬလၩ့ဎရံၬ လၧအထိးၥံၫအၥၭ လၧထုၪ့စူၪယၫ အလီၩ့, လၧၦယုဒၫဖိၪၥံၪ အမ့ၬယၫနီၪ, မွဲဆၧဘၪ ထၧၩ့အလး,ဒဲလၧၦဂြံစၭဖိၪၥံၪအမ့ၬယၫနီၪမွဲဆၧ",
			"24": "<sup>24</sup> ပျီၩပျီၩလီၫ.- မွဲလါနၫ့ဘိၩ, လၧၦဘၪဆၧကိၭဝ့ၫအမ့ၬ ယၫနီၪ, ၦယုဒၫဖိၪၥံၪမွဲဂ့ၩ, ၦဂြံစၭဖိၪၥံၪမွဲဂ့ၩ, မွဲဎရံၬ, ဘဲၫပစံၭဆၧအၥိၭယွၩအစီၩ့အမၩ့, ဒဲယွၩအဆၧကိၪ့",
			"25": "<sup>25</sup> ၥ့ၪလီၫ.- အဂဲးဘဲၫယီၩယွၩအဆၧဂီၩ့နီၪ, မွဲဆၧကိၪ့ ၥ့ၪနဲၪ့ၦၡၩဒံၭတၭ, ယွၩအဂဲးဆါအဘၭဆါနီၪ, မွဲဆၧ ဆီၪ့နဲၪ့ၦၡၩဒံၭလီၫ.",
			"26": "<sup>26</sup> အဂဲးဘဲၫယီၩထၧၫ့ဖုဝဲၥံၪဧ့, နၥံၪဒၪဘၪဆၧကိၭနၥံၪ လၧၦကိၪ့ဆၧၥ့ၪ ဘဲၫဆၧဖံၭဆၧယၪအၥိၭနီၪလမွဲဘၪ ၦအၪဂၩ, ၦအီၪလၧအစီၩ့အမၩ့လအၪဂၩဘၪ, ၦ",
			"27": "<sup>27</sup> ဒိၪအဆၨၩအဆၬအၪဂၩဆ့အ့ၬ.- မွဲယွၩရွံန့ဆၧအဂီၩ့ ၥံၪလၧဂၪ့ခိၪချိၫ့ဘဲၫၥိၭအမိမၩနၧၩ့မၩစၪ ဆၧကိၪ့ ၥ့ၪတၭ, ယွၩရွံန့ဆၧလၩ့ဆါ လၧဂၪ့ခိၪချိၫ့, ဘဲၫၥိၭအ",
			"28": "<sup>28</sup> မိမၩနၧၩ့မၩစၪ ဆၧအဂဲးအဘၭ ဆီၪ့လီၫ.- ယွၩရွံန့ ဆၧလၧအလၩအဖၩ့ လအီၪဘၪလၧဂၪ့ခိၪချိၫ့, ဒဲဆၧ လၧၦလယူၭ လယၪ့ ဘၪဝ့ၫလဖၪ, ဒဲဆၧလၧအလမွဲ ဘၪဆၧလဖၪ, ဘဲၫၥိၭအမိမၩဂၭဂီၩ့ခွံၬ ဆၧလၧအမွဲ",
			"29": "<sup>29</sup> ဆၧလဖၪလီၫ.- အဂဲးဘဲၫယီၩၦၡၩထီးအီၪက့ၪဖိၫလိၫ",
			"30": "<sup>30</sup> အၥၭလၧယွၩအမ့ၬယၫနးဂၩလဂ့ၩ- မွဲလၧအဝ့ၫ နီၪအကၠီၩ့တၭ နၥံၪအီၪလၧယ့ၫရှူၬဎရံၬအဖၧၩ့လၧ ယွၩအီၪက့ၪဝ့ၫလၧဆၧကိၪ့ၥ့ၪ, ဒဲဆၧတီၩဆၧလီၩ့",
			"31": "<sup>31</sup> ဒဲဆၧဆံၫ့ဎံၪ,ဒဲဆၧဎွ့ၩန့လၧပဂး,- ဘဲၫၥိၭဆၧ မိမၩအၥၭဘဲၫဆၧကွ့ၭအၥၭအၥိၭနီၪ, ၦလၧအ အီၪ က့ၪ ဖိၫ လိၫ အ ၥၭ နီၪ, မွဲ အ အီၪ က့ၪ ဖိၫ လိၫ အ ၥၭ လၧ က ဆါ အ ဖၧၩ့ ဆံၭ."
		},
		"2": {
			"1": "<sup>1</sup> ယဝ့ၫဒၪယီၩ, ထၧၫ့ဖုဝဲၥံၪဧ့, လၧယလ့ၩထီၩ့လၧ နၥံၪအအီၪနီၪ, ယလီၩဘၪနၥံၪ လၧယွၩအဆၧထိးအ ၥၭအီၪလၧဆၧချဲၩ့ အဂ့ၩအဘၪမွဲဂ့ၩ, ဆၧကိၪ့ၥ့ၪမွဲ",
			"2": "<sup>2</sup> ဂ့ၩ,မွဲအ့ၬ.- အဂဲးဘဲၫယီၩ အ့ၪလမွဲဘၪယ့ၫရှူၬဎရံၬ ဒဲအဝ့ၫဒၪထိးၥံၫအၥၭ လၧထုၪ့စူၪယၫအလီၩ့နီၪ, ယ အီၪက့ၪလၩ့ယူၭယၥၭ လၧယမိၥ့ၪယၫဆၧ လၧနၥံၪအ",
			"3": "<sup>3</sup> ကျၩနးမံၩ့အ့ၬ.- ယအီၪလၧ ယဂဲးဆါ ယဘၭဆါ, ဒဲဆၧၥၭမဲၪၥၭဖျဲၩ့, ဒဲဆၧဝၭထိၬအၪ လၧနၥံၪအကျၩ",
			"4": "<sup>4</sup> လီၫ.- ယဆၧချဲၩ့ ဒဲယဆၧလီၩလၩ့ အီၪလၧဆၧချဲၩ့ အၪ့လွ့ၫဘၪဆဲၫ့ လၧၦၡၩအဆၧကိၪ့ၥ့ၪလမွဲဘၪ, မွဲအ",
			"5": "<sup>5</sup> အီၪလၧၥၭမုအဆၧနဲၪဖျီၪဒဲဆၧစီၩ့ဆၧမၩ့,- ဘဲၫ ၥိၭနၥံၪအဆၧနဲၩ ထီးအီၪလၧၦၡၩ အဆၧကိၪ့ၥ့ၪလ ဂ့ၩ,မွဲလၧယွၩ အစီၩ့အမၩ့ လီၫ.",
			"6": "<sup>6</sup> မွဲလါနၫ့ဘိၩပမိချဲၩ့ဆၧကိၪ့ၥ့ၪ လၧၦလၧၫ့ထၪ့ဎွ့ၩ ထၪ့လဖၪအကျၩလီၫ.- မွဲလါနၫ့ဘဲၫနီၪတၭ,မွဲဆၧကိၪ့ ၥ့ၪဘၪဆဲၫ့လၧဂၪ့ခိၪယီၩ, ဒဲဂၪ့ခိၪဖိၪယီၩအၦဒိၪၦၡါ",
			"7": "<sup>7</sup> လၧအကဲၪထၪ့ဆၧပျီၩပျီၩနီၪအ့ၬ.- မွဲပချဲၩ့ယွၩအ ဆၧကိၪ့ၥ့ၪ လၧဆၧယိၬအဖၧၩ့, လၧဆၧကိၪ့ၥ့ၪအီၪၥူၪ ဝ့ၫလၧယွၩစ့ၩရၫ့ဝဲၩဝ့ၫလၧအလချႃၭ မၩကဲၪထၪ့ဒံၭ",
			"8": "<sup>8</sup> ဘၪဂၪ့ခိၪ လၧပလၩပဖၩ့အဂးလီၫ.- ဆၧနီၪၦဂၪ့ခိၪ ဖိၪအၦဒိၪၦၡါၥံၪ ၥ့ၪယၫဝ့ၫနးဂၩအ့ၬ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအ့ၪၥ့ၪယၫနီၪမွဲအမၩၥံၫ ဆၧလၩဆၧဖၩ့အ ကဆါ လၧထုၪ့စူၪယၫအလီၩ့အ့ၬ.",
			"9": "<sup>9</sup> မွဲလါနၫ့ဘိၩ, ဘဲၫဆၧကွ့ၭအၥၭအၥိၭ, ဆၧလဖၪ လၧ ယွၩ တဲၩ့ ဝဲၩ ဝ့ၫ လၧ ၦ အဲၪ အ ဝ့ၫ အ ဂး လ ဖၪ နီၪ, မ့ၬ ၥၪ လ ဒၪ ဘၪ, ဒဲ နါ လ နါ",
			"10": "<sup>10</sup> ဂၧၫ့ ဘၪ တၭ, နုၬလၧၦၡၩအၥၭအ့ၬ.- မွဲလါနၫ့ဘိၩ ယွၩနဲၪဖျီၪလၧအၥၭမုလၧပမ့ၬယၫလီၫ, အဂဲးဘဲၫ ယီၩ ၥၭမုနီၪအၪ့ဎၬဆၧထီးအလူၬ, ဆၧယိၬဘၪဆဲၫ့",
			"11": "<sup>11</sup> လၧယွၩဒၪလ့ၬလီၫ.- အဂဲးဘဲၫယီၩ အ့ၪလမွဲဘၪ ၦၡၩအၥၭအီၪ လၧအဖၧၩ့နီၪ, မွဲပလၫၥ့ၪယၫဆၧဘၪ ဆဲၫ့လၧၦၡၩလဂၩလဲၪ. ဘဲၫနီၪအၥိၭဆ့, ဆၧလၧ အဘၪဆဲၫ့လၧယွၩလဖၪနီၪ အ့ၪလမွဲဘၪ လၧယွၩအ",
			"12": "<sup>12</sup> ၥၭမုနီၪ, ၦၥ့ၪယၫၥ့ၪနးဂၩအ့ၬ.- ပလဒိၭန့ဘၪဂၪ့ ခိၪအၥၭတၭ, မွဲၥၭမုဘၪဆဲၫ့လၧယွၩဘဲၫၥိၭပမိၥ့ၪ",
			"13": "<sup>13</sup> ယၫဆၧလဖၪ လၧယွၩဖ့ၪလၫ့ယီၫပၧၩလီၫ.- ဆၧ နီၪလဖၪပလီၩလၩ့လၬလၩ့ လၧၦၡၩအဆၧၥီၪ့လိၪ လမွဲဘၪ,မွဲလၧၥၭမုအဆၧၥီၪ့လိၪလီၫ. ပယိဎီၩ့လိၬ ဆၧဘၪဆဲၫ့လၧၥၭ လၧဆၧဘၪဆဲၫ့ လၧၥၭလဖၪလီၫ.",
			"14": "<sup>14</sup> မွဲလါနၫ့ဘိၩ, ၦဘၪဆဲၫ့လၧဆၧဖံၭဆၧယၪၥံၪလထိး ဆၧၫ့ဘၪဆၧဘၪဆဲၫ့လၧယွၩအၥၭမုနီၪး အဂဲးဘဲၫ ယီၩဆၧလဖၪနီၪ မွဲဆၧအဂီၩ့လၧအမ့ၬယၫလီၫ. မွဲအ ၥ့ၪယၫဝ့ၫလၥ့ၪဘၪ, အဂဲးဘဲၫယီၩ ၦၥ့ၪယၫအဝ့ၫၥံၪ",
			"15": "<sup>15</sup> လၧဆၧဘၪဆဲၫ့ လၧၥၭနီၪလီၫ.- အ့ၪမွဲၦလၧအဘၪ ဆဲၫ့လၧၥၭမုစ့ၩရၫ့ဆၧထီးအလူၬ,လါနၫ့ဘိၩအနၫ့",
			"16": "<sup>16</sup> ဆါဒၪဝ့ၫနီၪ, ၦစ့ၩရၫ့နးဂၩအ့ၬ. အဂဲးဘဲၫယီၩ မွဲပ လၫ ၥ့ၪ ယၫ က ဆါ အ ၥၭ ဘဲၫ ၥိၭ အ မိ ၥီၪ့ လိၪ ဝ့ၫ လ ဂၩ လဲၪ.အ့ၪမွဲပဝ့ၫဒၪယီၩ, ပအီၪ လၧဎရံၬအၥၭလီၫ."
		},
		"3": {
			"1": "<sup>1</sup> ယဝ့ၫဒၪယီၩ,ဖုၥံၪဝဲၥံၪဧ့, ယချဲၩ့ဆၧလၧနၥံၪဘဲၫၦ လၧအဘၪဆဲၫ့လၧၥၭမုအၥိၭနီၪၥ့ၪအ့ၬ. မွဲဘဲၫၦဘၪ ဆဲၫ့လၧဆၧဖံၭ ဆၧယၪအၥိၭ, ဘဲၫၦဖိၪၥၪ လၧဎရံၬ",
			"2": "<sup>2</sup> အဖၧၩ့အၥိၭနီၪလီၫ.- ယဒုၭအၪ့နၥံၪ လၧဆၧနူထံၫ တၭ,ဆၧအၥံၭအခၩနီၪ လမွဲဘၪ, အဂဲးဘဲၫယီၩ လၧ အၥၫ့နၥံၪအၪ့လၥ့ၪဘၪနီၪ, ဘိၩ့နဲၪ့ယီၩဒၪလ့ၬ,နၥံၪ",
			"3": "<sup>3</sup> အၪ့ၥ့ၪဝါဒံၭအ့ၬ.- အဂဲးဘဲၫယီၩ မွဲနၥံၪဘၪဆဲၫ့လၧ ဆၧဖံၭဆၧယၪဒံၭလီၫ. အဂဲးဘဲၫယီၩ မွဲဆၧၥုၪ့ခ့ၬၥၭ ခ့ၬဒဲဆၧအဲၪ့လိၬဆိၭချဲၩ့,ဒဲဆၧလၩ့မုလၩ့ဖၭၥံၪအီၪ ဝ့ၫဒၪလၧနၥံၪအကျၩနီၪ နၥံၪမွဲၦဘၪဆဲၫ့လၧဆၧဖံၭ ဆၧယၪတၭ, နၥံၪလ့ၩဆၧဘဲၫၦၡၩအၥိၭမွဲအ့ၬဧၪ.",
			"4": "<sup>4</sup> အဂဲးဘဲၫယီၩလၧၦလဂၩစံၭဝ့ၫ,ယဝ့ၫဒၪယီၩယမွဲၦ ဘၪဆဲၫ့လၧစပီလူၫတၭ, အဂူၫဂၩလဂၩစံၭဝ့ၫ,ယဝ့ၫ ဒၪယီၩယမွဲၦဘၪဆဲၫ့လၧစအၫပီလၧၭနီၪ, နၥံၪဘၪ ဆဲၫ့လၧဆၧဖံၭဆၧယၪ, မွဲအ့ၬဧၪ.",
			"5": "<sup>5</sup> မၩအၥၭဘဲၫနီၪတၭ,စပီလူၫနီၪ, မွဲပလၫလဂၩလဲၪ. စအၫပီလၧၭနီၪ မွဲပလၫလဂၩလဲၪ. မွဲဆၧအခ့ၫအၡၩ လၧနၥံၪနဲၩဆၧအကၠီၩ့, ဘဲၫကဆါဖ့ၪလၫ့ဆၧလၧၦလ",
			"6": "<sup>6</sup> ဂၩဘၪလဂၩဆုၬဆုၬအၥိၭနီၪ,မွဲအ့ၬဧၪ.- ယဝ့ၫဒၪ ယီၩ ယၥုၪ့လၩ့ယူၭဆၧယူၭ, တၭစအၫပီလၧၭ လူၫ ယူၭဝ့ၫယူၭ. အ့ၪမွဲယွၩနီၪ, ဒုၭမဲၪထၪ့ဆၧလီၫ. မၩ",
			"7": "<sup>7</sup> အၥၭဘဲၫနီၪတၭ,- ၦလၧအၥုၪ့လၩ့ဆၧ မွဲဆၧအ့ၬ. ဒဲ ၦလၧအလူၫဆၧနီၪ, မွဲဆၧဆ့အ့ၬ.အ့ၪမွဲၦလၧအဒုၭ",
			"8": "<sup>8</sup> မဲၪထၪ့ဆၧယွၩလဂၩနီၪ, မွဲဆၧလီၫ.- မွဲလါနၫ့ဘိၩ, ၦလၧအၥုၪ့လၩ့ဆၧ ဒဲၦလၧအလူၫဆၧ မွဲဆၧလမံၩ့ဎး လီၫ. ၦမိန့ဘၪအလံၩ့အလဲၫ လဂၩဘၪလဂၩ ဘဲၫအ",
			"9": "<sup>9</sup> မၩဒၪဝ့ၫအၥိၭ ဆုၬဆုၬလီၫ.- အဂဲးဘဲၫယီၩ ပမွဲၦ မၩဆၧလၧယွၩအၥိၭလီၫ. နၥံၪမွဲယွၩအဆံၬအနၩ တၭ,နၥံၪမွဲယွၩအဂံၪ့လီၫ.",
			"10": "<sup>10</sup> ဘဲၫယွၩအခိးအတၩ လၧအဖ့ၪလၫ့ယၧၩအၥိၭ, ဘဲၫၦမၩဂံၪ့လဖၪအခိၪလၧအကိၪ့ထၪ့ ဆၧၥ့ၪအၥိၭနီၪ, ယအီၪက့ၪလၩ့ဂံၪ့ အခၪ့ထံၭတၭ, ဂူၫဂၩမၩထၪ့ဆၧ လၧအဖၫ့ခိၪလီၫ. မွဲလါနၫ့ဘိၩ မွဲအမၩကဲၪထၪ့ဆၧ လၧအဖၫ့ခိၪ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၫနီၪ, မွဲအထီးလၩ့",
			"11": "<sup>11</sup> အၥၭ ဆုၬဆုၬဘီၪ.- အဂဲးဘဲၫယီၩ လၧဆၧအီၪက့ၪ လၩ့အခၪ့ထံၭ, ဘဲၫၦစံၭဆၧအၥိၭ, လၧယ့ၫရှူၬဎရံၬ အမ့ၬယၫနီၪ, ၦအီၪက့ၪအခၪ့ထံၭ,လၧအဂူၫဂၩၥ့ၪ",
			"12": "<sup>12</sup> နးဂၩအ့ၬ.- ၦလဂၩဂၩ အ့ၪအီၪက့ၪ ထီၫ့ၥံၪလွ့ၫၥံၪ, ကျိၪၥံၪစ့ၩၥံၪ, မနံၬထၫ့မျါၥံၪ, ၥံၪ့ၥံၪဝၪၥံၪ, နၪ့ၥံၪမံၩ့",
			"13": "<sup>13</sup> ၥံၪ, လီခၫ့ၥံၪ, လၧအခၪ့ထံၭအဖၫ့ခိၪနီၪ,- အဆၧမၩ မိဖျီၪထၪ့ဆုၬဆုၬလီၫ. အဂဲးဘဲၫယီၩ မုနံၩလနံၩနီၪ မိနဲၪဖျီၪအဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ မိဘၪနဲၪဖျီၪအၥၭ လၧမ့ၪဖၧၩ့တၭ, ၦလဂၩဘၪလဂၩအဆၧမၩမွဲဘဲၫၥ့ၪ",
			"14": "<sup>14</sup> လဲၪဘဲၫၥ့ၪလဲၪနီၪမ့ၪမိအၪ့ခွါဝ့ၫလီၫ.- ၦလဂၩဂၩ အဆၧမၩလၧအမၩထၪ့ဝ့ၫ လၧအဖၫ့ခိၪအ့ၪအီၪဒံၭနီၪ",
			"15": "<sup>15</sup> မွဲအမိန့ဘၪဝ့ၫအလံၩ့အလဲၫလီၫ.- ၦလဂၩဂၩအဆၧ မၩနီၪမ့ၪအ့ၪအၪ့ခွံၬဝ့ၫတၭ, အဆၧမိလၩ့မါလီၫ. မွဲလါ နၫ့ဘိၩ, အနၫ့ဆါဒၪဝ့ၫ မိဖီၩ့ဖျ့ၭဝ့ၫဒၪလီၫ. မွဲလါနၫ့ ဘိၩမၩအၥၭ ဘဲၫမ့ၪအၪ့ဝ့ၫအၥိၭနီၪလီၫ.",
			"16": "<sup>16</sup> နၥံၪမွဲယွၩအဆၧလုဂံၪ့နီၪ, ယွၩအၥၭမုအီၪဂုးဝ့ၫ",
			"17": "<sup>17</sup> လၧနၥံၪအဖၧၩ့, မွဲနၥံၪလၥ့ၪယၫဘၪဧၪ.- ၦလဂၩ ဂၩအ့ၪမၩဂၭဂီၩ့ယွၩအဆၧလုအဂံၪ့တၭ, ယွၩမိမၩ ဂၭဂီၩ့အဝ့ၫနီၪလီၫ. အဂဲးဘဲၫယီၩ ယွၩအဆၧလုအ ဂံၪ့မွဲဆၧဆံၫ့ဎံၪတၭ, ဆၧလုအဂံၪ့နီၪ, မွဲနၥံၪလီၫ.",
			"18": "<sup>18</sup> မွဲၦထီးအၪ့လီၫန့အနၫ့ဆါဒၪဝ့ၫ နးဂၩလဂ့ၩ, ၦလ ဂၩဂၩလၧနၥံၪအကျၩ အ့ၪဆီၫ့မီၪ့ဝ့ၫ လၧအမွဲၦကိၪ့ ဆၧၥ့ၪလၧၦအယီၩလကၠၪဖိၪအကျၩတၭ, ဘဲၫၥိၭ အမိကဲၪထၪ့ ၦအကိၪ့ဆၧၥ့ၪလဂၩနီၪ, မွဲအကဲၪထၪ့",
			"19": "<sup>19</sup> ဆိၫဒၪခလူၬၦအဂီၩ့ဖိၪဆံၭ.- အဂဲးဘဲၫယီၩဆၧကိၪ့ၥ့ၪ ဘၪဆဲၫ့လၧဂၪ့ခိၪယီၩ မွဲဆၧဂီၩ့လၧယွၩအမ့ၬယၫလီၫ. အဂဲးဘဲၫယီၩ ဆၧ ကွ့ၭ အ ၥၭ, ယွၩ ဖီၪ့ ထၬၦ ကိၪ့ ဆၧ ၥ့ၪ လၧ အ ဆၧ အၪ့ လီၫ ဒၪ ဝ့ၫ အဖၧၩ့",
			"20": "<sup>20</sup> လီၫ.- ဆၧစံၭဒီၭဝ့ၫ, ယွၩၥ့ၪယၫၦကိၪ့ဆၧၥ့ၪအဆၧဆီၫ့မီၪ့လဖၪ, လၧအမွဲဆၧပျီၩပျီၩလီၫ.",
			"21": "<sup>21</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦထီးအီၪက့ၪဖိၫလိၫအၥၭလၧ ၦၡၩအဖၧၩ့ နးဂၩလဂ့ၩး အဂဲးဘဲၫယီၩဆၧထီး",
			"22": "<sup>22</sup> အလူၬမွဲနၥံၪအဆၧး- စပီလူၫမွဲဂ့ၩ,စအၫပီလၧၭမွဲဂ့ၩ, စစံဖၭမွဲဂ့ၩ, ဂၪ့ခိၪမွဲဂ့ၩ, ဆၧမၧၫ့မွဲဂ့ၩ,ဆၧၥံၫမွဲဂ့ၩ, ဆၧမၩအၥၭဘိၩ့နဲၪ့ယီၩမွဲဂ့ၩ, ဆၧမိမၩအၥၭလၧယၫ လခီၫမွဲဂ့ၩ, ဆၧထီးအလူၬလဖၪနီၪ မွဲနၥံၪအဆၧ,",
			"23": "<sup>23</sup> နၥံၪမွဲဎရံၬအဆၧတၭ, ဎရံၬမွဲယွၩအဆၧလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> မွဲၦၡၩအီၪက့ၪပၧၩ ဘဲၫဎရံၬအခ့ၫအၡၩဒဲၦယိ",
			"2": "<sup>2</sup> ယွၩအဆၧယိၬလဖၪ အၥိၭနီၪဘီၪ.- လၧနီၪအမ့ၬယၫ",
			"3": "<sup>3</sup> ၦယိဆၧလဖၪနီၪ ဘၪမၩအလူတီၩလီၫ.- မွဲလါနၫ့ ဘိၩနၥံၪစ့ၩရၫ့ယၧၩမွဲဂ့ၩၦၡၩအဆၧစ့ၩရၫ့မွဲဂ့ၩ, ယ အီၪက့ၪဝ့ၫ လၧဆၧအဆံၭထုၬ, မွဲမၬယစ့ၩရၫ့ယၥၭဒၪ",
			"4": "<sup>4</sup> ယဝ့ၫမွဲဆ့အ့ၬ.- အဂဲးဘဲၫယီၩယၥၭလၥ့ၪယၫဘၪလါ နၫ့ဆၧအမၪ လၧယဖၧၩ့ဒၪယဝ့ၫတၭ, မွဲလၧအနီၪအ ကၠီၩ့ဆၧအီၪက့ၪတီၩအီၪက့ၪလီၩ့ယၧၩအ့ၬ. ၦလၧ",
			"5": "<sup>5</sup> အစ့ၩရၫ့ယၧၩနီၪ မွဲကဆါလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, လၧအဆၧၫ့အထီလဘၪဒံၭဘၪ, ကဆါလချႃၭဂဲၫလၩ့ ဒံၭဘၪနီၪ, ထီးစ့ၩရၫ့ဆၧနးမံၩ့လဂ့ၩး အဝ့ၫဒၪနီၪမိ နဲၪဖျီၪဆၧအီၪၥူၪအီၪလၧဆၧခံၭကျၩ, ဒဲမိမၩဖျီၪဆၧ ကိၪ့အီၪလၧၦအၥၭခံဖၧၩ့လီၫ. ထီးနီၪလဖၧၫ့ ၦမိန့ဘၪ အဆၧအၪ့အူၭ လၧယွၩ, လဂၩအဂးလဂၩအဂး ဆုၬ ဆုၬလီၫ.",
			"6": "<sup>6</sup> ဖုၥံၪဝဲၥံၪဧ့, ဆၧလဖၪနီၪ ယချဲၩ့ဒီၩ့လၩ့ဆၧလၧယ နၫ့ဆါဒၪယဝ့ၫ, ဒဲစအၫပီလၧၭ လၧနၥံၪအဂးဘဲၫၥိၭ နၥံၪမိမၩလိၪဆၧလၧပဖၧၩ့, ဒဲနၥံၪလဆီၫ့မီၪ့ဘၪလၧ ၦၡၩဂ့ၩနဲၪ့ဆၧကွ့ၭအၥၭ လၧအဂဲးလဂ့ၩ, ဘဲၫၥိၭနၥံၪ ထီးအီၪက့ၪဖိၫလိၫနၥံၪအၥၭ လၧၦလဂၩအကၠီၩ့ အၪ",
			"7": "<sup>7</sup> နဲၪ့ဂူၫဂၩအကၠီၩ့လဂ့ၩ.- အဂဲးဘဲၫယီၩ မွဲပလၫမၩလၩ့ မဲၩနၧၩ လဂၩလဲၪ. တၭဆၧလၧ နလဒိၭန့ဘၪဝ့ၫနီၪမွဲ ဆၧနီၪလၫ အီၪလၧနၧၩ လမံၩ့လဲၪ. နအ့ၪဒိၭန့ဆၧ တၭ, မွဲဘၪနီၫနအီၪက့ၪဖိၫလိၫနၥၭ ဘဲၫနလဒိၭန့ဘၪ အၥိၭနီၪလဲၪ.",
			"8": "<sup>8</sup> ဘိၩ့နဲၪ့ယီၩ နၥံၪအီၪလၧၫ့ဎွ့ၩယူၭ, ဒဲနၥံၪကဲၪၦ ၥထံၫယူၭ. ပလအီၪဘၪနီၪနၥံၪပၧၩ့ဘၪဆၧဘဲၫစဎွၩ အၥိၭနီၪ, ပၥၭအီၪလၧနၥံၪ မိပၧၩ့ဘၪဆၧနီၪ ဘဲၫၥိၭ ပမိပၧၩ့ဘၪဎုၬဆၧ လၧနၥံၪဆ့လီၫ.",
			"9": "<sup>9</sup> အဂဲးဘဲၫယီၩ ယဆီၫ့မီၪ့လၧယွၩအီၪက့ၪဖျီၪဆၧ အၪ့မၧၫ့ဖိၪပဝ့ၫဒၪယီၩ လၧခဲၫ့ထုၬ, ဘဲၫၦလၧဆၧအီၪ က့ၪဝ့ၫလၧဆၧၥံၫ အဂးအၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩ ဆၧအီၪက့ၪပၧၩ လၧဆၧယိဖၧၩ့အလးလၧဂၪ့ခိၪ, ဒဲ လၧဆၧအၥီၫ့ၥံၪ, ဒဲလၧၦၡၩၥံၪ အမ့ၬယၫလီၫ.",
			"10": "<sup>10</sup> ပဝ့ၫဒၪယီၩ ပမွဲၦဂီၩ့ဖိၪၥံၪလၧဎရံၬ အကၠီၩ့တၭ, အ့ၪမွဲနၥံၪဝ့ၫဒၪလဖၪ နၥံၪမွဲၦကိၪ့ဆၧၥ့ၪ လၧဎရံၬအ ဖၧၩ့လီၫ. ပဝ့ၫဒၪယီၩပမွဲ ၦလၧအဂဲးဆါဘၭဆါတၭ, အ့ၪမွဲနၥံၪဝ့ၫဒၪလဖၪ နၥံၪအဂဲးအဘၭဆီၪ့လီၫ. နၥံၪ ဝ့ၫဒၪလဖၪ နၥံၪအလၩအဖၩ့အီၪဝ့ၫ, အ့ၪမွဲပဝ့ၫဒၪယီၩ ဆၧယူၭဆၧယၪ့ ပၧၩအ့ၬ.",
			"11": "<sup>11</sup> ထီၩ့လၩ့လၧနၩရံၩ ဘိၩ့နဲၪ့ယီၩဒၪလ့ၬ ဆၧၥၭဝံပၥၭ, ဒဲဆၧၥူၫအီၩပၥၭလၧထံၫ, ဒဲပအီၪဘိၪ့,ဒဲထိးဘၪဆၧ ဒိၪပၧၩ, ဒဲပအီၪလၧလး လလၩ့ထံး လၩ့ဆ့ၭဘၪ,",
			"12": "<sup>12</sup> ပမၩဆၧဖံၭဆၧတၭ, ပမၩလၧပစူၪဒၪပဝ့ၫး ၦၡၩ ဒုၪဒွ့ၪပၧၩတၭ ပဆိၪဂ့ၩဆၧး ၦၡၩ မၩအၧၩ့မၩၥၫ့",
			"13": "<sup>13</sup> ပၧၩတၭ,ပအွံၪၥၭဆၧၩ့ဆၧလီၫ.- ၦၡၩစံၭအၧၩ့ပၧၩ တၭပအၪ့ကံၩ့ အၪ့ယၫဆၧ, ဆၧအီၪက့ၪပၧၩဘဲၫဂၪ့ ခိၪအဆၧဘံၪၥိၭအၥိၭ, ဘဲၫဆၧထီးအလူၬအကံၪ အမူၭအၥိၭ ခီးမုဆၫလနံၩယီၩ လီၫ.",
			"14": "<sup>14</sup> ယကွ့ၭဆၧလဖၪယီၩ ဘဲၫၥိၭယမိမၩမဲ နၥံၪအမ့ၬ လမွဲဘၪ, မွဲဘဲၫယဖိၪခွၫ ၥၭဘီၩ့ၥံၪအၥိၭ, ယဒုၭထီး",
			"15": "<sup>15</sup> လၩ့နၥံၪအၥၭလီၫ.- အဂဲးဘဲၫယီၩ နၥံၪအ့ၪအီၪ လၧၦၥီၪ့ထဲၩ့ ၥၫ့ထဲၩ့နၥံၪ လၧဎရံၬအဖၧၩ့ လလၬလါ နၫ့,နၥံၪအဖါအီၪအၪဂၩအ့ၬ, အဂဲးဘဲၫယီၩ ယထၪ့ဖိၪ နၥံၪလၧဆၧၥၭထိၬ အပရၧၫ့အကၠီၩ့ လၧယ့ၫရှူၬဎရံၬ",
			"16": "<sup>16</sup> အဖၧၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယပဂၨၪထၪ့နၥံၪ",
			"17": "<sup>17</sup> အခဲၫ့,မွဲနၥံၪယိလိၪယၧၩဆံၭ.- မွဲဆၧနီၪအကၠီၩ့တၭ, စထံမၥံၫ လၧအမွဲယဖိၪခွၫၥၭဘီၩ့, အလူတီၩလၧက ဆါအဖၧၩ့လဂၩနီၪ, ယအၪ့မၧၫ့အလ့ၩလၧနၥံၪအအီၪ တၭ, အဝ့ၫဒၪမိဒုၭနၪ့ထၪ့ထဲၩ့နၥံၪ လၧယဖၧၩ့ၥုၪ့ဖၧၩ့ ၥၭ လၧဎရံၬအဖၧၩ့ ဘဲၫယၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ ဆၧလၧ ကယဲဆၧအီၪကီၪ့ထီးအလူၬအဖၧၩ့ ဎံၩ့ဎံၩ့လ့ၬအၥိၭ နီၪလီၫ.",
			"18": "<sup>18</sup> ၦလနၩ့နၩ့အီၪက့ၪဖိၫလိၫအၥၭ ဘဲၫယလလ့ၩဘၪ",
			"19": "<sup>19</sup> ယဝ့ၫလၧနၥံၪအအီၪအၥိၭနီၪလီၫ.- မွဲလါနၫ့အ့ၪဘၪ ကဆါအၥၭနီၪ, ယမိလ့ၩလၧနၥံၪအအီၪ လၧအဆိၫ အချဲၫ့တၭ,ၦလၧအအီၪက့ၪဖိၫလိၫအၥၭလဖၪ,ယမိ ၥ့ၪယၫလၧအဆၧချဲၩ့လမွဲဘၪ,မွဲဆၧအစီၩ့အမၩ့",
			"20": "<sup>20</sup> လီၫ.- အဂဲးဘဲၫယီၩ ယွၩအဘၩ့အမုး လအီၪဘၪလၧ ဆၧချဲၩ့တၭ, မွဲလၧဆၧအစီၩ့အမၩ့လီၫ.",
			"21": "<sup>21</sup> မွဲအဘၪနၥံၪအၥၭဘဲၫၥ့ၪလဲၪ, မွဲယမိဘၪလ့ၩလၧ နၥံၪအအီၪ,လၧနိၪကဲၩ့နီၪ,မွဲလၧဆၧအဲၪဆၧကွံၩ, ဒဲဆၧၥုၪ့ဆၧၩ့ၥၭဆၧၩ့လဲၪ."
		},
		"5": {
			"1": "<sup>1</sup> ဆၧဂၧၫ့ထၪ့ၥၩလၩ့ဎံၩ့ဎံၩ့လ့ၬ, လၧဆၧမၩမၪမုၪ မၩမၪခွၫအီၪဝ့ၫ လၧနၥံၪအကျၩ, ဒဲဆၧမၩမၪမုၪ မၩ မၪခွၫလမံၩ့လၧၦၡၩမၩန့အဖါအမၫ,လၧဆၧလကိၭ",
			"2": "<sup>2</sup> ဘၪအမံၩ့လၧၦဆၨၩလဖၪအကျၩလီၫ.- နၥံၪအီၪက့ၪ ဖိၫလိၫနၥံၪအၥၭတၭ, လၥုၪ့အုၭလၥၭအုၭဘၪလ ခီၫ,ဘဲၫၥိၭၦလၧအမၩဆၧလမံၩ့နီၪ, မိဘၪဆၧနၫ့ထၪ့",
			"3": "<sup>3</sup> ခွံၬဝ့ၫလၧနၥံၪအကျၩလီၫ.- အဂဲးဘဲၫယီၩလၧယမိၡါ ယလအီၪဘၪလါနၫ့ဘိၩ,လၧယၥၭယအီၪတၭ,ဘဲၫ ယအီၪအၥိၭယစ့ၩရၫ့ယူၭ ၦလၧအမၩဆၧလမံၩ့နီၪ,",
			"4": "<sup>4</sup> ထီးနၥံၪအ့ၪအီၪကိၩ့အီၪကီၪ့ လၧပကဆါ ယ့ၫရှူၬ ဎရံၬအမံၩ့,ဒဲယၥၭဆ့ဘဲၫၥိၭနၥံၪမိဖ့ၪလၫ့ခွံၬၦဘဲၫ နီၪအၥိၭ လၧပကဆါယ့ၫရှူၬဎရံၬအစီၩ့အမၩ့လၧ",
			"5": "<sup>5</sup> မုၪခီၩလဲးအစူၪဖၧၩ့,- လၧအဖံၭအယၪ မိဂၭဂီၩ့အ ဂး,ဘဲၫၥိၭအၥၭမိထီၩ့လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫ",
			"6": "<sup>6</sup> လၧကဆါယ့ၫရှူၬအနံၩနီၪလီၫ.- နၥံၪအီၪက့ၪဖိၫလိၫ နၥံၪအၥၭနီၪမွဲဆၧလကြၨၭဘၪလီၫ. မွဲနၥံၪလၥ့ၪယၫ ဘၪလၧမံၪလဆံၭဖိၪ မၩဖၭထၪ့ဆၧထၧၫ့ဖျိၪ့ယၫဧၪ.",
			"7": "<sup>7</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘဲၫနၥံၪလဘၪဘၪ လၧမံၪအၥိၭ နီၪ,ဘဲၫၥိၭနၥံၪမိကဲၪထၪ့ ဆၧအၥၫ့လဖျိၪ့တၭ, ခွံၬၡိၭ ခွံၬမံၪအလံၩဘီၪ. အဂဲးဘဲၫယီၩ ပဆၧဘိၪ့လ့ၩဖၬ,",
			"8": "<sup>8</sup> ဎရံၬနီၪဘၪဆၧမၩၥံၫယူၭလၧပကၠီၩ့ယူၭလီၫ.- မၩ အၥၭဘဲၫနီၪတၭ, ပမၩဘိၪ့နီၪမွဲပထီးမၩလၧမံၪအ လံၩဒဲမံၪအအၧၩ့အၥၫ့ ဒဲဆၧဒဲၩထူၬ ဒဲၩဘၭလဂ့ၩ, အ့ၪမွဲဆၧဂ့ၩဆၧဘွၩ ဒဲဆၧမွဲဆၧတီၩယီၩ လၧအ လဘၪဆဲၫ့ဘၪလၧမံၪနီၪဆံၭ.",
			"9": "<sup>9</sup> ယကွ့ၭန့နၥံၪလၧလံၬလဘံၪ့အဖၧၩ့, ဘဲၫၥိၭနၥံၪ ထီးဖံၭၥိၭလိၬနၥံၪအၥၭလၧၦမၩမၪၦမုၪၦမၧၩ့လဂ့ၩ",
			"10": "<sup>10</sup> နီၪလီၫ.- တၭမွဲလၧဂၪ့ခိၪယီၩ အၦၡၩမၩမၪ ၦမုၪ ၦမၧၩ့မွဲဂ့ၩ, ၦၥၭကွံၩစ့ၩမွဲဂ့ၩ, ၦအၪ့ဘျံၭအၪ့ဘျၪမွဲ ဂ့ၩ,ၦဘၩဆၧဂၩ့မွဲဂ့ၩ, ဖံၭၥိၭလၧၩ့လါလါလဂ့ၩနီၪ, မွဲအ့ၬ. အ့ၪမွဲဘဲၫနီၪတၭ, နၥံၪဘၪစဲၪ့ထၪ့ခွံၬ လၧဂၪ့ခိၪ",
			"11": "<sup>11</sup> ချိၫ့ယီၩလီၫ.- အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ, ယကွ့ၭန့နၥံၪလၧၦ လၧၦကိၭဝ့ၫ အထၧၫ့ဖုဝဲလဂၩဂၩ,အ့ၪမွဲၦမၩမၪ ၦမုၪၦမၧၩ့မွဲဂ့ၩ, ၦၥၭကွံၩစ့ၩမွဲဂ့ၩ, ၦဘၩဆၧဂၩ့မွဲဂ့ၩ, ၦဒုၪဒွ့ၪဆၧမွဲဂ့ၩ, ၦအီၩမၧၩ့ ၥံၭထံၫဂၬထံၫမွဲဂ့ၩ, ၦ အၪ့ဘျံၭအၪ့ဘျၪမွဲဂ့ၩ, ထီးဖံၭၥိၭလိၬနၥံၪအၥၭလၧ အဝ့ၫနီၪလဂ့ၩး ထီးအၪ့ဎုၬဆၧလၧ ၦဘဲၫနီၪအၥိၭလ",
			"12": "<sup>12</sup> ဂၩလဂ့ၩ.- ၦအီၪလၧခီၫ့လဖၪ ဘၪဆဲၫ့လၧယၧၩ, ဘဲၫ ၥိၭယမိစ့ၩရၫ့ဝ့ၫဘဲၫၥ့ၪလဲၪ.နၥံၪစ့ၩရၫ့ၦအီၪလၧ",
			"13": "<sup>13</sup> အဖၧၩ့လဖၪ, မွဲအ့ၬဧၪ.- အ့ၪမွဲၦအီၪလၧခီၫ့လဖၪနီၪ, ယွၩစ့ၩရၫ့အဝ့ၫၥံၪလီၫ. ၦအၧၩ့ၦၥၫ့လဂၩနီၪ, နၫ့ထၪ့ ခွံၬအဝ့ၫလၧနၥံၪအကျၩဆံၭ."
		},
		"6": {
			"1": "<sup>1</sup> နၥံၪဝ့ၫဒၪလဂၩဂၩ နၥံၪအဆၧဘၪဆဲၫ့ လၧၦဂူၫဂၩ အ့ၪအီၪနီၪ, မွဲနၥံၪချဲၩ့ခွး လၧၦလတီၩလလီၩ့ဘၪအ မ့ၬယၫတၭ, လမွဲဘၪလၧၦဆံၫ့ဎံၪ အမ့ၬယၫနီၪ, ဘၪ",
			"2": "<sup>2</sup> မိဘုၪ့ဧၪ.- လၧၦဆံၫ့ဎံၪၥံၪမိစ့ၩရၫ့ဂၪ့ခိၪဖိၪ, မွဲနၥံၪ လၥ့ၪယၫဘၪဧၪ. တၭဂၪ့ခိၪဖိၪၥံၪ အ့ၪဘၪဆၧစ့ၩရၫ့ လၧနၥံၪနီၪ, မွဲနၥံၪစ့ၩရၫ့ဆၧ လၧအဆံၭထုၬလဖၪ လ",
			"3": "<sup>3</sup> ကြၨၭဘၪဧၪ.- မွဲနၥံၪလၥ့ၪယၫဘၪ လၧပမိစ့ၩရၫ့အ ၥီၫ့လဖၪဧၪး တၭဆၧဘၪဆဲၫ့လၧလကၠၪယီၩ အၪနဲၪ့",
			"4": "<sup>4</sup> အနီၪဒံၭဆံၭဒိၪလဲၪ.- မၩအၥၭဘဲၫနီၪတၭ, စ့ၩရၫ့ဆၧ လၧအဘၪဆဲၫ့ လၧလကၠၪယီၩ အလးအ့ၪအီၪတၭ, ၦ လၧအလၩအဖၩ့ အီၪဝ့ၫအဆံၭထုၬ လၧဆၧအီၪကီၪ့ အကျၩလဖၪနီၪ, အီၪက့ၪအဝ့ၫၥံၪ ဘဲၫၥိၭအမိစ့ၩရၫ့",
			"5": "<sup>5</sup> ဆၧဘဲၫနီၪဆံၭ.- ယချဲၩ့ဆၧလၧနၥံၪမ့ၬမဲ အဂးလီၫ. ၦကိၪ့ဆၧၥ့ၪမွဲလအီၪဘၪ လၧနၥံၪအကျၩ နးဂၩအ့ၬဧၪ. ၦစ့ၩရၫ့အၪ့နၩ့ဖၭ အထၧၫ့ဖုဝဲလဂၩ ဒဲလဂၩအဆၧၫ့",
			"6": "<sup>6</sup> လအီၪဘၪနးဂၩ, မွဲဆၧမၩအၥၭဘဲၫနီၪဧၪ.- မွဲထၧၫ့ဖု ဝဲချဲၩ့ခွး လၧထၧၫ့ဖုဝဲတၭ, မၩဝ့ၫဘဲၫနီၪ, လၧၦလနဲၩ",
			"7": "<sup>7</sup> ဘၪလဖၪ အမ့ၬယၫဆ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩဆၧမၪအီၪဝ့ၫ လၧနၥံၪအလီၩ့ လၩ့ထံးလၩ့ ဆ့ၭ လၧနၥံၪချဲၩ့လိၬ နၥံၪအၥၭ လၧခွးအကၠီၩ့လီၫ. လမၩဘၪဘဲၫနီၪအဖၫ့ခိၪ, နၥံၪလဒိၭန့ဘၪ ဆၧမၩန ၥံၪလတီၩဘၪနီၪ, မွဲနၥံၪလထိးဘၪၦမၩဘျံၭမၩဘျၪန",
			"8": "<sup>8</sup> ၥံၪမွဲဘၪလဲၪ.- မွဲမၬ, နၥံၪမၪဘၪဆၧ, ဒဲမၩဆၧလတီၩ လလီၩ့ဘၪတၭ, ၦလၧနၥံၪမၩဝ့ၫဘဲၫနီၪ အၥိၭမွဲမၬ, နၥံၪအထၧၫ့ဖုဝဲၥံၪဆ့လီၫ.",
			"9": "<sup>9</sup> ၦလတီၩလလီၩ့ဘၪလဖၪနီၪ, လန့ၥၫဘၪယွၩ အ ဘၩ့အမုးနီၪ မွဲနၥံၪလၥ့ၪယၫဘၪဧၪ. ထီးအၪ့လီၫလၩ့ နၥံၪအၥၭလဂ့ၩ, ၦမၩမၪၦမုၪၦမၧၩ့မွဲဂ့ၩ, ၦဘၩဆၧ ဂၩ့မွဲဂ့ၩ, ၦမၩမၪၦမၫမွဲဂ့ၩ, ၦဘၪဆၧအဲၪပခၧၩ့မွဲ",
			"10": "<sup>10</sup> ဂ့ၩ, ၦအဲၪပခၧၩ့မွဲဂ့ၩ, ၦအၪ့ဂူၪဆၧမွဲဂ့ၩ, ၦလီၫ့ကီၩ့ ၥၭကွံၩဆၧမွဲဂ့ၩ, ၦအီၩမၧၩ့ၥံၭထံၫဂၬထံၫမွဲဂ့ၩ, ၦဒုၪ ဒွ့ၪဆၧမွဲဂ့ၩ, ၦအၪ့ဘျံၭအၪ့ဘျၪဆၧမွဲဂ့ၩ, န့ၥၫယွၩ",
			"11": "<sup>11</sup> အဘၩ့အမုးအ့ၬ.- နၥံၪဝ့ၫဒၪယီၩလနၩ့နၩ့, နၥံၪမွဲယူၭ ၦၡၩဘဲၫနီၪအၥိၭလီၫ. မွဲလါနၫ့ဘိၩ, လၧကဆါယ့ၫ ရှူၬအမံၩ့, ဒဲလၧပယွၩအၥၭမုနီၪတၭ,နၥံၪဘၪဆၧ ၥူၫဝၭဆံၫ့ခွံၬယူၭ, နၥံၪဆံၫ့ဎံၪထၪ့ယူၭ,ဆၧအီၪက့ၪ ယူၭနၥံၪလၧၦတီၩၦလီၩ့ယူၭလီၫ.",
			"12": "<sup>12</sup> ဆၧထီးအလူၬ အ့ၪတီၩအ့ၪလီၩ့ လၧယဂးလါနၫ့ ဘိၩ, ဆၧထီးအလူၬ မၩအၪထၪ့ဆၧ အခိးအတၩမွဲအ့ၬ. ဆၧထီးအလူၬ အ့ၪတီၩအ့ၪလီၩ့ လၧယဂးလါနၫ့ဘိၩ, ယအီၪလၧဆၧအစီၩ့အမၩ့အဖၫ့လၬနးမံၩ့အ့ၬ.",
			"13": "<sup>13</sup> ဆၧအၪ့ဆၧအီၩမွဲလၧဂူၭဖိၫ့အဂးတၭ, ဂူၭဖိၫ့မွဲ လၧဆၧအၪ့ဆၧအီၩ အဂးလီၫ. မွဲလါနၫ့ဘိၩ, ယွၩမိ မၩဂၭဂီၩ့ နံၫမံၩ့လူၬလီၫ. မွဲလါနၫ့ဘိၩ, ပမိၡါယီၩမွဲ ဆၧမၩမၪမုၪမၩမၪခွၫအဂးမွဲအ့ၬ.မွဲလၧကဆါအ",
			"14": "<sup>14</sup> ဂး,ဒဲကဆါနီၪလၧပမိၡါအဂးလီၫ.- ယွၩမၩဂဲ ထုၪ့ထဲၩ့ကဆါ, ဒဲမိမၩဂဲထုၪ့ထဲၩ့ပၧၩဆ့လၧအစီၩ့ အမၩ့ဒၪဝ့ၫလီၫ.",
			"15": "<sup>15</sup> လၧနၥံၪအမိၡါလဖၪနီၪ,မွဲဎရံၬအဂၩ့လဖၪ, မွဲနၥံၪ လၥ့ၪယၫဘၪဧၪ. မၩအၥၭဘဲၫနီၪတၭ, မွဲယမိမၩန့ ဎရံၬအဂၩ့လဖၪနီၪ, အီၪက့ၪဝ့ၫလၧမဲၩဎွဲၩမုၪအဂးဧၪ.",
			"16": "<sup>16</sup> မွဲလၩလါအ့ၬ.- ၦလၧအဘၪဆဲၫ့လိၬအၥၭ လၧမဲၩ ဎွဲၩမုၪလဂၩ, မွဲမိၡါလဂၩဎးနီၪ မွဲနၥံၪလၥ့ၪယၫဘၪ ဧၪး အ ဂဲး ဘဲၫ ယီၩ ၦ နံၫ ဂၩ မိ ကဲၪ ထၪ့ လ",
			"17": "<sup>17</sup> ၥွံၪ ဎး လ ယၪဎး နီၪ, ဆၧစံၭဝ့ၫဒၪ,- အ့ၪမွဲ ၦလၧအဘၪဆဲၫ့လိၬအၥၭ လၧကဆါနီၪ, မွဲအၥၭလ ဖျိၪ့ဎးလီၫ.",
			"18": "<sup>18</sup> ဂၭဎ့ၭခွံၬဆၧမၩမၪမုၪမၩမၪခွၫဆံၭ. ကယဲၦ မၩမၪဆၧဂူၫဂၩ လမံၩ့လါလါနီၪ, ဘၪဆဲၫ့လၧပမိၡါအ့ၬ. အ့ၪမွဲၦလၧအမၩမၪ ၦမုၪၦမၧၩ့နီၪ, မွဲအမၩမၪအမိၡါဒၪဝ့ၫလီၫ.",
			"19": "<sup>19</sup> နၥံၪအမိၡါမွဲၥၭမုဆံၫ့ဎံၪ လၧအအီၪလၧနၥံၪအဖၧၩ့ လၧနၥံၪန့ဘၪလၧယွၩလခီၫ အဆၧလုအဂံၪ့တၭ, နၥံၪ လမွဲဘၪနၥံၪ အဆၧဒၪနၥံၪဝ့ၫနီၪ, မွဲနၥံၪလၥ့ၪယၫ",
			"20": "<sup>20</sup> ဘၪဧၪ.- အဂဲးဘဲၫယီၩ ဆၧဎွ့ၩန့ထဲၩ့နၥံၪလၧအ ဎွ့ၩလီၫ. မၩအၥၭဘဲၫနီၪတၭ, မၩလၩမၩဖၩ့ယွၩ လၧနၥံၪအမိၡါဆံၭ."
		},
		"7": {
			"1": "<sup>1</sup> ဘိၩ့နဲၪ့ယီၩ ဆၧလၧနၥံၪကွ့ၭန့ယၧၩအဂဲးနီၪ, ၦအ့ၪ",
			"2": "<sup>2</sup> လဘၪဆဲၫ့ဘၪလၧၦမုၪတၭ, ဂ့ၩဒၪအဆၧလီၫ.- မွဲလါ နၫ့ဘိၩ, ဘဲၫၥိၭၦမိဂၭဎ့ၭ ဆၧမၩမၪမုၪ မၩမၪခွၫတၭ, မွဲၦခွၫလဂၩဘၪလဂၩ အီၪလၧအမၫဒၪဝ့ၫ ဒဲၦမုၪလဂၩ",
			"3": "<sup>3</sup> ဘၪလဂၩအီၪလၧအဝၩဒၪဝ့ၫဆံၭ.- မွဲဝၩမၩဆၧအဂ့ၩ အဘၪလၧအမၫတၭ, ဒဲမၫမၩလၧအဝၩဘဲၫနီၪအၥိၭ",
			"4": "<sup>4</sup> ဆ့ဆံၭ.- မၫလဂၩနီၪလအီၪဘၪ လၧအစီၩ့အမၩ့လၧအ မိၡါဒၪဝ့ၫအဖၫ့ခိၪ, မွဲအဝၩလီၫ. ဘဲၫနီၪအၥိၭဆ့, ဝၩ လဂၩလအီၪဘၪ လၧအစီၩ့အမၩ့ လၧအမိၡါဒၪဝ့ၫအ",
			"5": "<sup>5</sup> ဖၫ့ခိၪ, မွဲအမၫလီၫ.- အ့ၪလမွဲဘၪ လၧနၥံၪအုၩ့လၩ့လိၬ နၥံၪအၥၭလၧနၥံၪမိအီၪဖၭလဆိလလး,ဘဲၫၥိၭနၥံၪ မိဒုၪဆၧအၪ့ဆၧအီၩ ဒဲဘၩဆိၪဖၪဆၧအကၠီၩ့နီၪ, ထီး အၪ့ဂူၬန့လိၬနၥံၪအဆၧလဂ့ၩတၭ, အီၪဎုၬထဲၩ့ဒီၭဘဲၫ ၥိၭလၧနၥံၪအီၪခိၭနၥံၪအၥၭ အ့ၪလနၧၩ့ဘၪနီၪ,မုၪခီၩ",
			"6": "<sup>6</sup> လဲးထီးကျဲၩ့ဖစီၩ့နၥံၪလဂ့ၩ.- မွဲလါနၫ့ဘိၩ,ဆၧယီၩ လမံၩ့ယစံၭ ဘဲၫဆၧဖ့ၪလၫ့ချဲၩ့ယၧၩအၥိၭ, လမွဲဘၪ",
			"7": "<sup>7</sup> ဘဲၫဆၧမၪလူၬအၥိၭနီၪလီၫ.- အ့ၪမွဲယၥၭအီၪ လၧၦ ထီးအလူၬ အီၪဘဲၫယနၫ့ဆါဒၪယဝ့ၫအၥိၭလီၫ. မွဲ လါနၫ့ဘိၩ, ၦလဂၩဘၪလဂၩ န့ဘၪအခိးအတၩဒၪဝ့ၫ လၧယွၩတၭ, လဂၩဘဲၫအံၩတၭ, လဂၩဘဲၫအိၩလီၫ.",
			"8": "<sup>8</sup> မွဲလါနၫ့ဘိၩ, ၦလၧအလအီၪဘၪလၧအဖိၪ အမၫ အဖိၪအဝၩနီၪ, ဒဲၦမုၪမဲၫၥံၪ, ယစံၭအဝ့ၫၥံၪ, အ့ၪအီၪ",
			"9": "<sup>9</sup> ဘဲၫယၧၩအၥိၭယီၩ, ဂ့ၩလၧအဂးလီၫ.- မွဲလါနၫ့ဘိၩ, ခိၭအၥၭအ့ၪလနၧၩ့ဘၪတၭ, မွဲအအီၪဎုၬဒၪဝ့ၫဘီၪ. အဂဲးဘဲၫယီၩ ဆၧအီၪဎုၬဆၧမွဲအဂ့ၩနဲၪ့ အီၪလၧဆၧ ၥၭခတၧၩထၪ့နီၪဒံၭလီၫ.",
			"10": "<sup>10</sup> ၦထၧၫ့မၫဝၩလဖၪ ယမၪလူၬအဝ့ၫၥံၪလမွဲဘၪ, မွဲ",
			"11": "<sup>11</sup> ကဆါ, မၫလဂၩ,မွဲအထီးစဲၪ့ဒၪအဝၩလဂ့ၩ,- မွဲလါ နၫ့ဘိၩ, အ့ၪစဲၪ့ဒၪယူၭနီၪ, မွဲအထီးအီၪဎုၬလၧဂူၫဂၩ လဂ့ၩ. အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, မွဲအမၩဘၪလိၬ အိၭ လိၬထဲၩ့အၥၭ လၧအဝၩဆံၭ. အဝၩလဂၩနီၪ, မွဲအ ထီးခွံၬၡိၭအမၫလဂ့ၩ.",
			"12": "<sup>12</sup> ဆၧအီၪလၩ့ထးလဖၪ ယလီၩဘၪယဝ့ၫ,မွဲကဆါ စံၭအ့ၬ. ထၧၫ့ဖုဝဲလဂၩဂၩ အ့ၪအီၪလၧအမၫလၧအ လနဲၩဘၪဆၧနီၪ, အ့ၪမိအီၪဘၪအၥၭလၧအၥိၭ, မွဲအ",
			"13": "<sup>13</sup> ထီးခွံၬၡိၭအဝ့ၫလဂ့ၩ.- ၦမုၪလၧအအီၪလၧအဝၩလၧ အလနဲၩဘၪဆၧတၭ, အ့ၪမိအီၪဘၪအၥၭလၧအၥိၭ",
			"14": "<sup>14</sup> နီၪ,မွဲအထီးစဲၪ့ဒၪအဝၩနီၪလဂ့ၩ.- အဂဲးဘဲၫယီၩဝၩ လၧအလနဲၩဘၪ ဆၧလဂၩ, ဆၧအီၪက့ၪဝ့ၫ လၧဆၧ ဆံၫ့ဎံၪ လၧအမၫအကၠီၩ့တၭ, မၫလၧအလနဲၩဘၪဆၧ လဂၩ, ဆၧအီၪက့ၪဝ့ၫ လၧဆၧဆံၫ့ဎံၪ လၧအဝၩအ ကၠီၩ့လီၫ. အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, နၥံၪအဖိၪအလံၩ မွဲအလဆံၫ့ဘၪတၭ, အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ, မွဲအဆံၫ့ဎံၪ လီၫ.",
			"15": "<sup>15</sup> မွဲလါနၫ့ဘိၩ, ၦလၧအလနဲၩဘၪ ဆၧအ့ၪစဲၪ့နီၪ, မွဲ အစဲၪ့ဒၪဝ့ၫဆံၭ. ဆၧအ့ၪမၩအၥၭ ဘဲၫနီၪတၭ, ထၧၫ့ ဖုဝဲမုၪမွဲဂ့ၩ, ထၧၫ့ဖုဝဲခွၫမွဲဂ့ၩ, ကဲၪဎီးဘဲၫနီၪၥိၭအ့ၬ. မွဲလါနၫ့ဘိၩ, ယွၩကိၭပၧၩ လၧဆၧဘၪလိၬ အိၭလိၬ အဖၧၩ့လီၫ.",
			"16": "<sup>16</sup> အဂဲးဘဲၫယီၩ ၦမုၪဧ့,နလမိမၩဖီၩ့မၩဖျ့ၭဘၪ နဝၩနီၪဧၪ, မွဲနၥ့ၪယၫဘဲၫၥ့ၪလဲၪ. ၦခွၫဧ့, နလမိမၩဖီၩ့ မၩဖျ့ၭဘၪနမၫနီၪဧၪ, မွဲနၥ့ၪယၫ ဘဲၫၥ့ၪလဲၪ.",
			"17": "<sup>17</sup> မွဲလါနၫ့ဘိၩ, ဘဲၫယွၩဖ့ၪအၪ့နၩ့ဖၭလဂၩအဆၧလ ဂၩအဆၧအၥိၭနီၪ ဘဲၫကဆါကိၭၦ လဂၩဘၪလဂၩ အၥိၭနီၪ,မွဲအလ့ၩဆၧဘဲၫနီၪအၥိၭဆံၭ. ယမၪလူၬ ဆၧဘဲၫနီၪ, လၧဆၧအီၪကီၪ့ထီးအလူၬအဖၧၩ့လီၫ.",
			"18": "<sup>18</sup> ၦလဂၩဂၩ လၧအဘၪဆၧကူၭတရံၭနီၪ, ဆၧအ့ၪကိၭ အဝ့ၫတၭ, မွဲအထီးကဲၪထၪ့ၦလၧအလဘၪဆၧကူၭ တရံၭလဂ့ၩ, ၦလဂၩဂၩလၧအလဒိၭဘၪ ဆၧကူၭတ ရံၭနီၪ,ဆၧအ့ၪကိၭအဝ့ၫတၭ,မွဲအထီးဒိၭဆၧကူၭတရံၭ",
			"19": "<sup>19</sup> လဂ့ၩ.- ဆၧဒိၭဆၧကူၭတရံၭမွဲဆၧအ့ၬ, ဆၧလ ဒိၭဘၪဆၧကူၭတရံၭနီၪမွဲဆ့အ့ၬး အ့ၪမွဲဆၧထီးန့",
			"20": "<sup>20</sup> ယွၩအဆၧမၪလူၬလဖၪနီၪမွဲဆၧလီၫ.- ဆၧကိၭလၧ ၦအီၪဝ့ၫလၧအဖၧၩ့ ထီးဆၧကိၭဝ့ၫနီၪ, မွဲအအီၪဒၪဝ့ၫ လၧအဖၧၩ့ဆံၭ.-",
			"21": "<sup>21</sup> လၧဆၧကိၭနၧၩနီၪ, အ့ၪနမွဲဆၧ အဎီးအၡၩတၭ, ထီးအၪ့ယိၪဆၧ နးမံၩ့လဂ့ၩ.မွဲ လါနၫ့ဘိၩ, နန့ဘၪဆၧပျီၩဖျ့ၭ အလးအ့ၪၥ့ၪတၭ, မၩ",
			"22": "<sup>22</sup> န့ဝ့ၫနီၪ ဂ့ၩဒၪအဆၧဒံၭလီၫ.- အဂဲးဘဲၫယီၩ အဎီးအ ၡၩလၧအဘၪဆၧကိၭဝ့ၫ လၧအကဆါအဖၧၩ့နီၪ, မွဲ ကဆါအၡၩပျီၩဖျ့ၭလီၫ.ဘဲၫနီၪအၥိၭဆ့,ၦပျီၩဖျ့ၭ လဂၩနီၪ, လၧအဘၪဆၧကိၭဝ့ၫမွဲဎရံၬအဎီးအၡၩ",
			"23": "<sup>23</sup> လီၫ.- ဆၧဎွ့ၩန့နၥံၪလၧအဎွ့ၩတၭ,ထီးကဲၪထၪ့ၦၡၩ",
			"24": "<sup>24</sup> အဎီးအၡၩလဂ့ၩ.- ဖုၥံၪဝဲၥံၪဧ့, ဆၧအလးလၧၦ အီၪဝ့ၫလၧအဖၧၩ့ ထီးအဘၪဆၧကိၭဝ့ၫ လဂၩဂၩနီၪ, မွဲအအီၪဒၪဝ့ၫလၧအဖၧၩ့လၧယွၩအဂးဆံၭ.",
			"25": "<sup>25</sup> လၧၦမုၪနၩ့အဂဲးနီၪ, ယန့ဘၪဆၧမၪလူၬလၧက ဆါအ့ၬ. မွဲလါနၫ့ဘိၩ, ဘဲၫၦလၧအန့ဘၪ ဆၧယၫ့ၥုၪ့ ယၫ့ၥၭလၧကဆါ ဘဲၫၥိၭအမိကဲၪၦလူတီၩအၥိၭနီၪ,",
			"26": "<sup>26</sup> ယစ့ၩရၫ့ယဝ့ၫဒၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,လၧ ဆၧနၭဆၧၡၪ့ဘိၩ့နဲၪ့ယီၩအကၠီၩ့နီၪ, ယဆီၫ့မီၪ့လၧ ၦအ့ၪအီၪဂုးဝ့ၫ ဘဲၫအအီၪအၥိၭနီၪ, မွဲအဂ့ၩလီၫ.",
			"27": "<sup>27</sup> မွဲလၧနဘၪစၧၩ့ထၬ လၧမၫဧၪ, ထီးအၪ့ဎၬ ဂၭဖျ့ၭလ",
			"28": "<sup>28</sup> ဂ့ၩ, မွဲနဂၭဖျ့ၭလၧမၫဧၪ, ထီးအၪ့ဎၬန့မၫလဂ့ၩ.- မွဲ လါနၫ့ဘိၩ, နအ့ၪအီၪဎုၬတၭ, နမၩမၪဆၧဆ့အ့ၬ. ဒဲၦမုၪနၩ့အ့ၪအီၪဎုၬနီၪ, မွဲအမၩမၪဆၧဆ့အ့ၬ. မွဲလါ နၫ့ဘိၩ, ၦဘဲၫနီၪၥိၭလဖၪ မိဘၪဆၧနၭဆၧၡၪ့လၧဆၧ ဖံၭဆၧယၪအဖၧၩ့လီၫ. မွဲလါနၫ့ဘိၩ, ယအွံၪၥၭဆၧၩ့ နၥံၪလီၫ.",
			"29": "<sup>29</sup> မွဲလါနၫ့ဘိၩ ဖုၥံၪဝဲၥံၪဧ့, ယစံၭဆၧယီၩ အဆၧၫ့ အထီလၧအအီၪဒံၭမွဲအဖၨၪခိၬလီၫ. တၭၦအီၪလၧ",
			"30": "<sup>30</sup> အမၫလဖၪဘၪအီၪဝ့ၫ ဘဲၫအလအီၪဘၪအၥိၭ,- ၦလၧ အဂၪ့, ဘဲၫအလဂၪ့ဘၪအၥိၭး ၦလၧအၥုၪ့ဎွံၫၥၭယီၫ ဘဲၫအၥုၪ့လဎွံၫ ၥၭလယီၫဘၪအၥိၭ, ဒဲၦလၧအဎွ့ၩ",
			"31": "<sup>31</sup> ဆၧဘဲၫၦလၧအဆၧလအီၪဘၪအၥိၭ,- ဒဲၦလၧအမၩ ဆၧဖံၭဆၧဘၪဆဲၫ့ လၧဂၪ့ခိၪချိၫ့ယီၩ, မွဲအထီးမၩဂၭ ဂီၩ့ဆၧလဂ့ၩ. အဂဲးဘဲၫယီၩဂၪ့ခိၪယီၩ အထူၫအရူၫ မိဒံၩခွံၬဝ့ၫဒၪလီၫ.",
			"32": "<sup>32</sup> မွဲလါနၫ့ဘိၩ, ယၥၭအီၪလၧနၥံၪထီးအၪ့ယိၪဆၧနး မံၩ့လဂ့ၩဧီၪ. ၦလၧအလန့ဘၪအမၫနီၪ, မိမၩဘၪက ဆါအၥၭ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, အၪ့ယိၪဆၧလၧ",
			"33": "<sup>33</sup> အဘၪဆဲၫ့လၧကဆါအဂဲးလီၫ.- အ့ၪမွဲၦလၧအအီၪ လၧအမၫနီၪ, မိမၩဘၪအမၫအၥၭ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪ လဲၪနီၪ, အၪ့ယိၪဆၧလၧအဘၪဆဲၫ့ လၧဂၪ့ခိၪယီၩအ ဂဲးလီၫ.",
			"34": "<sup>34</sup> ၦမၫဒဲၦမုၪနၩ့နီၪလၩ့မဲၩလိၬအၥၭဆ့လီၫ.- ၦလၧအ လအီၪဘၪလၧအဝၩနီၪ, အၪ့ယိၪဆၧလၧအဘၪဆဲၫ့လၧ ကဆါအဂးဘဲၫၥိၭအမိၡါမွဲဂ့ၩ, အၥၭမွဲဂ့ၩ, မိဆံၫ့ဎံၪ ဝ့ၫလီၫ. အ့ၪမွဲၦလၧအအီၪ လၧအဝၩလဂၩနီၪ, မိမၩ ဘၪအဝၩအၥၭ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, မွဲအအၪ့ယိၪ ဆၧလၧအဘၪဆဲၫ့ လၧဂၪ့ခိၪယီၩအဂဲးလီၫ.",
			"35": "<sup>35</sup> ဆၧလဖၪနီၪယလီၩဘၪနၥံၪ ဘဲၫၥိၭနၥံၪမိန့ဘၪဆၧ အခိးအတၩအဂးလီၫ.- လမွဲဘၪဘဲၫၥိၭ ယမိခွံၬဖျၪ့ ဖျံၩခွၩ့လၧနၥံၪအလီၩ့း အ့ၪမွဲလၧဆၧဂ့ၩ ဆၧဘၪအ ဂးဘဲၫၥိၭနၥံၪ အဆၧအၪ့ယိၪဆၧ ထီးအီၪလဂ့ၩတၭ, နၥံၪမိမၩ ကဆါအဆၧမၩလီၫ.",
			"36": "<sup>36</sup> မွဲလါနၩ့ဘိၩ ၦလဂၩဂၩအမုၪနၩ့ အ့ၪမွဲမုၪနၩ့ယံၬ, အ့ၪဆီၫ့မီၪ့ဝ့ၫလၧအမၩဆၧ လၧအလဂ့ၩ လဘၪဘၪ နီၪ,အလးအ့ၪအီၪတၭ, မွဲအမၩဒၪဝ့ၫထီးအၥၭလါနၫ့",
			"37": "<sup>37</sup> နီၪ,လမၩမၪဘၪဆၧ, မွဲအအီၪဎုၬလိၬအၥၭဘီၪ.- မွဲ လါနၫ့ဘိၩ ၦလၧအလးလအီၪဘၪနီၪ, အၥုၪ့ဂုးအၥၭ ခၧၫ့, အီၪလၧအစီၩ့အမၩ့ လၧအၥၭအဖၫ့ခိၪတၭ, စ့ၩ ရၫ့ဝဲၩဝ့ၫလၧအၥၭခံဖၧၩ့ လၧအမိဖီၪ့ထၬ အမုၪနၩ့လ",
			"38": "<sup>38</sup> ဂၩနီၪမွဲအမၩဆၧဂ့ၩလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦလၧ အဖ့ၪလၫ့ခွံၬဝ့ၫလၧဆၧအီၪဎုၬအဖၧၩ့, မၩဆၧဂ့ၩလါ နၫ့ဘိၩ,ၦလၧအလဖ့ၪလၫ့ခွံၬဘၪ လၧဆၧအီၪဎုၬ အဖၧၩ့, မၩဝ့ၫဂ့ၩနဲၪ့အနီၪဒံၭလီၫ.",
			"39": "<sup>39</sup> အမၫနီၪ ဘၪဆၧစၧၩ့ထၬ လၧအဝၩမၧၫ့ဝ့ၫ အဘိၩ့ ဘၭနီၪ,အ့ၪမွဲအဝၩအ့ၪၥံၫတၭ, မွဲအဂၭဖျ့ၭဝ့ၫဘဲၫ ၥိၭအမိန့ဘၪအဝၩ ထီးဒၪအၥၭလါနၫ့ဘိၩ, န့ၫလၧက",
			"40": "<sup>40</sup> ဆါအဖၧၩ့လီၫ.- မွဲလါနၫ့ဘိၩ အ့ၪအီၪဝ့ၫဘဲၫနီၪ, ဘဲၫယဆီၫ့မီၪ့ဆၧအၥိၭ,မိအီၪဝ့ၫမုၬနဲၪ့အနီၪဒံၭ လီၫ. ယဆီၫ့မီၪ့လၧယအီၪလၧယွၩအၥၭဆ့လီၫ."
		},
		"8": {
			"1": "<sup>1</sup> ဘိၩ့နဲၪ့ယီၩ, ဆၧလၧၦလုထၪ့ဆၧဂၩ့အဂဲးနီၪပၥ့ၪ ယၫလၧပအီၪလၧဆၧၥ့ၪယၫကိၭဂၩဒ့ၭလီၫ. ဆၧ ၥ့ၪယၫဒုၭဖိၫထၪ့ၦၥၭ, အ့ၪမွဲဆၧအဲၪဆၧကွံၩ မၩဂ့ၩ",
			"2": "<sup>2</sup> ထၪ့ဆၧလီၫ.- ၦလဂၩဂၩ အ့ၪဆီၫ့မီၪ့လၧအၥ့ၪယၫ ဆၧလမံၩ့မံၩ့တၭ, ဘဲၫအကြၨၭၥ့ၪယၫဝ့ၫ အၥိၭနီၪ,",
			"3": "<sup>3</sup> ၥ့ၪယၫဒံၭ ဆၧနးမံၩ့အ့ၬ.- အ့ၪမွဲၦလဂၩဂၩ အ့ၪအဲၪ",
			"4": "<sup>4</sup> ယွၩတၭ, မွဲအဘၪဆၧၥ့ၪယၫလၧအဝ့ၫဒၪလီၫ.- မၩ အၥၭဘဲၫနီၪတၭ, ဆၧအၪ့လၧၦလုထၪ့ဝ့ၫ လၧဆၧဂၩ့ နီၪ,ပၥ့ၪယၫ လၧဆၧဂၩ့လမွဲဘၪဆၧနးမံၩ့လၧဂၪ့ခိၪ ချိၫ့တၭ, အ့ၪလမွဲဘၪယွၩလဂၩဎးနီၪ, အဂူၫဂၩအီၪ",
			"5": "<sup>5</sup> နးဂၩအ့ၬ.- အဂဲးဘဲၫယီၩ လၧမူၭခိၪမွဲဂ့ၩ, လၧဂၪ့ခိၪ မွဲဂ့ၩ, ဆၧလၧၦကိၭဝ့ၫ ယွၩလဖၪအီၪလါနၫ့ဘိၩ,",
			"6": "<sup>6</sup> (ယွၩအီၪအၪဂၩ, ဒဲကဆါအီၪအၪဂၩ,)- မွဲလါနၫ့ဘိၩ လၧပဂးမွဲဖါယွၩလဂၩဎး, ဒဲဆၧထီးအလူၬကဲၪထၪ့ လၧအဝ့ၫဒၪတၭ, ပအီၪပဝ့ၫလၧအဖၧၩ့နီၪ, ဒဲကဆါ ယ့ၫရှူၬဎရံၬ လဂၩဎး, ဒဲဆၧထီးအလူၬကဲၪထၪ့ လၧအဝ့ၫဒၪအကၠီၩ့တၭ, ပကဲၪထၪ့ပဝ့ၫလၧအဝ့ၫ ဒၪအကၠီၩ့ဆ့လီၫ.",
			"7": "<sup>7</sup> မွဲလါနၫ့ဘိၩ, ဆၧၥ့ၪယၫယီၩ အီၪလၧၦကိၭဂၩဒ့ၭ အဖၧၩ့အ့ၬ. ၦလနၩ့နၩ့ခီးဘိၩ့နဲၪ့ယီၩ, အီၪဝ့ၫလၧကၪ့ ၡၧၫ့ဘၪဆဲၫ့လၧဆၧဂၩ့တၭ, အၪ့ဆၧဘဲၫဆၧလၧၦလု ထၪ့ဝ့ၫ လၧဆၧဂၩ့အၥိၭနီၪလီၫ. ကၪ့ၡၧၫ့နီၪမွဲအဆါ တၭ,စံၪစၪဝ့ၫလီၫ.",
			"8": "<sup>8</sup> မွဲလါနၫ့ဘိၩ, ဆၧအၪ့အီၪက့ၪဂ့ၩပၧၩလၧယွၩအ မ့ၬယၫအ့ၬ. အဂဲးဘဲၫယီၩပအ့ၪအၪ့ဆၧတၭ, ပလဂ့ၩ",
			"9": "<sup>9</sup> ထၪ့ဘၪ, ပအ့ၪလအၪ့ဘၪနီၪ, ပအၧၩ့ထၪ့ဆ့အ့ၬ.- မွဲ လါနၫ့ဘိၩ, ဘဲၫၥိၭနၥံၪအဆၧစီၩ့ဆၧမၩ့ယီၩ ထီးကဲၪ ထၪ့ဆၧဘၪထၧၩ့အလး လၧၦအဂဲးအဘၭဆါ အဂး",
			"10": "<sup>10</sup> လဂ့ၩတၭ, ထီးလၩ့နၥံၪအၥၭဘီၪ.- အဂဲးဘဲၫယီၩ နဝ့ၫဒၪယီၩနအီၪ လၧဆၧၥ့ၪယၫတၭ, ၦလဂၩဂၩအ့ၪ ဒၪနဆၧၫ့နၩ့ဒံၩ့ခံၫ့ လၧစပွဲထံၭအၪ့ဆၧ လၧဆၧဂၩ့အ ဂံၪ့ဖၧၩ့နီၪ, ၦလၧအဂဲးဆါအဘၭဆါလဂၩ အကၪ့ ၡၧၫ့မိခၧၫ့ထၪ့ ထီးအအၪ့ဆၧလၧၦလုထၪ့ဝ့ၫ လၧဆၧ",
			"11": "<sup>11</sup> ဂၩ့နီၪ,မွဲအ့ၬဧၪ.- မွဲလၧနဆၧၥ့ၪယၫအကၠီၩ့နီၪ, ၦလၧ အဂဲးဆါအဘၭဆါဂၭဂီၩ့ဝ့ၫဒၪတၭ, အဝ့ၫနီၪမွဲထၧၫ့",
			"12": "<sup>12</sup> ဖုဝဲလၧဎရံၬထိးၥံၫအၥၭ လၧအဂးနီၪလီၫ.- ထီးနၥံၪ မၩမၪဘၪနၥံၪအထၧၫ့ဖုဝဲဘဲၫနီၪ, ဒဲမၩဂၭဂီၩ့အ ကၪ့ၡၧၫ့လၧအဆါနီၪ, မွဲနၥံၪမၩမၪဘၪဎရံၬလီၫ.",
			"13": "<sup>13</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧအၪ့အ့ၪဒုၭမၪဘၪယထၧၫ့ ဖုဝဲနီၪ, ဘဲၫၥိၭယထၧၫ့ဖုဝဲ ထီးလၩ့ထံၩဖါလဂ့ၩ တၭ,လဆိၩဒၪယၧၩယီၩ ယအၪ့လၧၩ့ဆၧယၪအ့ၬ."
		},
		"9": {
			"1": "<sup>1</sup> ယဝ့ၫဒၪယီၩ မွဲယလမွဲဘၪၦဆၧအၪ့မၧၫ့ဖိၪဆ့ဧၪ. ယလမွဲဘၪ ၦပျီၩဖျ့ၭဖိၪဆ့ဧၪ. မွဲယလဒၪဘၪယူၭ ပကဆါယ့ၫရှူၬဎရံၬဆ့ဧၪ. မွဲနၥံၪလမွဲဘၪယဆၧမၩ",
			"2": "<sup>2</sup> လၧကဆါအဖၧၩ့ဆ့ဧၪ.- ယအ့ၪလမွဲဘၪၦဆၧအၪ့ မၧၫ့ဖိၪလၧၦဂူၫဂၩ အမ့ၬယၫလါနၫ့နီၪ, ယမွဲမၬ,လၧ နၥံၪအမ့ၬယၫလီၫ. အဂဲးဘဲၫယီၩ နၥံၪအီၪလၧကဆါ အဖၧၩ့နီၪ, နၥံၪမွဲဆၧစဲၩနဲၪ့ထၬ ဘၪဆဲၫ့လၧယမွဲၦ လၧဆၧအၪ့မၧၫ့လၩ့ ယၧၩလီၫ.",
			"3": "<sup>3</sup> ၦလၧအအၪ့စိၭအၪ့စၪ့ယၧၩ လၧဆၧအဂဲးအကၠီၪ့",
			"4": "<sup>4</sup> နီၪ, ယချဲၩ့ဆၧၫ့အဝ့ၫဘဲၫယီၩ,- ဘဲၫၥိၭပမိအၪ့ဆၧ",
			"5": "<sup>5</sup> အီၩဆၧတၭ, ပစီၩ့ပမၩ့မွဲအလအီၪဘၪဧၪ.- ပစဲၪ့ဝံၩ့ ဝၩ့ၥိၫ့မၫ, ထၧၫ့ဖုဝဲမုၪ, ဘဲၫဆၧအၪ့မၧၫ့ဖိၪအဂူၫဂၩလ ဖၪ,ဒဲကဆါအထၧၫ့ဖုဝဲၥံၪ, ဒဲစစံဖၭအၥိၭနီၪ, ပစီၩ့",
			"6": "<sup>6</sup> ပမၩ့လအီၪဘၪဧၪ.- ၦလၧအစီၩ့အမၩ့အီၪဝ့ၫဘဲၫၥိၭ အထီးမၩဆၧဖံၭဆၧလဂ့ၩ, မွဲအလအီၪဘၪန့ၫယၧၩ, ဒဲစဘၫနဘၭဆ့ဧၪ.",
			"7": "<sup>7</sup> အလံၩ့အလဲၫလအီၪဘၪနီၪ, မွဲၦလဂၩဂၩလ့ၩဒုၭ ဆၧဎွ့ဆိၭလဲၪ. မွဲပလၫၥုၪ့စဘံၭအလးတၭးလအၪ့ ဘၪဝ့ၫ အၥၪလဂၩလဲၪ. မွဲပလၫယူၬၥိၪလဒီၪ့တၭ, လအၪ့ဘၪဝ့ၫအနူထံၫ လဂၩလဲၪ.",
			"8": "<sup>8</sup> မွဲယစံၭဆၧလဖၪနီၪ, ဘဲၫၦၡၩအၥိၭဧၪ. မွဲဆၧမၪ",
			"9": "<sup>9</sup> လူၬစံၭဝ့ၫဘဲၫနီၪၥိၭဆ့ဧၪ.- အဂဲးဘဲၫယီၩ ဆၧကွ့ၭအ ၥၭလၧစမိစ့ၭအဆၧမၪလူၬအဖၧၩ့, ချီဖၫလၧအယဲး ဘုၪနီၪထီးၥံၫ့ထၬအနိၭလဂ့ၩ. မွဲယွၩယိထဲၩ့ခွါထဲၩ့",
			"10": "<sup>10</sup> ချီနီၪဆ့ဧၪ.- မွဲအစံၭဆၧနီၪ ထီးအလူၬလၧပဂးဧၪ,မွဲ မၬ, ဆၧကွ့ၭအၥၭလၧပဂး, ဘဲၫၥိၭၦလၧအထဲၫဆၧ မိထဲၫဝ့ၫလၧဆၧယိလါအဖၧၩ့, ဒဲၦလၧအယဲးဘုၪ လၧဆၧယိလါအဖၧၩ့နီၪ, မိန့ဘၪဆၧလၧအယိလါဝ့ၫ လဖၪနီၪလီၫ.",
			"11": "<sup>11</sup> ပဝ့ၫဒၪယီၩ ပအ့ၪဎွံၪဆၧဘၪဆဲၫ့လၧၥၭလၧနၥံၪ အဂးတၭ, နၥံၪအဆၧဘၪဆဲၫ့ လၧဆၧဖံၭဆၧယၪပ အ့ၪကူၭအဝ့ၫၥံၪတၭ, မိမွဲဆၧလၧအဒိၪအမုဆ့ဧၪ.",
			"12": "<sup>12</sup> ၦဂူၫဂၩအ့ၪအီၪ လၧဆၧစီၩ့ဆၧမၩ့ လၧနၥံၪ အဖၫ့ခိၪ တၭ ပဝ့ၫဒၪယီၩမွဲပအၪနဲၪ့ အနီၪဒံၭမွဲအ့ၬဧၪ. မွဲလါ နၫ့ဘိၩ, ဆၧစီၩ့ဆၧမၩ့ယီၩပမၩအ့ၬ. မွဲပထိးဆၧ ထီးအလူၬ, ဘဲၫၥိၭပထီးမၩထံၬထၬ ဎရံၬအဆၧၥၭ",
			"13": "<sup>13</sup> ထိၬအပရၧၫ့လဂ့ၩလီၫ.- ၦလၧအလုထၪ့ဆၧလၧဆၧ လုအလးနီၪ,န့ဘၪဆၧလၧအဘၪဆဲၫ့ လၧဆၧလု",
			"14": "<sup>14</sup> အလးတၭ, မွဲနၥံၪလၥ့ၪယၫဘၪဧၪ.- ဘဲၫနီၪအၥိၭဆ့, ကဆါ စ့ၩရၫ့ဝဲၩယူၭ,လၧပလီၩလၩ့လၬလၩ့ ဆၧ ၥၭထိၬအပရၧၫ့လဖၪနီၪ, မွဲအမိမၧၫ့ဝ့ၫလၧဆၧဘၪ ဆဲၫ့လၧဆၧၥၭထိၬ အပရၧၫ့လီၫ.",
			"15": "<sup>15</sup> မွဲလါနၫ့ဘိၩ, ယလမၩန့ဘၪဆၧလဖၪနီၪနးမံၩ့ တၭ,ယကွ့ၭဆၧလဖၪယီၩ ဘဲၫၥိၭၦမိမၩဆၧဘဲၫနီၪလၧ ယဂးဆ့အ့ၬ. အဂဲးဘဲၫယီၩ ယအီၪက့ၪဖိၫလိၫယၥၭ နီၪ, ၦလဂၩဂၩအ့ၪမၩဂၭဂီၩ့နီၪ, ယအ့ၪၥံၫတၭ, ဂ့ၩ",
			"16": "<sup>16</sup> ဒၪအဆၧဒံၭလီၫ.- အဂဲးဘဲၫယီၩ, ယလီၩလၩ့လၬလၩ့ ဆၧၥၭထိၬအပရၧၫ့တၭ, ယအီၪက့ၪဖိၫလိၫယၥၭအ လးအီၪအ့ၬ. အဂဲးဘဲၫယီၩ ယဘၪမၩဘဲၫနီၪး မွဲမၬ, ယအ့ၪလလီၩလၩ့လၬလၩ့ဘၪ ဆၧၥၭထိၬ အပရၧၫ့",
			"17": "<sup>17</sup> တၭ,ယမိဘၪဆၧၡၪ့လီၫ.- ယမၩဆၧနီၪအ့ၪမွဲလၧ ယၥၭအီၪထၪ့ဒၪဆၧတၭ, ယန့ဘၪဆၧ အခိးအတၩ လီၫ. အ့ၪလမွဲဘၪ လၧယၥၭအီၪထၪ့ဒၪဆၧနီၪဆၧဒုၭ",
			"18": "<sup>18</sup> မၩယၧၩ လၧဆၧမၩလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယဆၧအခိးအတၩနီၪ မွဲဆၧနီၪလမံၩ့လဲၪ. မွဲဘဲၫၥိၭ ထီးယအ့ၪလီၩလၩ့လၬလၩ့ ဆၧၥၭထိၬအပရၧၫ့နီၪ, ယမိမၩဎရံၬအဆၧၥၭထိၬအပရၧၫ့ လအီၪဘၪလၧအ ဎွ့ၩတၭ, ဘဲၫၥိၭယထီး မၩဆီၪ့ဆၧလၧ ယစီၩ့ယမၩ့ လၧဆၧၥၭထိၬအပရၧၫ့ အဖၧၩ့လဂ့ၩလီၫ.",
			"19": "<sup>19</sup> အဂဲးဘဲၫယီၩယအီၪပျီၩဖျ့ၭ လၧၦထီးအလူၬလါ နၫ့ဘိၩ, ယအီၪက့ၪလၩ့ယနၫ့ဆါဒၪယဝ့ၫ လၧၦထီး အလူၬအဎီးအၡၩ,ဘဲၫၥိၭယမိမၩန့ၦ အၪနဲၪ့အနီၪ",
			"20": "<sup>20</sup> ဒံၭလီၫ.- လၧၦယုဒၫဖိၪၥံၪအမ့ၬယၫ, ယကဲၪထၪ့ဘဲၫ ၦယုဒၫဖိၪအၥိၭ, ဘဲၫၥိၭယမိန့ဘၪ ၦယုဒၫဖိၪၥံၪ တၭ,လၧၦအီၪလၧဆၧမၪလူၬ အဖၫ့လၬအမ့ၬယၫဘဲၫ ၦအီၪလၧဆၧမၪလူၬ အဖၫ့လၬအၥိၭ, ဘဲၫၥိၭယမိန့",
			"21": "<sup>21</sup> ဘၪၦအီၪလၧဆၧမၪလူၬ အဖၫ့လၬလီၫ.- လၧၦလၧ အလအီၪဘၪ လၧဆၧမၪလူၬအမ့ၬယၫ, ဘဲၫဆၧမၪ လူၬလအီၪဘၪအၥိၭ, လအီၪဘၪလၧဆၧမၪလူၬလၧ ယွၩအမ့ၬယၫ, လမွဲဘၪး မွဲယအီၪလၧဆၧမၪလူၬ အဖၫ့လၬ လၧဎရံၬအဖၧၩ့, ဘဲၫၥိၭယမိန့ဘၪ ၦလၧ",
			"22": "<sup>22</sup> အလအီၪဘၪလၧဆၧမၪလူၬနီၪလီၫ.- လၧၦအဂဲးဆါ အဘၭဆါအမ့ၬယၫယကဲၪထၪ့ဘဲၫၦလၧ အဂဲးဆါ အဘၭဆါအၥိၭ, ဘဲၫၥိၭယမိန့ဘၪ ၦလၧအဂဲးဆါ အဘၭဆါတၭး ယကဲၪထၪ့ ဆၧထီးအလူၬလၧၦထီး အလူၬအမ့ၬယၫ, ဘဲၫၥိၭလၧယမၩဆၧ ထီးအလူၬ",
			"23": "<sup>23</sup> တၭ,ယမိထိးထဲၩ့တၩ့ထဲၩ့ၦလနၩ့နၩ့လီၫ.- ယမၩ ဆၧနီၪလၧဆၧၥၭထိၬအပရၧၫ့အကၠီၩ့, ဘဲၫၥိၭယမိန့ ဎုၬအခိးအတၩ လၧနၥံၪလီၫ.",
			"24": "<sup>24</sup> ၦလၧအစဲၪ့ပၧၩ့လဖၪ စဲၪ့ထီးအလူၬလါနၫ့ဘိၩ, ၦန့ ဘၪခိၪဖၭမွဲန့ၫလဂၩနီၪ, နၥံၪလၥ့ၪယၫဘၪဧၪ. ဘဲၫ",
			"25": "<sup>25</sup> ၥိၭနၥံၪမိန့ဆၧတၭ, စဲၪ့ဘဲၫနီၪၥိၭဘီၪ.- ကယဲၦလၧ အအၪ့ဎၬမၩဝ့ၫလဂၩဂၩ, ထုၭဒၪအၥၭ လၧဆၧထီးအ လူၬအဖၧၩ့လီၫ. မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪမၩဝ့ၫ ဘဲၫၥိၭအမိန့ဘၪၥရဖူၩ လၧအအုၪၥ့ၪကျၪၥ့ၪ ဒၪအ ဆၧတၭ, အ့ၪမွဲပဝ့ၫဒၪယီၩ, လၧအအုၪအကျၪလ ၥ့ၪဘၪလီၫ.",
			"26": "<sup>26</sup> မၩအၥၭဘဲၫနီၪတၭ, ယစဲၪ့ဆၧဘဲၫနီၪအၥိၭ, ဘဲၫ ယစဲၪ့ခီၫခီၫလဲၪ, လၧယလၥ့ၪယၫဘၪအၥိၭ လမွဲဘၪး ယမ့ၭဆၧဘဲၫနီၪအၥိၭ ဘဲၫၦလၧအဒိၪလံၩ အၥိၭမွဲ",
			"27": "<sup>27</sup> အ့ၬ.- မွဲယမၩနၧၩ့မၩစၪယမိၡါယီၩ,ဒဲယအၪ့မၧၫ့ ဎီးဝ့ၫ,ဘဲၫၥိၭထီးယအ့ၪ လီၩလၩ့လၬလၩ့ ဆၧလၧၦ ဂူၫဂၩၥံၪဂီၩ့တၭ, ယနၫ့ဆါဒၪယဝ့ၫ ထီးဘၪဆၧခွံၬ ၡိၭခွံၬဝ့ၫလဂ့ၩလီၫ."
		},
		"10": {
			"1": "<sup>1</sup> အဂဲးဘဲၫယီၩ ဖုၥံၪဝဲၥံၪဧ့, ပဖါၥံၪထီးအလူၬအီၪ",
			"2": "<sup>2</sup> လၧဆၧအုၪ့အဖၫ့လၬ,ဒဲခၫ့ဂၬမၫဆမံၭ,- ဒဲဒိၭဘၭ တံၫဇၫ့အၥၭထီးအလူၬ လၧဆၧအုၪ့အကျၩ, ဒဲလၧ",
			"3": "<sup>3</sup> မၫဆမံၭအကျၩလၧစမိစ့ၭအဖၧၩ့,- ဒဲအၪ့ဆၧအၪ့ဘၪ",
			"4": "<sup>4</sup> ဆဲၫ့လၧၥၭလမံၩ့ဎးထီးအလူၬ,- ဒဲအီၩဆၧအီၩဘၪ ဆဲၫ့လၧၥၭလမံၩ့ဎး ထီးအလူၬ,နၥံၪလၥ့ၪယၫဘၪ နီၪ,ဘၪယၥၭအ့ၬ. အဂဲးဘဲၫယီၩမွဲအဝ့ၫၥံၪ အီၩဆၧ လၧလဲၫ့ဘၪဆဲၫ့လၧၥၭ လၧအဖိၬအခဲၫ့တၭ, လဲၫ့နီၪ",
			"5": "<sup>5</sup> မွဲဎရံၬလီၫ.- မွဲလါနၫ့ဘိၩ, ၦအၪဂၩလဖၪနီၪ, ယွၩလ အဲၪဒိၭဘၪဝ့ၫး အဂဲးဘဲၫယီၩ မွဲအဘၪဆၧဂၭဂီၩ့ဂၭ စၪလၧမံၩ့လၬကျၩလီၫ.",
			"6": "<sup>6</sup> ဆၧလဖၪနီၪ, မွဲအဒီၩ့အထ့ၬၥံၪလၧပမ့ၬယၫ,ဘဲၫၥိၭ ပထီးၥၭကွံၩဆၧအၧၩ့ဘဲၫအဝ့ၫၥံၪ ၥၭကွံၩဆၧအၥိၭ",
			"7": "<sup>7</sup> နီၪလဂ့ၩ.- ထီးကဲၪထၪ့ၦဘၩဆၧဂၩ့ဘဲၫအဝ့ၫၥံၪလ နၩ့နၩ့အၥိၭလဂ့ၩ. ဘဲၫဆၧကွ့ၭအၥၭ အၥိၭနီၪ, ၦ ခ မျၧး ဆၧၫ့ နၩ့ အၪ့ ဆၧ အီၩ ဆၧ တၭ, ဂဲ",
			"8": "<sup>8</sup> ထုၪ့ လိၬ ကွ့ၩ ဆၧ လီၫ.- ထီးမၩမၪမုၪမၩမၪခွၫ ဘဲၫအဝ့ၫၥံၪလနၩ့နၩ့ မၩမၪမုၪမၩမၪခွၫတၭ, လၩ့ ထံၩဖါၥံၫဝ့ၫလနံၩဎး နံၫလၬၥၧၫ့ထီၫ့အၥိၭနီၪလဂ့ၩ.",
			"9": "<sup>9</sup> ထီးကျဲၩ့ဖစီၩ့ဎရံၬဘဲၫအဝ့ၫၥံၪလနၩ့နၩ့ ကျဲၩ့ဖစီၩ့",
			"10": "<sup>10</sup> ဆၧတၭ, ၥံၫဝ့ၫလၧဂူအဲၪ့ဝ့ၫအၥိၭနီၪလဂ့ၩ.- ထီး ၥူၭဝံၪၥူၭလၩဆၧဘဲၫအဝ့ၫၥံၪလနၩ့နၩ့ၥူၭဝံၪၥူၭလၩ ဆၧအၥိၭနီၪလဂ့ၩး မွဲအဘၪဆၧဂၭဂီၩ့ဂၭစၪ လၧၦ မၩဂၭဂီၩ့ဆၧအစူၪဖၧၩ့လီၫ.",
			"11": "<sup>11</sup> ဆၧထီးအလူၬနီၪမၩအၥၭ လၧအဝ့ၫၥံၪအဖၧၩ့တၭ, မွဲလၧဆၧအဒီၩ့အထ့ၬလီၫ. ပဝ့ၫဒၪလၧပအီၪလၧအ ဆိၩအကၠၪထုၬ လဖၪယီၩ, ဆၧကွ့ၭအၥၭ လၧပဘၪ ဆၧၥီၫ့ထဲၩ့ၥၫ့ထဲၩ့ပၧၩ အဂးလီၫ.",
			"12": "<sup>12</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦအ့ၪဆီၫ့မီၪ့လၧအဆၧၫ့ထုၪ့ ဝ့ၫနီၪ, မိလၩ့ထံၩဖါဘၪခိၬတၭ,မွဲအထီးလၩ့အၥၭ ဆံၭ.",
			"13": "<sup>13</sup> မွဲနၥံၪဘၪဆၧကျဲၩ့ဖစီၩ့ လၧအလဘၪဒံၭဘၪၦၡၩ နီၪမွဲအ့ၬ. ယွၩမၩဝ့ၫအလူတီၩတၭ, ဆၧကျဲၩ့ဖစီၩ့လၧ နၥံၪထိးလကဲၪဘၪနီၪ, လမိဖ့ၪလၫ့ဘၪနၥံၪလၩ့လၧအ ဖၧၩ့နီၪး အ့ၪမွဲလၧဆၧကျဲၩ့ဖစီၩ့ အဂဲးနီၪဘဲၫၥိၭ နၥံၪထိးမိကဲၪတၭ, မိတဲၩ့ဝဲၩဖၧၩ့ၥၭ ဘဲၫၥိၭနၥံၪမိဖီၩ့ ဖျ့ၭဝ့ၫဒၪလီၫ.",
			"14": "<sup>14</sup> မၩအၥၭဘဲၫနီၪတၭ, ယၥၭဘီၩ့ၥံၪဧ့, စဲၪ့ဂၭဎ့ၭဆၧ",
			"15": "<sup>15</sup> ဘၩဆၧဂၩ့ဆၧဖၪ့ဆံၭ.- ယလီၩဘၪနၥံၪဘဲၫၦလၧ အအီၪလၧဆၧကိၪ့ဘၪကိၪ့ၥ့ၪအၥိၭနီၪလီၫ. ဆၧလၧ",
			"16": "<sup>16</sup> ယချဲၩ့နီၪစ့ၩရၫ့နၥံၪဝ့ၫဆံၭ.- ဆၧဆိၪဂ့ၩ အလိၫ့လၧ ပဆိၪဂ့ၩဝ့ၫနီၪ မွဲဆၧဖံၭၥိၭလိၬ လၧဎရံၬအၥွံၪအ့ၬဧၪ. ကိၪလလီၪ့ လၧပကံၪ့ဘျ့ၭဝ့ၫနီၪ, မွဲဆၧဖံၭၥိၭလိၬလၧ",
			"17": "<sup>17</sup> ဎရံၬအမိၡါအ့ၬဧၪး အဂဲးဘဲၫယီၩ, ပဝ့ၫဒၪအၪဂၩ ယီၩ,ပမွဲကိၪလလီၪ့ဎး, ပမွဲမိၡါလဂၩဎးလီၫ. အဂဲး",
			"18": "<sup>18</sup> ဘဲၫယီၩပအၪ့ကိၪလလီၪ့ဎးကိၭဂၩဒ့ၭလီၫ.- ယိခွါ, ၦအံၫစရ့လၭဖိၪ ဘဲၫဆၧဖံၭဆၧယၪအၥိၭနီၪဘီၪ. ၦလၧအအၪ့ဆၧလုလဖၪနီၪ မွဲအဘၪဆဲၫ့ လၧဆၧလု",
			"19": "<sup>19</sup> အလးအ့ၬဧၪ.- မၩအၥၭဘဲၫနီၪတၭ မွဲယစံၭဆၧနီၪလဲၪ. လၧဆၧဂၩ့မွဲဆၧလမံၩ့မံၩ့ဆ့ဧၪ. ဆၧလၧၦလုထၪ့",
			"20": "<sup>20</sup> ဆၧဂၩ့နီၪ, မွဲဆၧလမံၩ့မံၩ့ဧၪ.- မွဲ အ့ၬ. မွဲ ယ စံၭ လၧ ၦ ဆၨၩ လ ဖၪ နီၪ, လ လု ထၪ့ ဘၪ ယွၩ တၭ, မွဲ အ လု ထၪ့ ဆၧ နၪ  ၥံၪ လီၫ. ယၥၭ အီၪလၧနၥံၪ မိဖံၭၥိၭလိၬနၥံၪအၥၭ လၧဆၧနၪအ့ၬ.",
			"21": "<sup>21</sup> နၥံၪအီၩကဆါအလိၫ့, ဒဲဆၧနၪအလိၫ့ၥ့ၪအ့ၬ. နၥံၪ အၪ့ဆၧလၧကဆါအစပွဲထံၭဒဲလၧဆၧနၪ အစပွဲထံၭ",
			"22": "<sup>22</sup> ၥ့ၪအ့ၬ.- မွဲပထိၪဂဲၩကဆါအၥၭကဲၪ့နီၪဧၪ. မွဲပ ဆီၪ့နဲၪ့အဝ့ၫဆ့ဧၪ.",
			"23": "<sup>23</sup> ဆၧထီးအလူၬမွဲအတီၩအလီၩ့ လၧယဂးလီၫ.မွဲ လါနၫ့ဘိၩဆၧထီးအလူၬ မၩအၪထၪ့ဆၧအခိးအတၩ မွဲအ့ၬ. ဆၧထီးအလူၬမွဲဆၧတီၩဆၧလီၩ့လၧယဂးလီၫ. မွဲလါနၫ့ဘိၩ, ဆၧထီးအလူၬ မၩထၪ့ထီၫဆၧမွဲအ့ၬ.",
			"24": "<sup>24</sup> မွဲၦထီးအၪ့ဎၬ အဆၧဂ့ၩဒၪဝ့ၫနးဂၩလဂ့ၩး မွဲ အအၪ့ဎၬဂူၫဂၩ အဆၧဂ့ၩဘီၪ.",
			"25": "<sup>25</sup> ဆၧလၧၦၡၩအၪ့ဆၫ လၧဖၠၫဖၧၩ့နီၪ,မွဲလၧကၪ့ ၡၧၫ့အကၠီၩ့တၭ, နၥံၪထီးအၪ့စၪ့နးမံၩ့လဂ့ၩ, အၪ့က",
			"26": "<sup>26</sup> ဒၪဘီၪ.- အဂဲးဘဲၫယီၩဂၪ့ခိၪ, ဒဲအဆၧဎွ့ၩဝ့ၫနီၪမွဲက",
			"27": "<sup>27</sup> ဆါအဆၧလီၫ.- ၦလၧအလနဲၩဘၪဆၧလဂၩဂၩ အ့ၪကိၭနၥံၪတၭ, ဆၧအ့ၪမိလ့ၩဘၪနၥံၪအၥၭနီၪ, မွဲ လၧကၪ့ၡၧၫ့အကၠီၩ့တၭ, ထီးအၪ့စၪ့ဆၧနးမံၩ့လဂ့ၩ, ကယဲဆၧလၧအအီၪက့ၪလၩ့ဝ့ၫလၧနၥံၪအမ့ၬယၫ",
			"28": "<sup>28</sup> နီၪ,အၪ့ကဒၪဘီၪ.- မွဲလါနၫ့ဘိၩ, ၦလဂၩဂၩအ့ၪလီၩ ဘၪနၥံၪ,ဆၧယီၩမွဲၦလုထၪ့ဝ့ၫလၧဆၧဂၩ့နီၪ,မွဲလၧၦ လီၩဘၪဆၧအကၠီၩ့, ဒဲလၧကၪ့ၡၧၫ့အကၠီၩ့တၭ,အၪ့",
			"29": "<sup>29</sup> လဂ့ၩ.- ကၪ့ၡၧၫ့နီၪ, ယစံၭနနၫ့ဆါဒၪနဝ့ၫလမွဲဘၪး မွဲယစံၭ ၦဂူၫဂၩအကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩယဆၧ ပျီၩဖျ့ၭမိဘၪဆၧစ့ၩရၫ့စၪ လၧၦဂူၫဂၩအကၪ့ၡၧၫ့နီၪ,",
			"30": "<sup>30</sup> မွဲဘၪလဲၪ.-ယအ့ၪန့ဘၪ ဆၧဘၪဆဲၫ့ လၧဆၧအခိး အတၩတၭ, ယစံၭထၪ့အၪ့အူၭ ဆၧအခိးအတၩ အကၠီၩ့နီၪ, မွဲယဘၪဆၧဒုၪဒွ့ၪ မွဲဘၪလဲၪ.",
			"31": "<sup>31</sup> မၩအၥၭဘဲၫနီၪတၭ, နၥံၪအၪ့ဆၧမွဲဂ့ၩ,နၥံၪအီၩ ဆၧမွဲဂ့ၩ, ကယဲနၥံၪမၩဆၧလမံၩ့လါလါနီၪ, မၩဆၧ",
			"32": "<sup>32</sup> ထီးအလူၬ ဘဲၫၥိၭအမိဒုၭလၩဖၩ့ထၪ့ယွၩဆံၭ.- ၦယု ဒၫဖိၪမွဲဂ့ၩ, ၦဆၨၩလဖၪမွဲဂ့ၩ, ယွၩအဆၧအီၪကီၪ့မွဲ ဂ့ၩ, ထီးကဲၪဆၧလၩ့ထံၩဖါအလး လၧအဝ့ၫၥံၪအမ့ၬ",
			"33": "<sup>33</sup> ယၫနးဂၩလဂ့ၩ.- ယမၩယဝ့ၫလၧဆၧထီးအလူၬ အဖၧၩ့, ဘဲၫၥိၭယမိဘၪ ၦထီးအလူၬအၥၭတၭ,ယအၪ့ ဎၬယခိးဒၪယဝ့ၫအ့ၬ. အ့ၪမွဲလၧၦအၪဂၩအဂး ဘဲၫ ၥိၭ, အမိထီၩ့လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့ ဝ့ၫလီၫ."
		},
		"11": {
			"1": "<sup>1</sup> ယိလိၪယၧၩဘဲၫယယိလိၪဎရံၬအၥိၭနီၪဆံၭ.",
			"2": "<sup>2</sup> ဖုၥံၪဝဲၥံၪဧ့, ယစံၭထၪ့အၪ့အူၭလၧနၥံၪနၪ့ထၪ့ထဲၩ့ ယၧၩလၧဆၧထီးအလူၬအဖၧၩ့တၭ, ဒဲထီးန့ဖံၭထၬ ဆၧလီၩဆိၩဝ့ၫလဖၪဘဲၫယဖ့ၪလၫ့နၥံၪအၥိၭနီၪ",
			"3": "<sup>3</sup> လီၫ.- မွဲလါနၫ့ဘဲၫနီၪတၭ, ဆၧမိဒုၭၥ့ၪယၫဘၪယၥၭနၥံၪ လၧကယဲၦခွၫလဂၩလါလါ အခိၪမွဲဎရံၬ,ၦမုၪ",
			"4": "<sup>4</sup> အခိၪမွဲၦခွၫတၭ,ဎရံၬအခိၪမွဲယွၩလီၫ.- ကယဲၦ ခွၫလၧအဘၩဆိၪဖၪဆၧမွဲဂ့ၩ, ချဲၩ့ဆၧလၧမီၪအချိၬ မွဲဂ့ၩ,အ့ၪချႃၬဘံၭ အခိၪဎွံၪနီၪ, မၩဂၭဂီၩ့အခိၪဎွံၪ",
			"5": "<sup>5</sup> အလၩအဖၩ့လီၫ.- အ့ၪမွဲကယဲၦမုၪလၧအဘၩဆိၪ ဖၪဆၧမွဲဂ့ၩ, ချဲၩ့ဆၧလၧမီၪအချိၬမွဲဂ့ၩ, အ့ၪလချႃၬ ဘံၭဘၪအခိၪဎွံၪနီၪ မၩဂၭဂီၩ့အခိၪအလၩအဖၩ့လီၫ. အဂဲးဘဲၫယီၩ မွဲဘဲၫအလိၩ့ခွံၬ အခိၪၥူၫအၥိၭလီၫ.",
			"6": "<sup>6</sup> အဂဲးဘဲၫယီၩ ၦမုၪအ့ၪလအီၪဘၪ လၧဆၧချႃၬဘံၭ တၭ,မွဲအလိၩ့ခွံၬအခိၪၥူၫဘီၪ. ထံၬအခိၪၥူၫမွဲဂ့ၩ, လိၩ့အခိၪၥူၫမွဲဂ့ၩ, အ့ၪမွဲဆၧမ့ၬမဲနီၪ,မွဲအချႃၬဘံၭဒၪ",
			"7": "<sup>7</sup> ဝ့ၫဘီၪ.-အဂဲးဘဲၫယီၩၦခွၫမွဲ ယွၩအခံးအဂၩ့ဒဲအလၩ အဖၩ့တၭ, ဂ့ၩချႃၬဘံၭအခိၪဎွံၪအ့ၬ. အ့ၪမွဲၦမုၪနီၪ,",
			"8": "<sup>8</sup> မွဲၦခွၫအလၩအဖၩ့လီၫ.- အဂဲးဘဲၫယီၩ မွဲၦခွၫကဲၪ",
			"9": "<sup>9</sup> ထၪ့လၧၦမုၪအ့ၬ. မွဲၦမုၪကဲၪထၪ့လၧၦခွၫလီၫ.- လၧ နီၪအမ့ၬယၫ, ၦခွၫမွဲအဘၪဆၧတဲၩ့န့ဝ့ၫ လၧၦမုၪအ ဂးအ့ၬ. မွဲၦမုၪဘၪဆၧတဲၩ့န့ဝ့ၫ လၧၦခွၫအဂးလီၫ.",
			"10": "<sup>10</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦမုၪကြၨၭအီၪလၧ ဎဆၧဒုၭနဲၪၭ အစီၩ့အမၩ့ လၧအခိၪဎွံၪအလီၩ့ လၧအၥီၫ့ၥံၪအကၠီၩ့",
			"11": "<sup>11</sup> လီၫ.- မွဲလါနၫ့ဘိၩ,လၧကဆါအဖၧၩ့, ၦခွၫလဘၪဆဲၫ့ ဘၪလၧၦမုၪမွဲအ့ၬ. ၦမုၪလဘၪဆဲၫ့ဘၪလၧၦခွၫမွဲဆ့",
			"12": "<sup>12</sup> အ့ၬ.- အဂဲးဘဲၫယီၩဘဲၫၦမုၪအီၪထၪ့ လၧၦခွၫအၥိၭ တၭ,ၦခွၫအီၪထၪ့ လၧၦမုၪဘဲၫနီၪအၥိၭဆ့တၭ, ကယဲ ဆၧအီၪထီးအလူၬအဆံၫ့ ကဲၪထၪ့လၧယွၩအစူၪ ဖၧၩ့လီၫ.",
			"13": "<sup>13</sup> စ့ၩရၫ့ဒၪနၥံၪဝ့ၫဘီၪ, ၦမုၪလချႃၬဘံၭဘၪအခိၪဎွံၪ",
			"14": "<sup>14</sup> တၭ, ဘၩဆိၪဖၪယွၩနီၪမွဲမိကြၨၭဆ့ဧၪ.- ၦခွၫအီၪလၧ အခိၪၥူၫထီၫနီၪ, ဆၧအထူၫအရူၫၥီၪ့ထဲၩ့နၥံၪလၧအမွဲ",
			"15": "<sup>15</sup> ဆၧမ့ၬမဲအလးအ့ၬဧၪ.- မွဲလါနၫ့ဘိၩ, ၦမုၪအ့ၪအီၪ လၧအခိၪၥူၫထီၫနီၪ, မွဲအဝ့ၫဒၪအလၩအဖၩ့လီၫ. အ ဂဲးဘဲၫယီၩ ဆၧဖ့ၪလၫ့အခိၪၥူၫ လၧအဆၧချႃၬဘံၭအ",
			"16": "<sup>16</sup> ဂးလီၫ.- မွဲလါနၫ့ဘိၩ ၦလဂၩဂၩ အ့ၪအီၪက့ၪအၥၭ လၧအမိဂဲးလိၬတ့ၭလိၬဆၧ, ပဝ့ၫဒၪမွဲဂ့ၩ, ယွၩအ ဆၧအီၪကီၪ့ၥံၪမွဲဂ့ၩ, ပထူၫပရူၫဘဲၫနီၪအၥိၭအီၪအ့ၬ.",
			"17": "<sup>17</sup> ဆၧယီၩအဂဲးယစံၭလၧနၥံၪ အီၪကိၩ့အီၪကီၪ့ဘဲၫ ၥိၭဆၧဂ့ၩ မိအီၪထၪ့လမွဲဘၪဧၪ, မွဲဘဲၫၥိၭ ဆၧအၧၩ့",
			"18": "<sup>18</sup> မိအၧၩ့နဲၪ့အလးနီၪ ယစံၭထၪ့အၪ့အူၭနၥံၪအ့ၬ.-အဂဲး ဘဲၫယီၩလၧအခၪ့ထံၭယီၩ, ထီးနၥံၪအီၪကိၩ့အီၪကီၪ့ ဆၧအီၪကီၪ့ အဖၧၩ့တၭ, ယနါဂၧၫ့လၧနၥံၪလၩ့ဖၭ လိၬနၥံၪအၥၭနီၪ, ယနဲၩယဝ့ၫဒိၪဒိၪ ဆံၭဆံၭဆ့",
			"19": "<sup>19</sup> လီၫ.-အဂဲးဘဲၫယီၩဘဲၫၥိၭၦလၧအဂ့ၩအဘၪလၧနၥံၪ အကျၩလဖၪ, မိအီၪဖျီၪတၭ, ၦအစူၪလလၩ့ဎုၬဘၪ လဖၪဘၪအီၪထၪ့လၧနၥံၪအကျၩဆ့လီၫ.",
			"20": "<sup>20</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးနၥံၪအီၪကိၩ့အီၪကီၪ့လ စီၪ့ဎးနီၪ, မွဲဘဲၫနၥံၪမိအၪ့ကဆါအဆၧအၪ့လၧဂၪအၪ့",
			"21": "<sup>21</sup> အၥိၭအ့ၬ.-အဂဲးဘဲၫယီၩ လၧနၥံၪအၪ့ဆိၫနၥံၪအဆၧ ဒၪနၥံၪဝ့ၫ လၧဂၪအၪ့ကိၭဂၩဒ့ၭနီၪ, ၦလဂၩဆၧၥၭဝံ အၥၭတၭ, ၦလဂၩအၪ့လၨၪအီၩလၨၪဝ့ၫဒၪလီၫ.",
			"22": "<sup>22</sup> မွဲဘဲၫၥ့ၪလဲၪၬ နၥံၪအၪ့ဆၧအီၩဆၧအလးလၧနၥံၪအ ဂံၪ့ဖၧၩ့အီၪအ့ၬဧၪ. အ့ၪလမွဲဘၪတၭ, မွဲနၥံၪမၩကြၩ့ ထမးယွၩအဆၧအီၪကီၪ့နီၪ, ဒဲဒုၭမ့ၬမဲၦလၧအဆၧ လအီၪဘၪနီၪဆ့ဧၪ. မွဲယစံၭနၥံၪလၧဆၧနီၪလဲၪၬ ယ မိစံၭထၪ့အၪ့အူၭ နၥံၪလၧဆၧနီၪအကၠီၩ့ဆ့ဧၪ. ယစံၭ ထၪ့အၪ့အူၭနၥံၪအ့ၬ.",
			"23": "<sup>23</sup> အဂဲးဘဲၫယီၩ ဆၧလၧယန့ဘၪလၧကဆါယဖ့ၪ လၫ့နၥံၪဆ့တၭ, လၧကဆါယ့ၫရှူၬမုနၩ လၧဆၧဖ့ၪလၫ့",
			"24": "<sup>24</sup> ခွံၬဝ့ၫနီၪ,မၩန့ကိၪလလီၪ့,- စံၭထၪ့အၪ့အူၭဆၧအ ခိးအတၩတၭ, ကံၪ့ဘျ့ၭဝ့ၫဂီၩ့, စံၭဝ့ၫ,အယီၩမွဲယမိ ၡါလၧအဘၪဆၧကံၪ့ဘျ့ၭ လၧနၥံၪအဂးလီၫ. မၩဆၧ",
			"25": "<sup>25</sup> ယီၩလၧဆၧနၪ့ထၪ့ထဲၩ့ယၧၩ အဂဲးနီၪဆံၭ.- ဘဲၫနီၪ အၥိၭဆ့, အၪ့ဆၧအၪ့ လၧဂၪအၪ့ဂီၩ့တၭ, မၩန့လိၫ့ တၭ,စံၭဝ့ၫ, လိၫ့ယီၩမွဲဆၧအုၩ့လၩ့အၥၫ့ လၧယၥွံၪ အဖၧၩ့, ထီးဒၪနၥံၪအီၩဆၧယီၩ လဖၧၫ့ဖၧၫ့နီၪ, မၩ",
			"26": "<sup>26</sup> လၧဆၧနၪ့ထၪ့ထဲၩ့ယၧၩဆံၭ.- အဂဲးဘဲၫယီၩ ထီးဒၪ နၥံၪအၪ့ကိၪဒဲနၥံၪအီၩလိၫ့ယီၩ လဖၧၫ့ဖၧၫ့နီၪ, မွဲနၥံၪ ဒုၭနဲၪကဆါအဆၧၥံၫနီၪ ထီးအဂဲၫလၩ့ထဲၩ့လီၫ.",
			"27": "<sup>27</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးဒၪၦလၧအအၪ့ကိၪ ဒဲအီၩ ကဆါအလိၫ့လကြၨၭ လဘၪဘၪလဂၩဂၩနီၪ,ဆၧ ဒဲၩဘၭလၧအမၩမၪဘၪ အကဆါအမိၡါ ဒဲအၥွံၪနီၪ,",
			"28": "<sup>28</sup> ကြၨၭဘၪအဝ့ၫလီၫ.- မွဲၦအၪ့စိၭအၪ့စၪ့ဒၪအၥၭ,",
			"29": "<sup>29</sup> မွဲအအၪ့ဒၪဝ့ၫကိၪ ဒဲအီၩဒၪဝ့ၫလိၫ့နီၪဆံၭ.-အဂဲးဘဲၫ ယီၩၦလၧအအၪ့ဝ့ၫ ဒဲအီၩဝ့ၫနီၪ, အ့ၪလဆီၫ့မီၪ့ဒၪဘၪ ကဆါအမိၡါနီၪ, မွဲအအၪ့ဝ့ၫဒဲအီၩဝ့ၫ လၧဆၧစ့ၩရၫ့",
			"30": "<sup>30</sup> စၪလၧအဂးဒၪဝ့ၫလီၫ.- ဆၧအဂဲးအီၪဝ့ၫဘဲၫနီၪတၭ, ၦလၧအဂဲးဆါအဘၭဆါ, ဒဲၦလၧအဘၪဆၧစူၭဆၧ ဆၫအီၪဝ့ၫ လၧနၥံၪအကျၩအၪဂၩ, ဒဲၦလၧအမံၫမၪ",
			"31": "<sup>31</sup> ဝ့ၫအီၪအၪဂၩလီၫ.- အဂဲးဘဲၫယီၩပအ့ၪစ့ၩရၫ့လၩ့ဒၪ",
			"32": "<sup>32</sup> ပၥၭတၭ,ဆၧစ့ၩရၫ့ဘၪလၧၩ့ပၧၩအ့ၬ.- အ့ၪမွဲထီး ပဘၪဆၧစ့ၩရၫ့ပၧၩတၭ, ကဆါၥီၪ့ထဲၩ့ပၧၩဘဲၫၥိၭ ပထီးဘၪဆၧစ့ၩရၫ့စၪ လၧဂၪ့ခိၪဖိၪအၥိၭလဂ့ၩလီၫ.",
			"33": "<sup>33</sup> မၩအၥၭဘဲၫနီၪတၭ, ယထၧၫ့ဖုဝဲၥံၪဧ့, ထီးနၥံၪအီၪ ကိၩ့အီၪကီၪ့အၪ့ဆၧတၭ, အီၪခိၭလိၬနၥံၪအၥၭလဂၩ",
			"34": "<sup>34</sup> ဘၪလဂၩ လဂၩဘၪလဂၩဘီၪ.- ဘဲၫၥိၭနၥံၪထီးအီၪ ကိၩ့အီၪကီၪ့လၧဆၧစ့ၩရၫ့စၪအဂးလဂ့ၩတၭ, ၦလဂၩ ဂၩဆၧအ့ၪၥၭဝံအၥၭတၭ, မွဲအအၪ့ဆၧလၧအဂံၪ့ဒၪ ဝ့ၫဘီၪ. ဆၧအီၪလၩ့ထးလဖၪနီၪ ထီးယထဲၩ့အ့ၪထီၩ့ ခိၬတၭ, ယမိစ့ၩရၫ့မၩဎၩ့ထဲၩ့ ဆၧလဖၪနီၪလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> ဖုၥံၪဝဲၥံၪဧ့,လၧၥၭအဆၧဖ့ၪလၫ့ လဖၪနီၪ,မွဲနၥံၪ",
			"2": "<sup>2</sup> လၥ့ၪယၫဘၪအဂဲးအကၠီၪ့, ဘၪယၥၭအ့ၬ.-နၥံၪၥ့ၪယၫ လၧနၥံၪမွဲၦဆၨၩလဖၪဘၪဆၧၥိၫ့နၥံၪ လၧဆၧဂၩ့အုၭ အၭဝ့ၫလဖၪအအီၪဘဲၫဆၧၥိၫ့နၥံၪအၥိၭနီၪလီၫ.",
			"3": "<sup>3</sup> မၩအၥၭဘဲၫနီၪတၭ, ယဒုၭၥ့ၪယၫနၥံၪလၧၦၡၩအ့ၪ ချဲၩ့ဆၧလၧယွၩအၥၭမုနီၪကိၭယ့ၫရှူၬလၧဆၧဘၪ ဆိၪအၧၩ့နးဂၩအ့ၬ. အ့ၪလမွဲဘၪလၧၥၭမုဆံၫ့ဎံၪအ",
			"4": "<sup>4</sup> ဖၧၩ့နီၪ,ၦကိၭယ့ၫရှူၬလၧကဆါၥ့ၪနးဂၩအ့ၬ.- ဘိၩ့ နဲၪ့ယီၩဆၧဖ့ၪလၫ့နီၪအီၪအၪမံၩ့,မွဲလါနၫ့ဘိၩ,ၥၭမု မွဲလဂၩဎးလီၫ.",
			"5": "<sup>5</sup> တၭဆၧအခ့ၫအၡၩ အဆၧမၩအီၪအၪမံၩ့လါနၫ့",
			"6": "<sup>6</sup> ဘိၩ, ကဆါမွဲလဂၩဎးလီၫ- တၭဆၧဖံၭဆၧမၩအီၪ အၪမံၩ့လါနၫ့ဘိၩ,ယွၩလၧအမၩဆၧထီးအလူၬလၧ",
			"7": "<sup>7</sup> ၦထီးအလူၬအဖၧၩ့, မွဲလဂၩဎးလီၫ.- တၭဆၧဖ့ၪလၫ့ ၦလဂၩဘၪလဂၩဆုၬဆုၬ လၧဆၧနဲၪဖျီၪၥၭမုနီၪ လၧ",
			"8": "<sup>8</sup> ဆၧအခိးအတၩအဂးလီၫ.- အဂဲးဘဲၫယီၩ ဆၧဖ့ၪ လၫ့ၦလဂၩလၧဆၧချဲၩ့ကိၪ့ၥ့ၪလၧၥၭမုနီၪ, ဒဲလဂၩ",
			"9": "<sup>9</sup> ဒၪလၧဆၧချဲၩ့ၥ့ၪယၫဆၧလၧၥၭမုလဂၩဎးနီၪ,- ဒဲလ ဂၩဒၪနီၪလၧဆၧနဲၩလၧၥၭမုလဂၩဎးနီၪ, ဒဲလဂၩဒၪ လၧအမၩဘျၪထဲၩ့ဆၧစူၭဆၧဆၫၥ့ၪလၧၥၭမုလဂၩ",
			"10": "<sup>10</sup> ဎး,-လဂၩဒၪလၧဆၧမၩလၩ့လၭၥ့ၪ, ဒဲလဂၩဒၪလၧ အချဲၩ့လၧမီၪအချိၬၥ့ၪ, ဒဲလဂၩဒၪလၧဆၧၥ့ၪယၫအၪ့ နၩ့ဖၭၥၭလဖၪအဆၧၫ့ၥ့ၪ, ဒဲလဂၩဒၪလၧဖျ့ၩအၪ ဆၨၩလဖၪနီၪ, ဒဲလဂၩဒၪလၧဆၧချဲၩ့ကျိၭထဲၩ့ဖျ့ၩ",
			"11": "<sup>11</sup> လဖၪအဂဲးလီၫ.- မွဲလါနၫ့ဘိၩ, ဆၧလဖၪထီးအလူၬ, လၧၥၭမုလဂၩဒၪလ့ၬ မၩဒၪဝ့ၫတၭ, ဖ့ၪအၪ့နၩ့ဖၭဒၪ ဆၧလဂၩလမံၩ့လဂၩလမံၩ့ထီးဒၪအၥၭလီၫ.",
			"12": "<sup>12</sup> အဂဲးဘဲၫယီၩ မၩအၥၭဘဲၫမိၡါလဂၩဎး,ဒဲအီၪလၧ အခံးအဂၩ့အၪမံၩ့နီၪ, မိၡါလဂၩအခံးအဂၩ့ ထီးအ လူၬအီၪဝ့ၫအၪမံၩ့ လါနၫ့ဘိၩ, မွဲမိၡါလဂၩဎးတၭ,",
			"13": "<sup>13</sup> ဎရံၬမွဲဘဲၫနီၪအၥိၭဆ့လီၫ.- အဂဲးဘဲၫယီၩပဝ့ၫဒၪ ယီၩ,ၦယုဒၫဖိၪၥံၪမွဲဂ့ၩ, ၦဆၨၩလဖၪမွဲဂ့ၩ, ၦဎီးဖိၪ မွဲဂ့ၩ, ၦပျီၩဖျ့ၭဖိၪမွဲဂ့ၩ, ပဒိၭဘၭတံၫဇၫ့ ပၥၭလၧ ၥၭမုလဂၩဎးလၧမိၡါလဂၩဎးအဖၧၩ့ ထီးအလူၬ တၭ,ဆၧဒုၭအီၩပၧၩလၧၥၭမုလဂၩဎးအဖၧၩ့ထီး အလူၬလီၫ.",
			"14": "<sup>14</sup> အဂဲးဘဲၫယီၩ မိၡါအခံးအဂၩ့ လမွဲဘၪလမံၩ့",
			"15": "<sup>15</sup> တၭ, မွဲအၪမံၩ့လီၫ.-ခၪ့အ့ၪစံၭ, ယလမွဲဘၪစူၪအကၠီၩ့ နီၪ, ယလဘၪဆဲၫ့ဘၪလၧအမိၡါတၭး မၩအၥၭဘဲၫနီၪ,",
			"16": "<sup>16</sup> မွဲအလဘၪဆဲၫ့ဘၪလၧမိၡါနီၪဧၪ.- နါအ့ၪစံၭ,ယလမွဲ ဘၪမ့ၬၥၪအကၠီၩ့နီၪ, ယလဘၪဆဲၫ့ဘၪ လၧအမိၡါ တၭ,မၩအၥၭဘဲၫနီၪ, မွဲအလဘၪဆဲၫ့ဘၪ လၧအမိၡါ",
			"17": "<sup>17</sup> နီၪဧၪ.- မိၡါအ့ၪမွဲမ့ၬၥၪထၧၫ့ဂၩယၫတၭ, မွဲဆၧနါ ဂၧၫ့ဆၧနီၪအီၪခီၫခီၫလဲၪ. မိၡါအ့ၪမွဲနါ ထၧၫ့ဂၩယၫ",
			"18": "<sup>18</sup> နီၪ,မွဲဆၧနၧၫ့ဆၧနီၪ အီၪခီၫခီၫလဲၪ.-မွဲလါနၫ့ဘိၩ,ဘိၩ့ နဲၪ့ယီၩ,ယွၩအီၪက့ၪဆၧအခံးအဂၩ့ လမံၩ့လမံၩ့",
			"19": "<sup>19</sup> လၧမိၡါအဖၧၩ့ထီးဒၪအၥၭလီၫ.- ဆၧအခံးအဂၩ့ ထီးအလူၬအ့ၪမွဲလမံၩ့ဎးတၭ, မိၡါနီၪ, မိအီၪခီၫခီၫ",
			"20": "<sup>20</sup> လဲၪ.-အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ, ဆၧအခံးအဂၩ့အီၪအၪမံၩ့ တၭ,မိၡါနီၪ မွဲလဂၩဎးလီၫ.",
			"21": "<sup>21</sup> တၭမ့ၬၥၪနီၪစံၭစူၪ, ယမၩနၧၩအလးလအီၪဘၪနီၪ, ၥ့ၪအ့ၬ.မၩဒီၭလဖၧၫ့, ခိၪဎွံၪနီၪစံၭခၪ့, ယမၩနၥံၪအ",
			"22": "<sup>22</sup> လးလအီၪဘၪနီၪ, ၥ့ၪဆ့အ့ၬ.- အ့ၪမွဲဆၧအီၪအၪနဲၪ့ အနီၪဒံၭ,ဆၧအခံးအဂၩ့လၩ့ဂၬ လၧအဆါလဖၪနီၪ,",
			"23": "<sup>23</sup> ဆၧမၩအလးအီၪဒိၪနဲၪ့အဂူၫဂၩဒံၭလီၫ.- တၭမိၡါ အခံးအဂၩ့ လၧပဆီၫ့မီၪ့ အလၩအဖၩ့ဆံၭလဖၪနီၪ, ပအီၪက့ၪလၩဖၩ့အဝ့ၫ ဒိၪနဲၪ့အဂူၫဂၩဒံၭတၭ, ပခံး ပဂၩ့လၧအလၩအဖၩ့ လအီၪဘၪနီၪ, အီၪလၧအလၩ",
			"24": "<sup>24</sup> အဖၩ့ဒိၪနဲၪ့အဂူၫဂၩဒံၭလီၫ.- တၭဆၧလၧအလၩအ ဖၩ့အီၪဝ့ၫလဖၪနီၪ, န့ဘၪဆၧအလးအီၪအ့ၬ. မွဲလါနၫ့ ဘိၩ,ယွၩမၩမိၡါ အီၪဘၪလိၬအၥၭတၭ, ဆၧလၧအ လၩအဖၩ့အီၪဆံၭနီၪ, ဆၧဖ့ၪလၫ့ဝ့ၫ လၧဆၧအလၩ",
			"25": "<sup>25</sup> အဖၩ့ဒိၪနဲၪ့အဂူၫဂၩဒံၭလီၫ.- ဘဲၫၥိၭဆၧလၩ့မုလၩ့ ဖၭထီးအီၪလၧမိၡါအဖၧၩ့ လဂ့ၩတၭ, အခံးအဂၩ့",
			"26": "<sup>26</sup> မိယိထဲၩ့ခွါထဲၩ့လိၬအၥၭ န့ၫဎီၩ့န့ၫဎီၩ့လီၫ.- ဆၧအခံး အဂၩ့လမံၩ့ အ့ၪဘၪဆၧနၭဆၧၡၪ့တၭ, ဆၧအခံးအ ဂၩ့ဘၪဎုၬထီးအလူၬဆ့လီၫ. အခံးအဂၩ့ လမံၩ့ဆၧ အ့ၪအီၪက့ၪလၩဖၩ့အဝ့ၫတၭ, ဆၧအခံးအဂၩ့ထီးအ လူၬၥၭထိၬဝ့ၫလီၫ.",
			"27": "<sup>27</sup> ဘိၩ့နဲၪ့ယီၩနၥံၪမွဲဎရံၬအမိၡါ, ဒဲအဂၩ့ၥံၪ, လဂၩ လၧအလးဒၪဝ့ၫ, လဂၩလၧအလးဒၪဝ့ၫ ဆုၬဆုၬ",
			"28": "<sup>28</sup> လီၫ.- တၭၦလၧယွၩအီၪက့ၪလၧဆၧအီၪကီၪ့ အဖၧၩ့ နီၪအခၪ့ထံၭမွဲၦဆၧအၪ့မၧၫ့ဖိၪလဖၪတၭ,နံၫဖၧၫ့ လဖၧၫ့မီၪၥံၪ,ၥၧၫ့ဖၧၫ့လဖၧၫ့ၦၥီၪ့ဆၧၥၫ့ဆၧလဖၪ တၭ,လၧခဲၫ့နီၪၦမၩလၩ့လၭဆၧလဖၪ,လၧခဲၫ့နီၪ ၦမၩဘျၪထဲၩ့ဆၧစူၭဆၧဆၫလဖၪ, ၦမၩဆၧၩ့ဆၧ လဖၪ,ၦစ့ၩရၫ့ဆၧလဖၪတၭ,ဖျ့ၩအၪဆၨၩ",
			"29": "<sup>29</sup> လဖၪလီၫ.-ၦထီးအလူၬမွဲၦဆၧအၪ့မၧၫ့ဖိၪၥံၪဧၪ.ၦ ထီးအလူၬမွဲမီၪၥံၪဧၪ, ၦထီးအလူၬမွဲၦၥီၪ့ဆၧၥၫ့ဆၧ",
			"30": "<sup>30</sup> ၥံၪဧၪ,ၦထီးအလူၬမွဲၦမၩလၩ့လၭဆၧၥံၪဧၪ.- ၦထီး အလူၬမွဲၦမၩဘျၪထဲၩ့ဆၧစူၭဆၧဆၫၥံၪဧၪ, ၦထီးအ လူၬမွဲၦချဲၩ့ဆၧလၧဖျ့ၩလဖၪဧၪ, ၦထီးအလူၬမွဲၦချဲၩ့",
			"31": "<sup>31</sup> ကျိၭထဲၩ့ဆၧဆ့ဧၪ.- အ့ၪမွဲၥၭကွံၩတၡါဆၧဖ့ၪလၫ့လၧ အဂ့ၩထုၬဘီၪ. မွဲလါနၫ့ဘဲၫနီၪတၭ, ယဒုၭနဲၪနၥံၪ အဖၧၩ့ၥၭလၧအဂ့ၩနဲၪ့အနီၪဒံၭလီၫ."
		},
		"13": {
			"1": "<sup>1</sup> ယအ့ၪချဲၩ့လါနၫ့ဆၧလၧၦၡၩအဖျ့ၩလဖၪ, ဒဲအၥီၫ့ အဖျ့ၩလဖၪနီၪ,ယဆၧအဲၪဆၧကွံၩအ့ၪလအီၪဘၪ တၭ,ယမွဲဘဲၫ ထီးဘၩ့ၥီၫအၥိၭ, ဒဲဘဲၫစံၩ့စံၩ့ၥီၫခၩ့",
			"2": "<sup>2</sup> ခၩ့အၥိၭနီၪလီၫ.- တၭယချဲၩ့ဆၧလၧမီၪအချိၬ အ့ၪ ၥ့ၪ,ဒဲကယဲဆၧအဆူအယိၬယနၪအ့ၪၥ့ၪ,ဒဲယအ့ၪၥ့ၪ ယၫဆၧထီးအလူၬ, ဒဲယအ့ၪန့ဘၪဆၧနဲၩထီးအလူၬ, ထီးယၥုၭခွံၬခိၪလီၩ့ထိၩ့ချိၬၥ့ၪလါနၫ့ဘိၩ, ယဆၧ အဲၪဆၧကွံၩအ့ၪလအီၪဘၪ, ယမွဲဆၧပျီၩပျီၩလီၫ.",
			"3": "<sup>3</sup> ယအ့ၪအၪ့နၩ့ဖၭဖ့ၪလၫ့ခွံၬ ယဆၧဖိၪဆၧလံၩထီးအ လူၬတၭ, ယအ့ၪဖ့ၪလၫ့ခွံၬ ယမိၡါဘဲၫၥိၭအမိဘၪ ဆၧဆူၭခွံၬလၧမ့ၪလါနၫ့ဘိၩ, ယဆၧအဲၪဆၧကွံၩ အ့ၪလအီၪဘၪနီၪ, ယခိးယတၩအီၪနးမံၩ့အ့ၬ.",
			"4": "<sup>4</sup> ဆၧအဲၪဆၧကွံၩအွံၪၥၭဆၧၩ့ယံၬယံၬတၭ, မၩဂ့ၩ ဆၧတၭ, ဆၧအဲၪဆၧကွံၩလၥၭခ့ၬဘၪဆၧ, လအီၪ က့ၪဖိၫလိၫဘၪအၥၭး လအီၪက့ၪထၪ့ထီၫဘၪအ",
			"5": "<sup>5</sup> ၥၭ,လမၩဘၪဆၧလဂ့ၩလဘၪဘၪနီၪ,- လအၪ့ဎၬဘၪ အဆၧဒၪဝ့ၫ,အၥၭလထၪ့ဘၪ,လဆီၫ့မီၪ့ဘၪဆၧ",
			"6": "<sup>6</sup> အအၧၩ့,- လၥၭထိၬဘၪဝ့ၫ လၧဆၧလတီၩလလီၩ့ ဘၪအဖၧၩ့, ၥၭထိၬဝ့ၫလၧဆၧမွဲဆၧတီၩအဖၧၩ့လ",
			"7": "<sup>7</sup> ခီၫလီၫ.-ထိးဆၧထီးအလူၬ,နဲၩဆၧထီးအလူၬ, ယိလါဆၧထီးအလူၬ,အွံၪၥၭဆၧၩ့ဆၧထီးအ",
			"8": "<sup>8</sup> လူၬလီၫ.- ဆၧအဲၪဆၧကွံၩနီၪလၩ့မါနးဆိၭအ့ၬ. အ့ၪ မွဲဆၧချဲၩ့လၧမီၪအချိၬၥံၪမိဒံၩခွံၬ, ဖျ့ၩၥံၪမိလၩ့မါပံၭ,",
			"9": "<sup>9</sup> ဆၧၥ့ၪယၫလဖၪမိဒံၩခွံၬဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩပၥ့ၪ ယၫဆၧလနၩ့,ဒဲပချဲၩ့ဆၧလၧမီၪအချိၬလနၩ့လီၫ.",
			"10": "<sup>10</sup> အ့ၪမွဲထီးဆၧလၧၫ့ဆၧဎွ့ၩဂဲၫအ့ၪထီၩ့ခိၬတၭ, ဆၧ",
			"11": "<sup>11</sup> လနၩ့မိဒံၩခွံၬဝ့ၫလီၫ.- လၧယဖိၪၥၪအခံၫ့အခၫနီၪ,ယ ချဲၩ့ဆၧဘဲၫဖိၪၥၪအၥိၭ, ယဆီၫ့မီၪ့ဆၧဘဲၫဖိၪၥၪအ ၥိၭ,ယကိၪ့ဆၧ ဘဲၫဖိၪၥၪအၥိၭလီၫ. အ့ၪမွဲထီးယၥၭ",
			"12": "<sup>12</sup> ၡါယူၭတၭ, ယခွံၬၡိၭခွံၬဖိၪၥၪအဆၧနီၪလီၫ.- အဂဲး ဘဲၫယီၩဘိၩ့နဲၪ့ယီၩ, ပဒၪဘၪဆၧလၧမ့ၬထံၫလၩ အဖၧၩ့, ဖျီၪလဂ့ၩဘၪ, အ့ၪမွဲကဲခိၬနီၪ, လၧမ့ၬခီၫမ့ၬ လီၫ. ဘိၩ့နဲၪ့ယီၩယၥ့ၪယၫဆၧလနၩ့, အ့ၪမွဲကဲခိၬနီၪ,",
			"13": "<sup>13</sup> ယမိၥ့ၪယၫဆၧန့ၫဎီၩ့ လၧဆၧၥ့ၪယၫယၧၩလီၫ.-ဘိၩ့ နဲၪ့ယီၩဆၧနဲၩ, ဆၧယိလါ, ဆၧအဲၪဆၧကွံၩ အီၪ ဝ့ၫၥၧၫ့မံၩ့လီၫ. တၭလၧၥၧၫ့မံၩ့ အကျၩနီၪ, ဆၧအဲၪ ဆၧကွံၩမွဲအဒိၪထုၬလီၫ."
		},
		"14": {
			"1": "<sup>1</sup> လီၩ့ချႃၭန့ဆၧအဲၪဆၧကွံၩနီၪ,ဂဲၩလိၬဆိၫ့န့ဘၪဆၧ ဘၪဆဲၫ့လၧၥၭ, ဒဲဆၧချဲၩ့လၧမီၪအချိၬ ဒိၪနဲၪ့အဂူၫ",
			"2": "<sup>2</sup> ဂၩနီၪဆံၭ.- အဂဲးဘဲၫယီၩ ၦလၧအလီၩလၩ့လၬလၩ့ ဆၧလၧဆၧအဖျ့ၩလၧၦလၥ့ၪယၫဘၪနီၪလမွဲဘၪအ လီၩဆၧလၧၦၡၩ, မွဲလၧယွၩလီၫ. အဂဲးဘဲၫယီၩၦၡၩ နၪၥ့ၪနးဂၩအ့ၬ. မွဲလါနၫ့ဘိၩ,လၧၥၭအဖၧၩ့နီၪလီၩ",
			"3": "<sup>3</sup> လၩ့လၬလၩ့ဆၧယိၬလဖၪလီၫ.- အ့ၪမွဲၦလၧအချဲၩ့ ဆၧလၧမီၪအချိၬနီၪ, မွဲအလီၩလၩ့ဆၧလၧအမၩထၪ့ မၩထီၫၦၡၩဒဲဆၧပဂၨၪထၪ့အခဲၫ့, ဒဲအမၩမုၬထၪ့ဆၧ",
			"4": "<sup>4</sup> လီၫ.- ၦလၧအလီၩလၩ့ဆၧ လၧဆၧအဖျ့ၩလၧၦလၥ့ၪ ယၫဘၪနီၪ မွဲအမၩထၪ့မၩထီၫ အနၫ့ဆါဒၪဝ့ၫတၭ, အ့ၪမွဲၦလၧအချဲၩ့ဆၧလၧမီၪအချိၬနီၪ, မွဲအမၩထၪ့",
			"5": "<sup>5</sup> မၩထီၫဆၧအီၪကီၪ့လီၫ.- ဘၪယၥၭလၧနၥံၪထီးအ လူၬချဲၩ့ဆၧလၧဆၧအဖျ့ၩၥံၪ လၧၦလၥ့ၪယၫဘၪနီၪ, မွဲလါနၫ့ဘိၩ, လၧနၥံၪချဲၩ့ဆၧ လၧမီၪအချိၬဆ့အၪနဲၪ့ အနီၪဒံၭလီၫ. အဂဲးဘဲၫယီၩၦလၧ အလီၩလၩ့ဆၧလၧ ဆၧအဖျ့ၩၥံၪလၧၦလၥ့ၪယၫဘၪနီၪ, အ့ၪလချဲၩ့ကျိၭ ထဲၩ့ဘၪဘဲၫၥိၭဆၧအီၪကီၪ့ မိထၪ့မိထီၫဝ့ၫနီၪၦလၧ အချဲၩ့ဆၧလၧမီၪအချိၬနီၪ, မွဲအဒိၪနဲၪ့အဝ့ၫနီၪဒံၭလီၫ.",
			"6": "<sup>6</sup> မွဲလါနၫ့တၭ, ဘိၩ့နဲၪ့ယီၩဖုၥံၪဝဲၥံၪဧ့, ယအ့ၪလ့ၩ လီၩလၩ့ဆၧလၧနၥံၪအအီၪလၧအဖျ့ၩၥံၪလၧၦလၥ့ၪ ယၫဘၪတၭ, ယချဲၩ့ဆၧအ့ၪလဖျီၪထၪ့ဘၪ,အ့ၪလဒုၭ ၥ့ၪယၫဘၪဆၧတၭ, ယအ့ၪလချဲၩ့ဘၪ ဆၧလၧမီၪအ ချိၬ အ့ၪလၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဘၪဆၧတၭ, ယမိဒုၭဘၪန",
			"7": "<sup>7</sup> ၥံၪလၧဆၧအခိးအတၩလမံၩ့လဲၪ.- ဆၧလၧအလအီၪ ဘၪလၧအၥၭ, ပံၩမွဲဂ့ၩ, နါဒံၩ့မွဲဂ့ၩ, ၥီၫထၪ့ဝ့ၫတၭ, အ့ၪလအၪ့နၩ့ဖၭဘၪ အၥီၫအဆၧၫ့နီၪ, အူၪဆၧမွဲဂ့ၩ,",
			"8": "<sup>8</sup> ဒံၩ့ဆၧမွဲဂ့ၩ, ၦၥ့ၪယၫမိၥ့ၪဘဲၫလဲၪ.- ခွ့ၩအ့ၪၥီၫပျီၩ ပျီၩတၭ,မွဲပလၫမိတဲၩ့ဝဲၩအၥၭလၧအမိဒုၭၥုၭအဂး",
			"9": "<sup>9</sup> လဂၩလဲၪ.- ဘဲၫနီၪအၥိၭနၥံၪဝ့ၫဒၪနၥံၪ အ့ၪလချဲၩ့ဘၪ ဆၧလၧနၥံၪအဖျ့ၩ, ဘဲၫၥိၭၦနၪၥ့ၪမိယီၫတၭ, ၦၥ့ၫယၫ ဆၧချဲၩ့မိၥ့ၪဘဲၫၥ့ၪလဲၪ. အဂဲးဘဲၫယီၩ နၥံၪမိချဲၩ့ဆၧ",
			"10": "<sup>10</sup> လၧလံၩအဖၧၩ့လီၫ.- ဆၧၥီၫၥံၪအီၪဝ့ၫအၪမံၩ့လၧဂၪ့ ခိၪချိၫ့တၭ, အခီၫပယီၫလအီၪဘၪနီၪ, အီၪၥ့ၪနးမံၩ့အ့ၬ.",
			"11": "<sup>11</sup> မၩအၥၭဘဲၫနီၪတၭ, ယအ့ၪလၥ့ၪယၫဘၪဆၧအ လူအခီၫပယီၫတၭ, ယမိကဲၪထၪ့ၦလဆၨၩဒၪ လၧၦ ချဲၩ့ဆၧအမ့ၬယၫတၭ, ၦလၧအချဲၩ့ဆၧမိကဲၪထၪ့ၦ",
			"12": "<sup>12</sup> လဆၨၩဒၪလၧယမ့ၬယၫဆ့လီၫ.- ဘဲၫနီၪအၥိၭမွဲနၥံၪ အၥၭဂဲၩလိၬ လၧနၥံၪန့ဘၪဆၧဘၪဆဲၫ့ လၧၥၭအဂဲး တၭ, ဘဲၫၥိၭနၥံၪမိအီၪ လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩ ဒဲမိမၩထၪ့ မၩထီၫဆၧအီၪကီၪ့ အဂဲးတၭ, အၪ့ဎၬနၥံၪဝ့ၫဘီၪ.",
			"13": "<sup>13</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦလၧအလီၩလၩ့ဆၧလၧဖျ့ၩလၧ ၦလၥ့ၪယၫဘၪနီၪ, မွဲအအၪ့ကံၩ့ဘဲၫၥိၭအမိချဲၩ့ကျိၭ",
			"14": "<sup>14</sup> ထဲၩ့ဆၧဆံၭ.- အဂဲးဘဲၫယီၩယအ့ၪဘၩဆိၪဖၪဆၧ လၧဖျ့ၩလၧၦလၥ့ၪယၫဘၪနီၪ ယၥၭဘၩဆိၪဖၪဆၧ",
			"15": "<sup>15</sup> အ့ၪမွဲယၥၭကိၪ့ဆၧၥ့ၪ အီၪလၧအၥၪအ့ၬ.- မၩအၥၭ ဘဲၫနီၪတၭ, မွဲဆၧနီၪလမံၩ့လဲၪ. ယမိဘၩဆိၪဖၪဆၧ လၧၥၭတၭ, ယမိဘၩဆိၪဖၪဆၧလၧၥၭကိၪ့ဆၧၥ့ၪဆ့လီၫ. ယမိၥံၫကျံၩ ဆၧလၧၥၭတၭ, ယမိၥံၫကျံၩဆၧ လၧၥၭကိၪ့ဆၧၥ့ၪဆ့လီၫ.",
			"16": "<sup>16</sup> အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, နအ့ၪဆိၪဂ့ၩဆၧလၧၥၭ တၭ, ၦလၧအအီၪလၧၦလၥ့ၪဘၪလံၬနီၪ အလးလဂၩ, မွဲအနၪနဆၧချဲၩ့လၥ့ၪဘၪတၭ, လၧနစံၭထၪ့အၪ့အူၭ",
			"17": "<sup>17</sup> ဆၧအခိးနီၪမွဲအမိစံၭ,အၩမံၩ့ဘဲၫၥ့ၫလဲၪ.- အဂဲး ဘဲၫယီၩ,မွဲမၬ, နစံၭထၪ့အၪ့အူၭဆၧ ဂ့ၩဘၪစဲၪလါနၫ့",
			"18": "<sup>18</sup> ဘိၩ,မၩထၪ့မၩထီၫဂူၫဂၩအ့ၬ.- ယလီၩလၩ့ဆၧလၧ ဖျ့ၩၥံၪလၧၦလၥ့ၪယၫဘၪ လဖၪအၪနဲၪ့ နၥံၪဝ့ၫထီးအ",
			"19": "<sup>19</sup> လူၬတၭ, ယစံၭထၪ့အၪ့အူၭယွၩလီၫ.- မွဲလါနၫ့ဘိၩ, လၧဆၧအီၪကီၪ့အကျၩနီၪ, ယချဲၩ့ဆၧယဲထံၪလၧယ ၥၭလၧအကိၪ့ဆၧၥ့ၪ, ဘဲၫၥိၭယမိၥီၪ့ထဲၩ့ ၥၫ့ထဲၩ့ဂူၫ ဂၩဆ့တၭ, ဘၪယၥၭဒိၪနဲၪ့လၧဖျ့ၩ လၧၦလၥ့ၪယၫ ဘၪနီၪအထံၪလလၬဒံၭလီၫ.",
			"20": "<sup>20</sup> ဖုၥံၪဝဲၥံၪဧ့, လၧၥၭကိၪ့ဆၧၥ့ၪအဖၧၩ့နီၪ, နၥံၪထီး ကဲၪဖိၪၥၪလဂ့ၩ,အ့ၪမွဲလၧနၥံၪမ့ၬလဲၩဆၧအဖၧၩ့ နီၪမွဲနၥံၪကဲၪ ဖိၪၥၪဒၪဝ့ၫဆံၭ.အ့ၪမွဲလၧၥၭကိၪ့ ဆၧၥ့ၪအဖၧၩ့နီၪ, မွဲနၥံၪကဲၪထၪ့ၦအလၧၫ့အဎွ့ၩ",
			"21": "<sup>21</sup> ဆံၭ.- ဆၧကွ့ၭအၥၭလၧဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့နီၪ, လၧဖျ့ၩအဂူၫဂၩလဖၪ, ဒဲနိၭဖျံၩအဂူၫဂၩလဖၪ, ယမိလီၩလၩ့လၬလၩ့ၦခမျၧးယီၩ, မၩဎွ့ၩနီၪလါနၫ့ဘိၩ, အဝ့ၫၥံၪခိၭနၪယလူအ့ၬ, ကဆါစံၭဝ့ၫဒၪ.",
			"22": "<sup>22</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧအဖျ့ၩလဖၪမွဲလၧဆၧမၩ နဲၪ့အဂးလီၫ.မွဲလါနၫ့ဘိၩ, မွဲလၧၦၡၩနဲၩဆၧအ ဂးလမွဲဆ့ဘၪ, မွဲလၧၦလနဲၩဘၪလဖၪအဂးလီၫ. အ့ၪ မွဲဆၧချဲၩ့လၧမီၪအချိၬနီၪ, မွဲလၧၦၡၩလနဲၩဘၪလ ဖၪအဂးလမွဲဘၪ, မွဲလၧၦနဲၩဆၧလဖၪအဂးနီၪလီၫ.",
			"23": "<sup>23</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧအီၪကီၪ့ထီးအလူၬ အ့ၪ အီၪကီၪ့လၧအလး လစီၪ့ဎးနီၪ, ၦကိၭဂၩဒ့ၭချဲၩ့ဆၧ လၧဖျ့ၩလဖၪတၭ, ၦလၧအလၥ့ၪဘၪ လံၬမွဲဂ့ၩ,ၦလၧ အလနဲၩဘၪမွဲဂ့ၩ, အ့ၪဂဲၫနုၬတၭ, မိစံၭဝ့ၫလၧနၥံၪ",
			"24": "<sup>24</sup> မွဲအဖျႃနီၪ, မွဲအ့ၬဧၪ.- အ့ၪမွဲၦကိၭဂၩဒ့ၭအ့ၪချဲၩ့ ဆၧလၧမီၪအချိၬတၭ, ၦလၧအလၥ့ၪဘၪ လံၬမွဲဂ့ၩ,ၦ လၧအလနဲၩဘၪမွဲဂ့ၩ, အ့ၪဂဲၫနုၬတၭ, မိဘၪဆၧၥီၪ့ ထဲၩ့ဝ့ၫလၧၦကိၭဂၩဒ့ၭတၭ, မိဘၪဆၧစ့ၩရၫ့ဝ့ၫလၧ",
			"25": "<sup>25</sup> ၦကိၭဂၩဒ့ၭလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧအီၪၥူၪ လၧအၥၭခံဖၧၩ့နီၪမိဖျီၪထၪ့ဝ့ၫတၭ, မိထွံၩလၩ့အခၪ့ မိချႃၬလၩ့အမ့ၬ, မိဘၩထၪ့ယွၩ, ဒဲမိလီၩဘၪဆၧလၧ ယွၩအီၪလၧနၥံၪအကျၩ လၩ့ထံးလၩ့ဆ့ၭလီၫ.",
			"26": "<sup>26</sup> မၩအၥၭဘဲၫနီၪတၭ, ဖုၥံၪဝဲၥံၪဧ့, ဆၧမၩအၥၭဘဲၫ ၥ့ၪလဲၪ, ထီးနၥံၪအီၪကိၩ့အီၪကီၪ့နီၪ, နၥံၪအီၪလဂၩ ဘၪလဂၩ လၧဆၧၥံၫကျံၩ, အီၪလၧဆၧၥီၪ့ဆၧၥၫ့, အီၪလၧဆၧအဖျ့ၩ, အီၪလၧဆၧနဲၪဖျီၪဆၧ, အီၪလၧ ဆၧချဲၩ့ကျိၭထဲၩ့ဆၧ ဆုၬဆုၬလီၫ. မွဲၦမၩဆၧထီးအ",
			"27": "<sup>27</sup> လူၬဘဲၫၥိၭဆၧမိထၪ့မိထီၫဆံၭ- ၦအ့ၪချဲၩ့ဆၧလၧ ဖျ့ၩ လၧၦလၥ့ၪယၫဘၪနီၪ, ၦချဲၩ့ဆၧနံၫဂၩ ၥၧၫ့ဂၩ",
			"28": "<sup>28</sup> တၭ,မွဲၦလဂၩ ချဲၩ့ကျိၭထဲၩ့ဆၧဘီၪ.- တၭၦလၧအချဲၩ့ ကျိၭထဲၩ့ဆၧအ့ၪလအီၪဘၪနီၪ, မွဲအအီၪလၩ့မါပံၭ လၧဆၧအီၪကီၪ့အကျၩဆံၭ, မွဲအလီၩဘၪအနၫ့ဆါ",
			"29": "<sup>29</sup> ဒၪဝ့ၫ,ဒဲယွၩဆံၭ.- တၭမီၪလဖၪနီၪ မွဲအလီၩလၩ့ဆၧ နံၫဂၩမွဲဂ့ၩ,ၥၧၫ့ဂၩမွဲဂ့ၩ, မွဲၦဂူၫဂၩလဖၪစ့ၩရၫ့ဆၧ",
			"30": "<sup>30</sup> ဆံၭ.- တၭဆၧအ့ၪဖျီၪထၪ့လမံၩ့မံၩ့ လၧၦလဂၩဒၪ လၧအဆၧၫ့နၩ့ထီးနီၪ, ၦအဝံခိၪလဂၩ, မွဲအအီၪလၩ့",
			"31": "<sup>31</sup> မါပံၭဆံၭ.- အဂဲးဘဲၫယီၩဘဲၫၥိၭၦကိၭဂၩဒ့ၭမိဘၪ ဆၧၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဝ့ၫ, ဒဲဆၧမၩမုၬထၪ့ထဲၩ့ဝ့ၫနီၪ, နၥံၪ ချဲၩ့ဆၧလဂၩဘၪလဂၩ, လဂၩဘၪလဂၩ လၧမီၪအ",
			"32": "<sup>32</sup> ချိၬၥ့ၪလီၫ.- တၭမီၪလဖၪအၥၭအီၪဝ့ၫလၧမီၪၥံၪအဖၫ့",
			"33": "<sup>33</sup> လၬလီၫ.- အဂဲးဘဲၫယီၩ ယွၩလဘၪဆဲၫ့ဘၪလၧ ဆၧတုၩ့ထၪ့တုၩ့လၩ့, မွဲအဘၪဆဲၫ့ လၧဆၧဘၪလိၬ အိၭလိၬဘဲၫ လၧကယဲၦဆံၫ့ဎံၪ အဆၧအီၪကီၪ့အကျၩ",
			"34": "<sup>34</sup> အၥိၭနီၪလီၫ.- လၧဆၧအီၪကီၪ့အကျၩနီၪ, မွဲနၥံၪ အမုၪလဖၪ အီၪလၩ့မါပံၭဆံၭ.အဂဲးဘဲၫယီၩ ဆၧဖ့ၪလၫ့အဝ့ၫၥံၪ လီၩလၩ့လၬလၩ့ဆၧအ့ၬ. အဝ့ၫ ၥံၪဘၪအီၪလၧအဖၫ့လၬ, ဘဲၫဆၧမၪလူၬစံၭဝ့ၫအ",
			"35": "<sup>35</sup> ၥိၭနီၪဆ့လီၫ.- ဆၧအ့ၪမိမၩလိၪဘၪအၥၭလၧဆၧ လမံၩ့မံၩ့တၭ, မွဲအအၪ့စၪ့အဝၩၥံၪ လၧအဂံၪ့ဒၪဝ့ၫဆံၭ. အဂဲးဘဲၫယီၩ ၦမုၪချဲၩ့ဆၧလၧဆၧအီၪကီၪ့အကျၩနီၪ",
			"36": "<sup>36</sup> မွဲဆၧမ့ၬမဲလီၫ.- မွဲဘဲၫၥ့ၪလဲၪ, မွဲယွၩအလူအထၫဂဲၫ ထၪ့ယူၭ လၧနၥံၪအဖၧၩ့ဧၪ. မွဲအဂဲၫထီၩ့ယူၭန့ၫလၧ",
			"37": "<sup>37</sup> နၥံၪအအီၪနီၪဧၪ.- ၦလဂၩအ့ၪဆီၫ့မီၪ့လၧအနၫ့ဆါ ဒၪဝ့ၫမွဲမီၪမွဲဂ့ၩ,လၧအဘၪဆဲၫ့လၧၥၭမွဲဂ့ၩ,မွဲအ အုၩ့လၩ့လၧဆၧလဖၪ လၧယကွ့ၭန့နၥံၪမွဲကဆါအဆၧ",
			"38": "<sup>38</sup> မၪလူၬနီၪဆံၭ.- မွဲလါနၫ့ဘိၩ, ၦလဂၩအ့ၪလၥ့ၪယၫ ဘၪတၭ, မွဲအအီၪဒၪဝ့ၫ လၧဆၧလၥ့ၪယၫဘၪအဖၧၩ့",
			"39": "<sup>39</sup> ဆံၭ.- မၩအၥၭဘဲၫနီၪတၭ, ဖုၥံၪဝဲၥံၪဧ့,ဆိၫ့တၡါချဲၩ့ ဆၧလၧမီၪအချိၬဘီၪ. ထီးမၩထံၬထၬချဲၩ့ဆၧလၧဖျ့ၩ",
			"40": "<sup>40</sup> လဖၪလဂ့ၩ.- အ့ၪမွဲဆၧထီးအလူၬနီၪ မွဲပမၩဝ့ၫဂ့ၩ ဂ့ၩဘၪဘၪ, ဒဲအ့ၪဎူၫအ့ၪဎၩ့ဆံၭ."
		},
		"15": {
			"1": "<sup>1</sup> ဖုၥံၪဝဲၥံၪဧ့, ယဒုၭၥ့ၪယၫနၥံၪလၧဆၧၥၭထိၬအ ပရၧၫ့လၧယလီၩဘၪနၥံၪလၧနၥံၪထိးဆၧၫ့ဝ့ၫဆ့, ဒဲ",
			"2": "<sup>2</sup> နၥံၪဆၧၫ့ထုၪ့လၧအဖၧၩ့ယီၩး- ဆၧနီၪနၥံၪအ့ၪလ နဲၩဘၪဆၧပျီၩပျီၩနီၪ, နၥံၪအ့ၪဖီၪ့ထၬ ဆၧလၧယလီၩ",
			"3": "<sup>3</sup> ဘၪနၥံၪ,မွဲဆၧထိးထဲၩ့တၩ့ထဲၩ့နၥံၪဆ့လီၫ.- ယဖ့ၪ လၫ့ဆိၫနၥံၪဆၧလၧယန့ဘၪယဝ့ၫ, မွဲလၧဎရံၬထိးၥံၫ အၥၭလၧပဆၧဒဲၩဘၭအကၠီၩ့,ဘဲၫလံၬစံၭဝ့ၫအၥိၭ",
			"4": "<sup>4</sup> လီၫ.-လၧအဘၪဆၧခုၪ့လၩ့ဘၧၩ့ဝ့ၫတၭ, လၧၥၧၫ့နံၩ လနံၩအဖၧၩ့နီၪ, ဂဲထုၪ့ထဲၩ့ဝ့ၫဘဲၫလံၬစံၭဝ့ၫအၥိၭ",
			"5": "<sup>5</sup> နီၪလီၫ.-မွဲအနဲၪဖျီၪထၪ့အၥၭလၧစစံဖၭနီၪ,လၧခဲၫ့",
			"6": "<sup>6</sup> ထဲၩ့လၧၦလဆံၫနံၫဂၩလီၫ.- လၧခဲၫ့ထဲၩ့မွဲအနဲၪဖျီၪ ထၪ့အၥၭ လၧထၧၫ့ဖုဝဲယဲယၩဘျဲၪလဖၧၫ့ဎးလီၫ. အ ဝ့ၫၥံၪမံၫယူၭလနၩ့ယူၭလါနၫ့ဘိၩ, အီၪဒံၭဝ့ၫ ခီးဘိၩ့",
			"7": "<sup>7</sup> နဲၪ့ယီၩအၪဒၪဆၧလီၫ.- လၧခဲၫ့မွဲအနဲၪဖျီၪထၪ့အၥၭ လၧစယ့မံၭနီၪ, လၧခဲၫ့လၧၦဆၧအၪ့မၧၫ့ဖိၪ ထီးအ",
			"8": "<sup>8</sup> လူၬ,-လၧခဲၫ့ထုၬနဲၪဖျီၪထၪ့အၥၭ လၧယၧၩယီၩ, ဘဲၫၦလၧအအီၪဖျဲၪဝ့ၫ လၧအမုအလၩ လဘၪဘၪအ ၥိၭနီၪလီၫ.",
			"9": "<sup>9</sup> အဂဲးဘဲၫယီၩ ယဝ့ၫဒၪယီၩ, မွဲလၧယမၩအၧၩ့မၩ ၥၫ့ယွၩအဆၧအီၪကီၪ့အကၠီၩ့တၭ, ယမွဲၦဆၧအၪ့မၧၫ့ ဖိၪအဆံၭထုၬ,ဆၧကြၨၭကိၭယၧၩလၧၦဆၧအၪ့မၧၫ့",
			"10": "<sup>10</sup> ဖိၪအ့ၬ.- မွဲလါနၫ့ဘိၩ, ထီးဒၪယမွဲဆၧယီၩ, ယမွဲဆၧ လၧယွၩအခိးအတၩ အကၠီၩ့တၭ, အခိးအတၩလၧအ ဘၪယၧၩယီၩ မွဲအလဘၪဘၪယၧၩပျီၩပျီၩ, မွဲယမၩ အၪနဲၪ့အဝ့ၫၥံၪထီးအလူၬ, မွဲလါနၫ့ဘိၩ, လမွဲဘၪ ယၧၩးမွဲယွၩအခိးအတၩလၧအအီၪလၧယဖၧၩ့",
			"11": "<sup>11</sup> လီၫ.-မၩအၥၭဘဲၫနီၪတၭ, ယၧၩမွဲဂ့ၩ, အဝ့ၫၥံၪမွဲဂ့ၩ, ပလီၩလၩ့လၬလၩ့ဆၧဘဲၫနီၪ, ဒဲနၥံၪနဲၩဆၧဘဲၫနီၪ အၥိၭဆ့လီၫ.",
			"12": "<sup>12</sup> ၦအ့ၪလီၩလၩ့လၬလၩ့ဎရံၬ လၧအဂဲထုၪ့ထဲၩ့ဝ့ၫ လၧ ဆၧၥံၪအဖၧၩ့တၭ, ၦလၧနၥံၪအကျၩလနၩ့နၩ့စံၭဝ့ၫ လၧၦၥံၫလဖၪလဂဲထုၪ့ထဲၩ့ဘၪနီၪ,မွဲဘဲၫၥ့ၪလဲၪ.",
			"13": "<sup>13</sup> မွဲလါနၫ့ဘိၩ, ၦအၥံၫနီၪ အ့ၪလဂဲထုၪ့ထဲၩ့ဘၪတၭ,",
			"14": "<sup>14</sup> ဎရံၬဂဲထုၪ့ထဲၩ့ဝ့ၫဆ့အ့ၬ.- ဎရံၬအ့ၪလဂဲထုၪ့ထဲၩ့ ဘၪနီၪ,ပလီၩလၩ့လၬလၩ့ဆၧ မွဲဆၧပျီၩပျီၩတၭ,",
			"15": "<sup>15</sup> နၥံၪအဆၧနဲၩနီၪ မွဲဆၧပျီၩပျီၩဆ့လီၫ.- ဒဲပဝ့ၫဒၪယီၩ, ပမွဲၦထိးအၥၭ လၧဆၧဘျံၭဆၧဘျၪ လၧယွၩအဂဲး လီၫ. အဂဲးဘဲၫယီၩပထိးပၥၭ လၧယွၩအဂဲး, လၧအ ဒုၭဂဲထုၪ့ထဲၩ့ဎရံၬလီၫ. မွဲလါနၫ့ဘိၩၦအၥံၫ အ့ၪလဂဲ",
			"16": "<sup>16</sup> ထုၪ့ထဲၩ့ဘၪတၭ, မွဲအဒုၭဂဲထုၪ့ထဲၩ့အဝ့ၫနီၪအ့ၬ.- အ ဂဲးဘဲၫယီၩ, ၦအၥံၫအ့ၪလဂဲထုၪ့ထဲၩ့ဘၪတၭ, ဎရံၬဂဲ",
			"17": "<sup>17</sup> ထုၪ့ထဲၩ့ဝ့ၫအ့ၬ.- တၭဎရံၬအ့ၪလဂဲထုၪ့ထဲၩ့ဘၪနီၪ, န ၥံၪအဆၧနဲၩ မွဲဆၧပျီၩပျီၩတၭ, နၥံၪအီၪဒံၭလၧဆၧ",
			"18": "<sup>18</sup> ဒဲၩဘၭအဖၧၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦလၧအ",
			"19": "<sup>19</sup> မံၫလၧဎရံၬအဖၧၩ့လဖၪနီၪ, မိဂၭဂီၩ့ဝ့ၫဆ့လီၫ.- ပအ့ၪ ယိလါဆၧ လၧဎရံၬအဖၧၩ့, န့ၫလၧဆၧမၧၫ့လကၠၪ ယီၩအဖၧၩ့တၭ, မိဘၪဆၧနၭဆၧၡၪ့နၭနဲၪ့ၦဂူၫ ဂၩထီးအလူၬဒံၭလီၫ.",
			"20": "<sup>20</sup> အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ, ဎရံၬဂဲထုၪ့ထဲၩ့ယူၭလၧဆၧ ၥံၫအဖၧၩ့ယူၭ, ကဲၪၦအမံၫမၪဝ့ၫလဖၪအဆၧၥၪဆိၫ",
			"21": "<sup>21</sup> လီၫ.- အဂဲးဘဲၫယီၩ မွဲဆၧၥံၫအီၪထၪ့လၧၦၡၩအ ကၠီၩ့တၭ, ဆၧဂဲထုၪ့ထဲၩ့လၧဆၧၥံၫအဖၧၩ့နီၪ,အီၪ",
			"22": "<sup>22</sup> ထၪ့လၧၦၡၩအကၠီၩ့ဆ့လီၫ.- အဂဲးဘဲၫယီၩဘဲၫၦ ထီးအလူၬၥံၫဝ့ၫလၧစအၫဒၫ့အဖၧၩ့အၥိၭနီၪ, ၦထီးအ လူၬမိမၧၫ့ထၪ့ထဲၩ့ဝ့ၫလၧဎရံၬအဖၧၩ့ ဘဲၫနီၪၥိၭဆ့",
			"23": "<sup>23</sup> လီၫ.-မွဲလါနၫ့ဘိၩ, ၦၡၩလဂၩဘၪလဂၩလၧအလး ဒၪဝ့ၫအဖၧၩ့ဆုၬဆုၬ, ဆၧၥၪဆိၫ ဘဲၫၦစံၭဆၧအၥိၭ ဎရံၬ,လၧခဲၫ့ထဲၩ့တၭ, ထီးဎရံၬဂဲၫလၩ့ထဲၩ့ဝ့ၫ လၧၦ",
			"24": "<sup>24</sup> ဎရံၬဖိၪလဖၪလီၫ.- ထီးနီၪလဖၧၫ့, ထီးအမၩဂၭဂီၩ့ခွံၬ ကယဲဆၧအခိၪ, ဒဲဆၧအစီၩ့အမၩ့,ဒဲဆၧအၥူၭအၥဲၪ့ ထီးအလူၬတၭ, ထီးအဖ့ၪထဲၩ့ဘၩ့မုးလၧဖါ,ယွၩ အစူၪဖၧၩ့နီၪ, အထုၬမိဘၪဝ့ၫလီၫ.",
			"25": "<sup>25</sup> အ ဂဲး ဘဲၫ ယီၩ, ဎ ရံၬ ဘၪ ကဲၪ စ ဎွၩ ထီး အ အီၪ က့ၪ လၩ့ က ယဲ အ ဒုၪ အ ဒၩ လၧ အ",
			"26": "<sup>26</sup> ခၪ့ ယၫ ၥၭ အ ဖၫ့ လၬ ကိၭ ဂၩ ဒ့ၭ လီၫ.- ဒုၪ ဒၩလၧခဲၫ့ထုၬ, ဆၧၥံၫနီၪမိဘၪဆၧဂၭဂီၩ့လီၫ. အဂဲးဘဲၫယီၩ မွဲအအီၪက့ၪယူၭဆၧထီးအလူၬ လၧအခၪ့",
			"27": "<sup>27</sup> ယၫၥၭအဖၫ့လၬယူၭ.- မွဲလါနၫ့ဘိၩ, လၧအစံၭအအီၪ က့ၪဆၧထီးအလူၬလၧအဖၫ့လၬတၭ,မွဲအအီၪဖျီၪ ဝ့ၫလၧအလဘၪဘၪၦ လၧအအီၪက့ၪဆၧ ထီးအလူၬ",
			"28": "<sup>28</sup> လၧအဖၫ့လၬလဂၩနီၪလီၫ.- ဆၧထီးအလူၬ ဘၪဆၧ အီၪက့ၪဝ့ၫလၧအဖၫ့လၬတၭ,ထီးနီၪလဖၧၫ့ဖိၪခွၫ အနၫ့ဆါဒၪလ့ၬမိအီၪဝ့ၫ လၧၦလၧအအီၪက့ၪဆၧထီး အလူၬလၧအဖၫ့လၬလဂၩ အဖၫ့လၬဆ့တၭ, ဘဲၫ ၥိၭယွၩမိကဲၪဆၧထီးအလူၬ လၧဆၧထီးအလူၬအဖၧၩ့ လီၫ.",
			"29": "<sup>29</sup> အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, ၦလၧအၥံၫလဖၪအ့ၪလဂဲ ထုၪ့ထဲၩ့ဘၪနီၪ, ၦၡၩလၧအဒိၭဘၭတံၫဇၫ့အၥၭလၧ ၦၥံၫအဂးလဖၪနီၪ, မိမၩဝ့ၫဘဲၫၥ့ၪလဲၪ.အ့ၪမၩအ ၥၭဘဲၫနီၪတၭ, မွဲဘၪနီၫလၧအဒိၭဘၭတံၫဇၫ့အၥၭလၧ",
			"30": "<sup>30</sup> ၦၥံၫအဂးလဲၪ.-ပဝ့ၫဒၪယီၩ ပမိဘၪဆၧၡၪ့ဆၧနၭကိၭ",
			"31": "<sup>31</sup> အနၩရံၩဒ့ၭမွဲဘၪလဲၪ.- ယစံၭလၧယၥၭခံဖၧၩ့တီၩ တီၩလီၩ့လီၩ့ လၧနၥံၪအဆၧၥၭထိၬ အီၪလၧယၧၩ လၧပကဆါယ့ၫရှူၬဎရံၬ အဖၧၩ့နီၪ, ယၥံၫကိၭမု နံၩမုနၩဒ့ၭလီၫ.",
			"32": "<sup>32</sup> ယအ့ၪဒုၭလိၬယၥၭ လၧဆၧဖိၪဆၧဎါအမံၩ့လၧအ့ ဖစၧၭအဖၧၩ့ဘဲၫၦၡၩအၥိၭတၭ, ၦအၥံၫလဖၪအ့ၪလ ဂဲထုၪ့ထဲၩ့ဘၪနီၪ, ယမိဘၪဆၧအခိးအတၩလမံၩ့လဲၪ. မွဲပအၪ့ၡီၩ့အီၪၡီၩ့ဆၧဘီၪး အဂဲးဘဲၫယီၩကဲဂီၩခိၬပမိၥံၫလီၫ.",
			"33": "<sup>33</sup> ထီးအၪ့လီၫလၩ့ နၥံၪအၥၭလဂ့ၩ, ဆၧဖံၭၥိၭလိၬ လၧဆၧအၧၩ့ဆၧၥၫ့နီၪ မၩဂၭဂီၩ့ဆၧ အထူၫအရူၫ",
			"34": "<sup>34</sup> လၧအဂ့ၩလဖၪလီၫ.- နၪ့ထၪ့ထဲၩ့နၥံၪအၥၭလၧဆၧ တီၩဆၧလီၩ့အဂဲးဘီၪး မၩဆၧဒဲၩဘၭလဂ့ၩ, အ ဂဲးဘဲၫယီၩ ၦလနၩ့နၩ့လၥ့ၪယၫဘၪယွၩတၭ, ယစံၭ ဆၧယီၩ မွဲလၧဆၧမၩမဲနၥံၪအမ့ၬလီၫ.",
			"35": "<sup>35</sup> အ့ၪမွဲၦလနၩ့နၩ့မိစံၭဝ့ၫ, ၦအၥံၫလဖၪမိဂဲထုၪ့ထဲၩ့ ဝ့ၫဘဲၫၥ့ၪလဲၪ, တၭမိဂဲထုၪ့လၧအမိၡါဆၧနီၪလမံၩ့",
			"36": "<sup>36</sup> လဲၪ.- ၦလၩ့ဂၬဂီၩ့ဖိၪဧ့, ဆၧလၧနဎွံၪလၩ့နဝ့ၫနီၪ,",
			"37": "<sup>37</sup> အ့ၪလအုၪဘၪတၭ, မဲၪထၪ့ဝ့ၫအ့ၬ.- ဘုၪကၠိၩ့မွဲဂ့ၩ, ဘုၪအဂူၫဂၩမွဲဂ့ၩ, နဎွံၪလၩ့န့ၫအချံၫလီၫ. နဎွံၪလၩ့",
			"38": "<sup>38</sup> ဆၧအမိၡါလၧအမိအီၪထၪ့ဝ့ၫအ့ၬ.- အ့ၪမွဲထီးဒၪယွၩ အၥၭတၭ,မွဲအဖ့ၪလၫ့ဝ့ၫ အမိၡါ ဒဲဆၧချံၫထီးအ လူၬ,လမံၩ့ လၧအမိၡါဒၪဝ့ၫ, လမံၩ့လၧအမိၡါဒၪဝ့ၫ",
			"39": "<sup>39</sup> လီၫ.- ဆၧယၪထီးအလူၬနီၪ, မွဲဆၧယၪလမံၩ့ဎးအ့ၬ. ၦၡၩအယၪမွဲလမံၩ့, ဆၧဖိၪဆၧဎါ အယၪမွဲလမံၩ့ဒၪ,",
			"40": "<sup>40</sup> ယၪအယၪမွဲလမံၩ့ဒၪ, ထိၪအယၪမွဲလမံၩ့ဒၪလီၫ.-တၭ ဆၧအမိၡါၥံၪဘၪဆဲၫ့လၧမူၭခိၪအီၪဝ့ၫ,ဒဲဆၧအမိ ၡါၥံၪဘၪဆဲၫ့ လၧဂၪ့ခိၪအီၪဝ့ၫဆ့လီၫ. မွဲလါနၫ့ဘိၩ့, ဆၧဘၪဆဲၫ့ လၧမူၭခိၪအလၩအဖၩ့ မွဲလမံၩ့တၭ, ဆၧ",
			"41": "<sup>41</sup> ဘၪဆဲၫ့လၧဂၪ့ခိၪအလၩအဖၩ့မွဲလမံၩ့ဒၪလီၫ.- မုမ့ၬ အလၩအဖၩ့မွဲလမံၩ့တၭ,လၩအလၩအဖၩ့မွဲလမံၩ့ ဒၪတၭ, ၡၪၥံၪအလၩအဖၩ့မွဲလမံၩ့ဒၪလီၫ. အဂဲးဘဲၫ ယီၩၡၪၥံၪအလၩအဖၩ့လဖျိၪ့ ဒဲလဖျိၪ့ လၩ့မဲၩလိၬအ ၥၭလီၫ.",
			"42": "<sup>42</sup> ၦအၥံၫဂဲထုၪ့ထဲၩ့နီၪ, မၩအၥၭဘဲၫနီၪၥိၭလီၫ. မွဲအ ဘၪဎွံၪလၩ့အၥၭ လၧဆၧအုၪၥ့ၪအဖၧၩ့တၭ, မိဂဲထုၪ့",
			"43": "<sup>43</sup> ထဲၩ့ဝ့ၫလၧဆၧအုၪလၥ့ၪဘၪအဖၧၩ့လီၫ.- ဘၪဎွံၪလၩ့ အၥၭလၧအလၩအဖၩ့လအီၪဘၪတၭ, မိဂဲထုၪ့ထဲၩ့ ဝ့ၫလၧအလၩအဖၩ့ အဖၧၩ့လီၫ. ဘၪဎွံၪလၩ့အၥၭ လၧအဂဲးအဘၭ လအီၪဘၪတၭ, မိဂဲထုၪ့ထဲၩ့ဝ့ၫလၧ",
			"44": "<sup>44</sup> အစီၩ့အမၩ့အဖၧၩ့လီၫ.- ဘၪဎွံၪလၩ့အၥၭနီၪမွဲနးခီၫ့, မိဂဲထုၪ့ထဲၩ့ဝ့ၫနီၪ,မွဲနးၥၭလီၫ. နးခီၫ့အီၪ, ဒဲနးၥၭ",
			"45": "<sup>45</sup> အီၪဝ့ၫဆ့လီၫ.- ဘဲၫနီၪအၥိၭဆၧကွ့ၭအၥၭ,ၦၡၩ လၧအဝံခိၪစအၫဒၫ့လဂၩနီၪ, ဆၧမၩကဲၪထၪ့ဝ့ၫလၧ ၦအီၪလၧၥၭမၧၫ့လီၫ. စအၫဒၫ့လၧခဲၫ့လဂၩနီၪ,မွဲ",
			"46": "<sup>46</sup> ၥၭလၧအမၩ မၧၫ့ထၪ့ဆၧလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧဘၪဆဲၫ့လၧၥၭနီၪ, အီၪဝံအ့ၬ,မွဲဆၧဘၪဆဲၫ့လၧ နးခီၫ့အီၪဝံဝ့ၫတၭ, ဆၧဘၪဆဲၫ့ လၧၥၭအီၪထၪ့ဝ့ၫ လၧ",
			"47": "<sup>47</sup> ခဲၫ့လီၫ.- ၦၡၩလၧအဝံခိၪလဂၩနီၪ, ကဲၪထၪ့ဝ့ၫလၧဂၪ့ ခိၪယီၩ,ဘၪဆဲၫ့လၧဂၪ့ခိၪလီၫ. ၦၡၩလၧခဲၫ့လဂၩ",
			"48": "<sup>48</sup> နီၪ,မွဲကဆါ လၧမူၭခိၪလီၫ.- ဘဲၫၦဘၪဆဲၫ့ လၧဂၪ့ခိၪ လဂၩအၥိၭနီၪ, ၦလၧအဘၪဆဲၫ့ လၧဂၪ့ခိၪလဖၪနီၪ, မွဲဘဲၫနီၪၥိၭဆ့တၭ, ဘဲၫၦဘၪဆဲၫ့ လၧမူၭခိၪလဂၩ အ ၥိၭနီၪ, ၦလၧအဘၪဆဲၫ့ လၧမူၭခိၪလဖၪနီၪ, မွဲဘဲၫနီၪ",
			"49": "<sup>49</sup> ၥိၭဆ့လီၫ.- ဘဲၫပန့ဘၪ ၦဘၪဆဲၫ့လၧဂၪ့ခိၪ အခံးအ ဂၩ့အၥိၭနီၪ, ပမိန့ဘၪၦဘၪဆဲၫ့လၧမူၭခိၪအခံးအ ဂၩ့ဆ့လီၫ.",
			"50": "<sup>50</sup> ဖုၥံၪဝဲၥံၪဧ့, ယစံၭဆၧယီၩ, ဆၧၥွံၪဒဲဆၧယၪန့ဘၪ ထဲၩ့ၥၫ ယွၩအဘၩ့အမုးၥ့ၪအ့ၬ.တၭဆၧလၧအ အုၪၥ့ၪန့ဘၪထဲၩ့ၥၫ ဆၧအုၪလၥ့ၪဘၪနီၪ ၥ့ၪဆ့အ့ၬ.",
			"51": "<sup>51</sup> ယိခွါ,ယလီၩဘၪနၥံၪ လၧဆၧအီၪၥူၪလမံၩ့ယီၩ ပလ မံၫဘၪကိၭအဂၩ,မွဲလါနၫ့ဘိၩ, ပမိဘၪဆၧအၪ့လဲၩ",
			"52": "<sup>52</sup> ထဲၩ့ပၧၩကိၭဂၩဒ့ၭ,- လၧလဆိဖိၪ,လဖျၭမ့ၬအဖၧၩ့ နီၪလၧခွ့ၩအထုၬးအဂဲးဘဲၫယီၩ, ခွ့ၩမိၥီၫထၪ့တၭ, ၦအၥံၫလဖၪ မိဂဲထုၪ့ထဲၩ့ လၧဆၧအုၪလၥ့ၪဘၪ",
			"53": "<sup>53</sup> အဖၧၩ့တၭ, ပမိဘၪဆၧအၪ့လဲၩထဲၩ့ ပၧၩလီၫ.- အ ဂဲးဘဲၫယီၩ ဆၧလၧအအုၪၥ့ၪယီၩ မိဘၪကီၩ့ၥိၭထၪ့ ဆၧလၧအအုၪလၥ့ၪဘၪတၭ, ဆၧၥံၫၥ့ၪယီၩ မိဘၪကီၩ့",
			"54": "<sup>54</sup> ၥိၭထၪ့ဆၧလၧအၥံၫလၥ့ၪဘၪလီၫ.- ထီးဆၧအ အုၪၥ့ၪယီၩ အ့ၪကီၩ့ၥိၭထၪ့ယူၭဆၧ လၧအအုၪလၥ့ၪ ဘၪတၭ, ဒဲဆၧၥံၫၥ့ၪယီၩ အ့ၪကီၩ့ၥိၭထၪ့ယူၭ ဆၧလၧ အၥံၫလၥ့ၪဘၪနီၪ, ထီးနီၪလဖၧၫ့ ဆၧချဲၩ့ကွ့ၭအၥၭ မိလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫ, ဆၧၥံၫလၩ့ဘၧၩ့ယူၭလၧ",
			"55": "<sup>55</sup> ဆၧ မၩ နၧၩ့ မၩ စၪ အဖၧၩ့ ယူၭ.- ဆၧၥံၫဧ့, နဆၧ ဆူၪအီၪခီၫခီၫလဲၪ. ဖျႃဖၧၩ့ဧ့, နဆၧမၩနၧၩ့မၩစၪ",
			"56": "<sup>56</sup> အီၪခီၫခီၫလဲၪ.- ဆၧၥံၫအဆၧဆူၪ မွဲဆၧဒဲၩဘၭ တၭ,ဆၧဒဲၩဘၭ အစီၩ့အမၩ့ မွဲဆၧမၪလူၬလီၫ.",
			"57": "<sup>57</sup> အ့ၪမွဲ စံၭထၪ့အၪ့အူၭယွၩလၧအဒုၭမၩနၧၩ့မၩစၪ ပဆၧလၧပကဆါယ့ၫရှူၬဎရံၬအကၠီၩ့နီၪဆံၭ.",
			"58": "<sup>58</sup> မၩအၥၭဘဲၫနီၪတၭ, ထၧၫ့ဖုဝဲၥၭဘီၩ့ၥံၪဧ့, မွဲနၥံၪ ၥ့ၪယၫလၧနၥံၪမၩဆၧလၧကဆါအဖၧၩ့နီၪ, လမွဲဘၪ ဆၧပျီၩပျီၩတၭ, အီၪဂုးအီၪခၧၫ့, လဂဲၩဘၪနီၪ,ဒဲမၩ ကဆါအဆၧမၩ အၪအၪဂီဂီ လထံၪဎးလဘီၩ့ဎးဆံၭ."
		},
		"16": {
			"1": "<sup>1</sup> ဆၧဘၪဆဲၫ့လၧဆၧအၪ့ထုၫ့ကီၪ့ လၧၦဆံၫ့ဎံၪလဖၪ အဂး, ဘဲၫယမၪလူၬဝဲၩ ဆၧအီၪကီၪ့လဖၪ အီၪဝ့ၫလၧ",
			"2": "<sup>2</sup> ဂလ့ၡၫအၥိၭနီၪ,မၩနၥံၪဝ့ၫဘဲၫနီၪၥိၭဆံၭ.- ယလ့ၩ အ့ၪထီၩ့ခိၬတၭ, ဘဲၫၥိၭဆၧအၪ့ထုၫ့ကီၪ့အလး ထီး အီၪလဂ့ၩနီၪး လၧဆၧလနွ့ၫအဖၧၩ့မုခၪ့ထံၭလနံၩ နီၪ,မွဲၦအီၪက့ၪကီၪ့ ဆၧလၧဆၧအီၪက့ၪကီၪ့ အလး ထီးဒၪယွၩမၩဆၧၩ့ဝ့ၫ အၥိၭကိၭဂၩဒ့ၭ ဆုၬဆုၬဆံၭ.",
			"3": "<sup>3</sup> ယအ့ၪထီၩ့ခိၬတၭ, ထီးဒၪၦလၧအဘၪ နၥံၪအၥၭလ ဖၪနီၪ,ယမိအၪ့မၧၫ့ အလ့ၩဆိၬနၥံၪအခိးအတၩ ဒဲ",
			"4": "<sup>4</sup> လံၬၥံၪလဲၥံၪ လၧယရုစလံၫ့လီၫ.- အ့ၪကြၨၭ ယလ့ၩ ယဝ့ၫဆ့တၭ, အဝ့ၫၥံၪမိဘၪလ့ၩ လၧယၥိၭလီၫ.",
			"5": "<sup>5</sup> ထီးယအ့ၪလ့ၩခၫ့ဂၬ မၫစဒိနအၫနီၪ ယမိလ့ၩလၧ နၥံၪအအီၪး အဂဲးဘဲၫယီၩ ယမိလ့ၩခၫ့ဂၬ မၫစဒိနအၫ",
			"6": "<sup>6</sup> လီၫ.- တၭဘဲၫၥိၭနၥံၪမိၥိၫ့ယၧၩ ထီးဒၪယလ့ၩဆၧ လစီၪ့စီၪ့နီၪ, ယမိအီၪလၧနၥံၪအၥိၭ, ဘၪလဘၪယမိ",
			"7": "<sup>7</sup> အီၪလၧဆၧဂီးခၫထၧၫ့ထီယၫလီၫ.- အဂဲးဘဲၫယီၩဘိၩ့ နဲၪ့ယီၩ, ယၥၭလအီၪဘၪ လၧယမိဒၪဘၪနၥံၪလၧဖၧၩ့ ၥၭလါနၫ့ဘိၩ, အ့ၪဘၪကဆါအၥၭတၭ, ယယိလါ",
			"8": "<sup>8</sup> လၧယမိအီၪ လၧနၥံၪအၥိၭ လဆိလလးလီၫ.- မွဲလါ နၫ့ဘိၩ, ယမိအီၪဒံၭလၧအ့ဖစၧၭ ထီးအဘၪယဲဆံၫအ",
			"9": "<sup>9</sup> မုနံၩနီၪလီၫ.- အဂဲးဘဲၫယီၩ တရၫ့လၧအလဲ, ဒဲလၧပ မၩဆၧၥ့ၪနီၪ, အီၪဝဲထၪ့ယူၭအၥၭတၭ, ၦဂဲးလိၬတ့ၭ လိၬအၪဂၩလီၫ.",
			"10": "<sup>10</sup> စထံမၥံၫအ့ၪထီၩ့ခိၬတၭ, ဘဲၫၥိၭအမိအီၪလၧနၥံၪ အၥိၭနီၪ,ဘဲၫၥိၭအထီးအၪ့ယိၪဆၧလဂ့ၩတၭ, ယိန ၥံၪဝ့ၫဘီၪ. အဂဲးဘဲၫယီၩအဝ့ၫနီၪမၩကဆါအဆၧ",
			"11": "<sup>11</sup> ဘဲၫယမၩယဝ့ၫအၥိၭနီၪဆ့လီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,မွဲၦၡၩထီးမၩကြၩ့ထမး အဝ့ၫနးဂၩလဂ့ၩးမွဲန ၥံၪၥိၫ့ထၪ့အဝ့ၫမုၬမုၬ ဘဲၫအမိဂဲၫထီၩ့လၧယအီၪ အၥိၭ,အဂဲးဘဲၫယီၩ ယယိလါ လၧအမိဂဲၫလၧထၧၫ့ ဖုဝဲၥံၪအၥိၭလီၫ.",
			"12": "<sup>12</sup> တၭယပဂၨၪထၪ့ထၧၫ့ဖုဝဲစအၫပီလၧၭအခဲၫ့ဆီၪ့ ဆီၪ့လ့ၬဘဲၫၥိၭ အမိလ့ၩလၧထၧၫ့ဖုဝဲအၥိၭ လၧနၥံၪ အအီၪလီၫ. ဘိၩ့နဲၪ့ယီၩ, ဆၧမိလ့ၩဘၪအၥၭလၩလါ အ့ၬ.မွဲလါနၫ့ဘိၩ, အထီအဂ့ၩ အဘၪအ့ၪဘၪတၭမိ လ့ၩဝ့ၫလီၫ.",
			"13": "<sup>13</sup> အီၪခိၭဆံၭ,ဆၧၫ့ထုၪ့ဂုးခၧၫ့ လၧဆၧနဲၩအ ဖၧၩ့ဆံၭ.မၩနၥံၪအၥၭ ဘဲၫၦၡၩအၥိၭတၭ, အီၪဂုး",
			"14": "<sup>14</sup> ခၧၫ့ဆံၭ.- နၥံၪအဆၧမၩထီးအလူၬနီၪ, မွဲအအီၪ လၧဆၧအဲၪဆၧကွံၩအဖၧၩ့ဆံၭ.",
			"15": "<sup>15</sup> စတ့ဖနၭအဂံၪ့ဖိၪနီၪ, နၥံၪၥ့ၪယၫအဝ့ၫၥံၪလၧအမွဲ ဆၧၥၪဆိၫလၧအခ့ၫယၫအဖၧၩ့တၭ, အထူၫအရူၫ အီၪဝ့ၫလၧအလုအၪ့လုအီၩၦဆံၫ့ဎံၪလီၫ. ထၧၫ့ဖုဝဲၥံၪ",
			"16": "<sup>16</sup> ဧ့, ယအၪ့ကံၩ့အၪ့ယၫနၥံၪ,- ဘဲၫၥိၭနၥံၪမိခိၭနၪၦဘဲၫ နီၪၥိၭ, ဒဲၦလၧအမၩဆၧၩ့လိၬအၥၭလၧပၧၩ,ဒဲဆၧ မၩကိၭဂၩဒ့ၭဆံၭ.",
			"17": "<sup>17</sup> စတ့ဖနၭ, ဒဲစဖီၫတနၫတၧၭ,ဒဲစအခ့ၫအကၧၭဂဲၫ ထီၩ့ဝ့ၫနီၪ, ယၥၭထိၬလီၫ. အဂဲးဘဲၫယီၩနၥံၪအဆၧ လလၧၫ့လဎွ့ၩဘၪနီၪ, အဝ့ၫၥံၪမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့",
			"18": "<sup>18</sup> ယူၭ.- အဂဲးဘဲၫယီၩ မွဲအမၩမုၬထၪ့ထဲၩ့ယူၭ ယၥၭဒဲ နၥံၪအၥၭယူၭ, မၩအၥၭဘဲၫနီၪတၭ, ၦၡၩဘဲၫအဝ့ၫ ၥံၪအၥိၭနီၪထိးဆၧၫ့ဝ့ၫဘီၪ.",
			"19": "<sup>19</sup> ဆၧအီၪကီၪ့လဖၪ လၧအ့ၡၫချဲၩ့ဒုၪ့နၥံၪလီၫ. စအ ကွံလၫဒဲနးပြံၫစံလၫ, ဒဲဆၧအီၪကီၪ့အီၪဝ့ၫ လၧအ ဂံၪ့ဖၧၩ့လဖၪနီၪ, ချဲၩ့ဒုၪ့နၥံၪလၧအအၪလၧကဆါ",
			"20": "<sup>20</sup> အဖၧၩ့လီၫ.- ထၧၫ့ဖုဝဲထီးအလူၬချဲၩ့ဒုၪ့နၥံၪလီၫ. ချဲၩ့",
			"21": "<sup>21</sup> ဒုၪ့လိၬနၥံၪအၥၭလၧဆၧအဲၪဂါဆံၫ့ဎံၪဘီၪ.- ယၧၩ,စပီ လူၫကွ့ၭဆၧလၧယစူၪဒၪယဝ့ၫတၭ, ယချဲၩ့ဒုၪ့ဆၧလီၫ.",
			"22": "<sup>22</sup> ၦအ့ၪလအဲၪဘၪ ကဆါယ့ၫရှူၬဎရံၬလဂၩဂၩ တၭ,မွဲအဘၪဆၧဆိၪအၧၩ့ဆံၭ. ကဆါဂဲၫဖီၩၬ",
			"23": "<sup>23</sup> ကဆါယ့ၫရှူၬဎရံၬအခိးအတၩနီၪ မွဲအအီၪလၧ",
			"24": "<sup>24</sup> နၥံၪအၥိၭဆံၭ.- ယဆၧအဲၪဆၧကွံၩ မွဲအအီၪလၧ နၥံၪအၥိၭ ထီးအလူၬ လၧယ့ၫရှူၬဎရံၬ အဖၧၩ့ဆံၭ. အၩမံၩ့."
		}
	}
};
module.exports = book;